INSERT INTO `smartend_topics` (`id`, `title_ar`, `title_en`, `details_ar`, `details_en`, `date`, `expire_date`, `video_type`, `photo_file`, `attach_file`, `video_file`, `audio_file`, `icon`, `status`, `visits`, `webmaster_id`, `section_id`, `row_no`, `seo_title_ar`, `seo_title_en`, `seo_description_ar`, `seo_description_en`, `seo_keywords_ar`, `seo_keywords_en`, `seo_url_slug_ar`, `seo_url_slug_en`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(1, 'نبذة عن الشركة', 'Company profile', '<section id=\"content\" class=\"blog-02 pt-0\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"single-post mb-0\">\r\n            <!-- Single Post -->\r\n            <div class=\"entry clearfix\">\r\n              <div class=\"entry-content mt-0\">\r\n                <!-- Entry Image -->\r\n                <div class=\"entry-image alignright mt-0\"><img src=\"http://ataa.dreamsdevs.com/uploads/topics/16026038951501.jpg\" data-animate=\"fadeIn\"><br></div>\r\n                <!-- .entry-image end -->\r\n               <h3 class=\"mb-5 pt-0\">\r\n                  شركة عطاء التعليمية هي شركة سعودية مساهمة مدرجة\r\n                </h3>\r\n                <p class=\"mb-0\" align=\"justify\">\r\n                  وتعد من أكبر الشركات التعليمية الرائدة في المملكة العربية\r\n                  السعودية وتعود بداية تأسيس الشركة إلى العام 1413هـ (الموافق\r\n                  1992م)، وتعمل الشركة في قطاع التعليم منذ ما يقارب الثلاثين\r\n                  عامًا، وتعتبر إحدى أكبر الشركات التعليمية الرائدة في المملكة\r\n                  العربية السعودية\r\n                </p>\r\n                <p class=\"mb-0\">\r\n                  وتمارس الشركة أنشطتها الرئيسية من خلال تملكها ثلاثة عشر مجمعًا\r\n                  تعليميًا في منطقة الرياض متخصصة في تقديم خدمات التعليم الأهلي\r\n                  والتعليم الأجنبي لمختلف مراحل التعليم العام (قبل الجامعي)\r\n                  وبمختلف المناهج؛ السعودي بشقيه العام والتحفيظ، والمنهج\r\n                  البريطاني والأمريكي والفرنسي والهندي بالإضافة إلى المسار\r\n                  المصري\r\n                </p>\r\n                \r\n                \r\n                \r\n                <!-- Post Single - Content End -->\r\n              </div>\r\n<div class=\"alp\" style=\"margin-top: 2rem;\">\r\n                <p>\r\n                  تبلغ إجمالي مساحة المجمعات التابعة للشركة 199,038 مترًا\r\n                  مربعًا، وتبلغ الطاقة الاستيعابية للمجمعات مجتمعة 35,616 طالبًا\r\n                  وطالبة، وبلغ إجمالي عدد موظفيّ الشركة وشركاتها التابعة 3,245\r\n                  موظفًا وموظفة من الكادر التعليمي والإداري\r\n                </p>\r\n                <p>\r\n                  وقد أخذت الشركة على عاتقها تحقيق أعلى معايير الجودة العالمية في مدارسها والخدمات التي تقدمها لتحقق رؤيتها المستقبلية بأن تكون الخيار الأول للتعليم الأهلي، والأجنبي في المملكة العربية السعودية. من خلال عقد شراكات مع جهات عالمية متخصصة لتسهم في إعداد أبنائكم لمهام الحياة ومتطلبات   المستقبل مما أسهم في تحقيق مدارسها مراكز متقدمة في (ISO9001) وشهادة الجودة العالمية (ISO9002). العلمية والتربوية. حيث حصلت على شهادة الجودة العالمية. اختبارات مركز قياس الوطني والحصول على درجة التميز في تقييم المدارس السنوي على مستوى المملكة. وحصد العديد من الأوسمة والجوائز المحلية والإقليمية والدولية في شتى المسابقات العلمية\r\n                </p>\r\n                <p>\r\n                  ولشركة عطاء إسهامات فاعلة في (المشاركة) المجتمعية إيمانا\r\n                  بدورها الريادي في ترسيخ القيم ورفع مستوى الوعي وتعزيز جوانب\r\n                  الحياة الإنسانية والبيئية، لتحقق رسالتها بإعداد جيل معتز\r\n                  بقيمه، متوازن في شخصيته، مزود بالعلوم الحديثة، متقن للمهارات\r\n                  الحياتية اللازمة ليكون قيمة إضافية في مجتمعه ووطنه\r\n                </p>\r\n    </div>\r\n            </div>\r\n            <!-- .entry end -->\r\n          </div>\r\n        </div>\r\n      </section>\r\n\r\n<section id=\"content\" class=\"vision-mission\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"row justify-content-center col-mb-50\">\r\n            <div class=\"col-sm-6 col-lg-6\">\r\n              <div class=\"feature-box fbox-lg fbox-border fbox-light fbox-effect\" data-animate=\"fadeInUp\">\r\n                <div class=\"fbox-icon\">\r\n                  <div><i class=\"icon-glasses\"></i></div>\r\n                </div>\r\n                <div class=\"fbox-content\" style=\"padding: 10px 0;\">\r\n                  <h3 class=\"h-title\">رؤيتنا</h3>\r\n                </div>\r\n                <p class=\"mt-3 mb-0 pr-3 p-title\">\r\n                  أن تصبح شركة عطاء التعليمية الاختيار الأول للتعليم الأهلي\r\n                  والأجنبي في المملكة العربية السعودية.\r\n                </p>\r\n              </div>\r\n            </div>\r\n            <div class=\"col-sm-6 col-lg-6\">\r\n              <div class=\"feature-box fbox-lg fbox-border fbox-light fbox-effect\" data-animate=\"fadeInUp\">\r\n                <div class=\"fbox-icon\">\r\n                  <div><i class=\"icon-briefcase\"></i></div>\r\n                </div>\r\n                <div class=\"fbox-content\" style=\"padding: 10px 0;\">\r\n                  <h3>رسالتنا</h3>\r\n                </div>\r\n                <p class=\"mt-3 mb-0 pr-3\">\r\n                  إعداد جيل معتز بقيمه، متوازن في شخصيته، مزود بالعلوم الحديثة،\r\n                  متقن للمهارات الحياتية اللازمة ليكون قيمة إضافية في مجتمعه\r\n                  ووطنه\r\n                </p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>\r\n<section id=\"content\" class=\"educational-complexes\">\r\n        <div class=\"container clearfix\">\r\n          <h3 class=\"mb-3\">مجمعاتنا التعليمية الأهلية</h3>\r\n          <ul class=\"educational-complexes-list\">\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الرواد ـ فرع الازدهار</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الرواد ـ فرع أشبيلية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الرواد ـ فرع الروابي</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الرواد ـ فرع المنصورة</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الرواد ـ فرع الأندلس</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الفكر ـ في الرحمانية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس النخبة ـ في الخرج</a></li>\r\n          </ul>\r\n        </div>\r\n        <div class=\"container clearfix\">\r\n          <h3 class=\"mb-3 mt-5\">مجمعاتنا التعليمية العالمية</h3>\r\n          <ul class=\"educational-complexes-list\">\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الشرق الأوسط العالمية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس العروبة العالمية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس رواد أشبيلية العالمية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس السليمانية العالمية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الشرق الأوسط الحديثة العالمية</a></li>\r\n            <li><a href=\"#\" target=\"_blank\">مجمع مدارس الشرق الأوسط الجديدة العالمية</a></li>\r\n          </ul>\r\n        </div>\r\n      </section>', '<section id=\"content\" class=\"blog-02\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"single-post mb-0\">\r\n            <!-- Single Post -->\r\n            <div class=\"entry clearfix\">\r\n              <div class=\"entry-content mt-0\">\r\n                <!-- Entry Image -->\r\n                <div class=\"entry-image alignright\">\r\n                  <a href=\"#\"><img src=\"../frontEnd/img/page-02/left-img.png\" alt=\"Blog Single\"></a>\r\n                </div>\r\n                <!-- .entry-image end -->\r\n               <h3 class=\"mb-5 pt-5\">\r\n                  شركة عطاء التعليمية هي شركة سعودية مساهمة مدرجة\r\n                </h3>\r\n                <p class=\"mb-0\">\r\n                  وتعد من أكبر الشركات التعليمية الرائدة في المملكة العربية\r\n                  السعودية وتعود بداية تأسيس الشركة إلى العام 1413هـ (الموافق\r\n                  1992م)، وتعمل الشركة في قطاع التعليم منذ ما يقارب الثلاثين\r\n                  عامًا، وتعتبر إحدى أكبر الشركات التعليمية الرائدة في المملكة\r\n                  العربية السعودية\r\n                </p>\r\n                <p class=\"mb-0\">\r\n                  وتمارس الشركة أنشطتها الرئيسية من خلال تملكها ثلاثة عشر مجمعًا\r\n                  تعليميًا في منطقة الرياض متخصصة في تقديم خدمات التعليم الأهلي\r\n                  والتعليم الأجنبي لمختلف مراحل التعليم العام (قبل الجامعي)\r\n                  وبمختلف المناهج؛ السعودي بشقيه العام والتحفيظ، والمنهج\r\n                  البريطاني والأمريكي والفرنسي والهندي بالإضافة إلى المسار\r\n                  المصري\r\n                </p>\r\n                \r\n                \r\n                \r\n                <!-- Post Single - Content End -->\r\n              </div>\r\n<div class=\"alp\" style=\"margin-top: 2rem;\">\r\n                <p>\r\n                  تبلغ إجمالي مساحة المجمعات التابعة للشركة 199,038 مترًا\r\n                  مربعًا، وتبلغ الطاقة الاستيعابية للمجمعات مجتمعة 35,616 طالبًا\r\n                  وطالبة، وبلغ إجمالي عدد موظفيّ الشركة وشركاتها التابعة 3,245\r\n                  موظفًا وموظفة من الكادر التعليمي والإداري\r\n                </p>\r\n                <p>\r\n                  وقد أخذت الشركة على عاتقها تحقيق أعلى معايير الجودة العالمية\r\n                  في مدارسها والخدمات التي تقدمها لتحقق رؤيتها المستقبلية بأن\r\n                  تكون الخيار الأول للتعليم الأهلي، والأجنبي في المملكة العربية\r\n                  السعودية. من خلال عقد شراكات مع جهات عالمية متخصصة لتسهم في\r\n                  إعداد أبنائكم لمهام الحياة ومتطلبات المستقبل العلمية\r\n                  والتربوية. حيث حصلت على شهادة الجودة العالمية (ISO9002).\r\n                  وشهادة الجودة العالمية (ISO9001). مما أسهم في تحقيق مدارسها\r\n                  مراكز متقدمة في اختبارات مركز قياس الوطني والحصول على درجة\r\n                  التميز في تقييم المدارس السنوي على مستوى المملكة. وحصد العديد\r\n                  من الأوسمة والجوائز المحلية والإقليمية والدولية في شتى\r\n                  المسابقات العلمية\r\n                </p>\r\n                <p>\r\n                  ولشركة عطاء إسهامات فاعلة في (المشاركة) المجتمعية إيمانا\r\n                  بدورها الريادي في ترسيخ القيم ورفع مستوى الوعي وتعزيز جوانب\r\n                  الحياة الإنسانية والبيئية، لتحقق رسالتها بإعداد جيل معتز\r\n                  بقيمه، متوازن في شخصيته، مزود بالعلوم الحديثة، متقن للمهارات\r\n                  الحياتية اللازمة ليكون قيمة إضافية في مجتمعه ووطنه\r\n                </p>\r\n    </div>\r\n            </div>\r\n            <!-- .entry end -->\r\n          </div>\r\n        </div>\r\n      </section>\r\n\r\n<section id=\"content\" class=\"vision-mission\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"row justify-content-center col-mb-50\">\r\n            <div class=\"col-sm-6 col-lg-6\">\r\n              <div class=\"feature-box fbox-lg fbox-border fbox-light fbox-effect\">\r\n                <div class=\"fbox-icon\">\r\n                  <div><i class=\"icon-glasses\"></i></div>\r\n                </div>\r\n                <div class=\"fbox-content\" style=\"padding: 10px 0;\">\r\n                  <h3 class=\"h-title\">رؤيتنا</h3>\r\n                </div>\r\n                <p class=\"mt-3 mb-0 pr-3 p-title\">\r\n                  أن تصبح شركة عطاء التعليمية الاختيار الأول للتعليم الأهلي\r\n                  والأجنبي في المملكة العربية السعودية.\r\n                </p>\r\n              </div>\r\n            </div>\r\n            <div class=\"col-sm-6 col-lg-6\">\r\n              <div class=\"feature-box fbox-lg fbox-border fbox-light fbox-effect\">\r\n                <div class=\"fbox-icon\">\r\n                  <div><i class=\"icon-briefcase\"></i></div>\r\n                </div>\r\n                <div class=\"fbox-content\" style=\"padding: 10px 0;\">\r\n                  <h3>رسالتنا</h3>\r\n                </div>\r\n                <p class=\"mt-3 mb-0 pr-3\">\r\n                  إعداد جيل معتز بقيمه، متوازن في شخصيته، مزود بالعلوم الحديثة،\r\n                  متقن للمهارات الحياتية اللازمة ليكون قيمة إضافية في مجتمعه\r\n                  ووطنه\r\n                </p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>\r\n<section id=\"content\" class=\"educational-complexes\">\r\n        <div class=\"container clearfix\">\r\n          <h3 class=\"mb-3\">من أبرز المجمعات التعليمية الأهلية التابعة للشركة</h3>\r\n          <ul class=\"educational-complexes-list\">\r\n            <li>مجمعات مدارس الرواد ـ فرع الازدهار</li>\r\n            <li>مجمعات مدارس الرواد ـ فرع أشبيلية</li>\r\n            <li>مجمعات مدارس الرواد ـ فرع الروابي</li>\r\n            <li>مجمعات مدارس الرواد ـ فرع المنصورة</li>\r\n            <li>مجمعات مدارس الرواد ـ فرع الأندلس</li>\r\n            <li>مجمع مدارس الفكر ـ في الرحمانية</li>\r\n            <li>مجمع مدارس النخبة ـ في الخرج</li>\r\n          </ul>\r\n        </div>\r\n        <div class=\"container clearfix\">\r\n          <h3 class=\"mb-3 mt-5\">من أبرز المجمعات التعليمية العالمية التابعة للشركة</h3>\r\n          <ul class=\"educational-complexes-list\">\r\n            <li>مجمع مدارس الشرق الأوسط العالمية</li>\r\n            <li>مجمع مدارس العروبة العالمية</li>\r\n            <li>مجمع مدارس رواد أشبيلية العالمية</li>\r\n            <li>مجمع مدارس السليمانية العالمية</li>\r\n            <li>مجمع مدارس الشرق الأوسط الحديثة العالمية</li>\r\n            <li>مجمع مدارس الشرق الأوسط الجديدة العالمية</li>\r\n          </ul>\r\n        </div>\r\n      </section>', '2020-08-20', NULL, NULL, '', NULL, NULL, NULL, NULL, 1, 15, 1, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2020-08-20 12:58:49', '2020-12-10 11:37:21'),
(6, 'شهادة (نظام إدارة الجودة) آيزو ISO 9001', 'شهادة (نظام إدارة الجودة) آيزو ISO 9001', '<p class=\"mb-3\">\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\n                  </p>', '<p class=\"mb-3\">\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\n                  </p>', '2020-08-23', NULL, NULL, '15989441884925.png', NULL, NULL, NULL, NULL, 1, 0, 10, 0, 1, 'الاعتماد الاول', 'first dependence', 'الاعتماد الاول&nbsp;', 'first dependence', NULL, NULL, 'alaaatmad-alaol', 'first-dependence', 1, 1, '2020-08-23 04:43:27', '2020-09-20 11:21:58'),
(7, 'الاستراتيجية والاهداف', 'Strategy and objectives', '<section class=\"content strategy-objectives-company\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"row align-items-center col-mb-30 mt-0 strategy\">\r\n            <div class=\"col-md-6 text-center text-md-right\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3>الاستراتيجية</h3>\r\n             <p class=\"mb-3\" align=\"justify\">تبنت شركة عطاء توجهًا استراتيجيًا لتكون الخيار الأول للتعليم الأهلي والأجنبي <br> في المملكة العربية السعودية. وترتكز هذه الاستراتيجية على أربع ركائز  <br> أساسية:</p>\r\n              </div>\r\n\r\n              <ol>\r\n                <li>تعزيز الجودة التعليمية</li>\r\n                <li>زيادة حصة الشركة السوقية</li>\r\n                <li>تحسين كفاءة الإدارة التشغيلية</li>\r\n                <li>تجويد الخدمات المقدمة للطلاب وأولياء الأمور</li>\r\n              </ol>\r\n            </div>\r\n            <div class=\"col-md-6\">\r\n              <img src=\"http://ataa.dreamsdevs.com/uploads/topics/16061227291608.jpg\" data-animate=\"fadeIn\" alt=\"Image\" class=\"center-block\" style=\"text-align: left;\">\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"row align-items-center col-mb-30 mt-0 mt-lg-5 objectives-company\">\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/7.jpg\" data-animate=\"fadeIn\" alt=\"Image\" class=\"center-block\" style=\"text-align: left;\">\r\n            </div>\r\n            <div class=\"col-md-6 text-center text-md-right strategy\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3>اهداف الشركة</h3>\r\n              </div>\r\n              <ul>\r\n                <li>التأكيد على سمو وتلازم العمليتين التعليمية والتربوية.</li>\r\n                <li>التطبيق الفعال لنظام الجودة ، بما يتطابق ومتطلبات المواصفة العالمية ( آيزو 9001 – 2008م ) .</li>\r\n                <li>التطوير المستمر للخدمات التربوية والتعليمية بما يتوافق و متطلبات صناعة المعرفة</li>\r\n                <li>عقد شراكات مع عدد من المدارس الأهلية والأجنبية في الداخل والخارج لتقديم نموذج متميز في التعليم والتعلم</li>\r\n                <li>بناء ثقافة تشاركية في بيئة جاذبة تجذر شعور الانتماء والولاء المؤسسي .</li>\r\n                <li>ريادة المدارس في القدرات والتحصيلي .</li>\r\n                <li>بناء واستثمار التقنية لتسهم في تطوير العملية التعليمية والمخرج ليكون ذا قيمة مضافة .</li>\r\n              </ul>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>', '<section class=\"content strategy-objectives-company\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"row align-items-center col-mb-30 mt-0 mt-lg-5 strategy\">\r\n            <div class=\"col-md-6 text-center text-md-left\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3>الاستراتيجية</h3>\r\n             <p class=\"mb-3\" align=\"justify\">تبنت شركة عطاء توجهًا استراتيجيًا لتكون الخيار الأول للتعليم الأهلي والأجنبي <br> في المملكة العربية السعودية. وترتكز هذه الاستراتيجية على أربع ركائز  <br> أساسية:</p>\r\n              </div>\r\n\r\n              <ol>\r\n                <li>تعزيز الجودة التعليمية</li>\r\n                <li>زيادة حصة الشركة السوقية</li>\r\n                <li>تحسين كفاءة الإدارة التشغيلية</li>\r\n                <li>تجويد الخدمات المقدمة للطلاب وأولياء الأمور</li>\r\n              </ol>\r\n            </div>\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/left-img.png\" data-animate=\"fadeInUp\" alt=\"Image\" class=\"center-block\" style=\"text-align: left;\">\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"row align-items-center col-mb-30 mt-0 mt-lg-5 objectives-company\">\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/right-img.png\" data-animate=\"fadeInUp\" alt=\"Image\" class=\"center-block\" style=\"text-align: left;\">\r\n            </div>\r\n            <div class=\"col-md-6 text-center text-md-left strategy\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3>اهداف الشركة</h3>\r\n              </div>\r\n              <ul>\r\n                <li>التأكيد على سمو وتلازم العمليتين التعليمية والتربوية.</li>\r\n                <li>التطبيق الفعال لنظام الجودة ، بما يتطابق ومتطلبات المواصفة العالمية ( آيزو 9001 – 2008م ) .</li>\r\n                <li>التطوير المستمر للخدمات التربوية والتعليمية بما يتوافق و متطلبات صناعة المعرفة</li>\r\n                <li>عقد شراكات مع عدد من المدارس الأهلية والأجنبية في الداخل والخارج لتقديم نموذج متميز في التعليم والتعلم</li>\r\n                <li>بناء ثقافة تشاركية في بيئة جاذبة تجذر شعور الانتماء والولاء المؤسسي .</li>\r\n                <li>ريادة المدارس في القدرات والتحصيلي .</li>\r\n                <li>بناء واستثمار التقنية لتسهم في تطوير العملية التعليمية والمخرج ليكون ذا قيمة مضافة .</li>\r\n              </ul>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>', '2020-08-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 2, 'الاستراتيجية والاهداف', 'Strategy and objectives', 'سيتلتسيلمسيل&nbsp;', 'lglbrnlbnrlbnlenb', NULL, NULL, 'alastratygy-oalahdaf', 'strategy-and-objectives', 1, 1, '2020-08-23 07:55:20', '2020-11-23 09:12:31'),
