        <div class=\"left-category\">\r\n                  <ul>\r\n                    <li>بنين</li>\r\n                    <li>الفئة الأولى</li>\r\n                  </ul>\r\n                  <h4>مدارس الرواد الأهلية</h4>\r\n                  <p><i class=\"icon-map-marker2\"></i> فرع الازدهار</p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>\r\n\r\n      <section class=\"content table-ataa-achiev\">\r\n        <div class=\"container clearfix\">\r\n          <p class=\"mt-5 mb-5\">\r\n            إضافة إلى ذلك، حصلت بعض مدارس الشركة على اعتمادات أكاديمية من جهات\r\n            عالمية تعكس مدى تحقيق المدارس للمعايير ذات الصلة، ويوضح الجدول\r\n            التالي المجمعات الحاصلة على اعتمادات أكاديمية من جهات مختلفة: عالمية\r\n            تعكس مدى تحقيق المدارس للمعايير ذات الصلة، ويوضح الجدول التالي\r\n            المجمعات الحاصلة على اعتمادات أكاديمية من جهات مختلفة:\r\n          </p>\r\n          <div class=\"table-achievements\">\r\n            <div class=\"title-table\">\r\n              <div class=\"row\">\r\n                <div class=\"col-lg-1\">\r\n                  <h4 class=\"border-ri-rdius\"></h4>\r\n                </div>\r\n                <div class=\"col-lg-4 first-child\">\r\n                  <h4>\r\n                    المجمعات التعليمية\r\n                  </h4>\r\n                </div>\r\n                <div class=\"col-lg-4\">\r\n                  <h4>\r\n                    الجهة المانحة\r\n                  </h4>\r\n                </div>\r\n                <div class=\"col-lg-3\">\r\n                  <h4 class=\"border-lf-rdius\">\r\n                    تاريخ المنح\r\n                  </h4>\r\n                </div>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"table-atta table-1\">\r\n              <div class=\"row\">\r\n                <div class=\"col col-lg-1\">\r\n                  <div class=\"number\">1</div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"title-section\">\r\n                    <h5>مدارس الروّاد الأهلية فرع الازدهار</h5>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"text-section\">\r\n                    <p>شركة QMI الكندية</p>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-3\">\r\n                  <div class=\"btn-section\">1997م</div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"table-atta table-2\">\r\n              <div class=\"row\">\r\n                <div class=\"col col-lg-1\">\r\n                  <div class=\"number\">2</div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"title-section\">\r\n                    <h5>مدارس الروّاد الأهلية فرع المنصورة</h5>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"text-section\">\r\n                    <p>شركة SAI GLOBAL العالمية</p>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-3\">\r\n                  <div class=\"btn-section\">2015م</div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"table-atta table-3\">\r\n              <div class=\"row\">\r\n                <div class=\"col col-lg-1\">\r\n                  <div class=\"number\">3</div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"title-section\">\r\n                    <h5>مدارس الروّاد الأهلية فرع الروابي</h5>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"text-section\">\r\n                    <p>شركة SAI GLOBAL العالمية</p>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-3\">\r\n                  <div class=\"btn-section\">2016م</div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"table-atta table-4\">\r\n              <div class=\"row\">\r\n                <div class=\"col col-lg-1\">\r\n                  <div class=\"number\">4</div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"title-section\">\r\n                    <h5>مدارس الروّاد الأهلية فرع الأندلس</h5>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"text-section\">\r\n                    <p>شركة SAI GLOBAL العالمية</p>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-3\">\r\n                  <div class=\"btn-section\">2017م</div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"table-atta table-5\">\r\n              <div class=\"row\">\r\n                <div class=\"col col-lg-1\">\r\n                  <div class=\"number\">5</div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"title-section\">\r\n                    <h5>مدارس الروّاد الأهلية فرع إشبيليا</h5>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-4\">\r\n                  <div class=\"text-section\">\r\n                    <p>شركة SAI GLOBAL العالمية</p>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col col-lg-3\">\r\n                  <div class=\"btn-section\">2018م</div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>\r\n\r\n      <section class=\"accordion accordion-achiev\" data-collapsible=\"true\">\r\n        <div class=\"container\">\r\n          <div class=\"toggle toggle-border toggle-active p-4\">\r\n            <div class=\"accordion-header accordion-active\">\r\n              <div class=\"accordion-title\">الأداء التعليمي المميز</div>\r\n              <div class=\"accordion-icon\">\r\n                <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                <i class=\"accordion-open icon-chevron-down\"></i>\r\n              </div>\r\n            </div>\r\n            <div class=\"accordion-content pb-0 mb-0\" style=\"display: block\">\r\n              <p>\r\n                أبدى الطلاب والطالبات المسجلين في مدارس الشركة – في التعليم\r\n                الأهلي والتعليم الأجنبي على حد سواء – أداءً تعليميًا مميزًا في\r\n                نتائج الاختبارات ذات الصلة. فمن جانب التعليم الأهلي، أداء\r\n                الطلاب والطالبات في اختبارات القدرات والتحصيل التابعة للمركز\r\n                الوطني للقياس في ارتفاع مستمر وفق إحصائيات وزارة التعليم، وقد\r\n                حصلت مدارس الروّاد الأهلية فرع الازدهار (قسم البنات) على\r\n                المركز الأول بين جميع مدارس البنات (علمي ونظري) على مستوى\r\n                الرياض في نتائج اختبارات القدرات العامة للعامين 1438هـ/1439هـ.\r\n                (المركز الثاني للمسار النظري والمركز السابع للمسار العلمي على\r\n                مستوى المملكة). كما حصل فرع الازدهار للبنين على\r\n              </p>\r\n  \r\n              <p>\r\n                المركز الثاني على مستوى الرياض في نتائج اختبارات القدرات\r\n                (المركز التاسع على مستوى المملكة). وعادة ما يجتاز عدد من طلاب\r\n                مدارس الشركة اختبار مقياس موهبة المقدم من مؤسسة الملك عبد\r\n                العزيز ورجاله للموهبة والإبداع.\r\n              </p>\r\n  \r\n              <p>\r\n                ومن جانب التعليم الأجنبي، حظيت مدارس الشركة بسمعة جيدة فيما\r\n                يتعلق بالتميز التعليمي. فعلى سبيل المثال، يبلغ معدل نجاح طلاب\r\n                المنهج الهندي في مدارس الشرق الأوسط الحديثة العالمية ومدارس\r\n                الشرق الأوسط الجديدة العالمية نسبة 100٪ في اختبارات المجلس\r\n                المركزي للتعليم الثانوي (CBSE) وحصل عدد كبير من الطلاب على\r\n                درجات تزيد عن 90٪ منذ عام 2004م وحتى عام 2018م. إضافة إلى ذلك،\r\n                تم تصنيف مدارس الشرق الأوسط الجديدة العالمية من قبل المركز\r\n                الموحد لاختبار البحث في المواهب العلمية على المستوى الوطني\r\n                (National Level Science Talent Search Examination) كأفضل مدرسة\r\n                في هذا الاختبار منذ عام 2007م وحتى عام 2018م، كما حصل العديد\r\n                من طلاب مدرسة الشرق الأوسط الجديدة العالمية على أعلى درجات في\r\n                امتحانات الشهادة الدولية العامة للتعليم الثانوي (IGCSE) في\r\n                المملكة العربية السعودية منذ عام 2004م وحتى عام 2018م وتفوقوا\r\n                بالمجمل على أقرانهم في دول الخليج العربي في عدد من المجالات،\r\n                وذلك في المستويين (A) ADVANCED LEVEL و( AS)SUBSIDIARY LEVEL\r\n                ADVANCED المتعلقة بالمنهج البريطاني.\r\n              </p>\r\n            </div>\r\n          </div>\r\n  \r\n          <div class=\"toggle toggle-border toggle-active p-4\">\r\n            <div class=\"accordion-header accordion-active\">\r\n              <div class=\"accordion-title\">\r\n                الحضور البارز في المنافسات المحلية والدولية\r\n              </div>\r\n              <div class=\"accordion-icon\">\r\n                <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                <i class=\"accordion-open icon-chevron-down\"></i>\r\n              </div>\r\n            </div>\r\n            <div class=\"accordion-content pb-0 mb-0\" style=\"display: block\">\r\n              <p>\r\n                إضافة إلى الأداء التعليمي المميز، يحظى طلاب وطالبات مدارس\r\n                الشركة بحضور بارز في المنافسات المحلية والدولية في مختلف\r\n                المجالات وعادة ما يحققون مراكز متقدمة فيها. فمن جانب التعليم\r\n                الأهلي، يشارك الطلاب والطالبات بشكل دوري في مسابقات متنوعة في\r\n                مجالات العلوم والدين واللغة والفنون والرياضات البدنية وغيرها\r\n                على المستوى المحلي والمستوى الدولي. فعلى المستوى الدولي، شارك\r\n                طلاب مدارس الشركة في تمثيل المملكة في مسابقة أسبوع الفضاء\r\n                العالمي وحصل الطلاب المشاركون ضمن فريق المملكة على المركز\r\n                الأول على مستوى العالم للعام الثاني على التوالي في عام 2016م.\r\n                كما حصل الطلاب على مراكز متقدمة على مستوى العالم في برنامج\r\n                الماثليتكس للرياضيات وفي الأولمبياد الدولي للفيزياء في عام\r\n                2018م، بالإضافة إلى تميزهم في العديد من المشاركات على مستوى\r\n                المملكة في مسابقات العلوم والرياضيات والأولمبياد للإبداع\r\n                الوطني وفي مسابقة الرياضيات (كانجارو) وحصولهم على ميداليات\r\n                ذهبية وفضية وبرونزية فيها.\r\n              </p>\r\n              <p>\r\n                وتشمل إنجازات الطلاب والطالبات خلال العام 2018م – على سبيل\r\n                المثال لا الحصر – حصول عدد منهم على مراكز متقدمة على مستوى\r\n                المملكة في الأولمبياد الوطني للابتكارات العلمية وأفضل بحث علمي\r\n                (إنتل) فيه، وفي أولمبياد العلوم، وجائزة أفضل تصميم في أولمبياد\r\n                الروبوت.\r\n              </p>\r\n              <p>\r\n                ومن جانب التعليم الأجنبي، يشارك الطلاب والطالبات بشكل مستمر في\r\n                العديد من البرامج والمنافسات الدولية، منها منافسات أولمبياد\r\n                العلوم ومنافسة (Smart Brain) وغيرها. ويشارك طلاب مدارس الشرق\r\n                الأوسط العالمية – تحديدًا – في منافسات (Your World) العالمية\r\n                التي ينظمها المجلس الثقافي البريطاني سنويًا. أما مدارس الشرق\r\n                الأوسط الجديدة العالمية، فقد هيمنت في الأعوام من 2014م وحتى\r\n                2018م على مسابقة (Cluster Meet) الخاصة بالدارس التابعة للمجلس\r\n                المركزي للتعليم الثانوي (CBSE) في المنطقة الوسطى بحصولها على\r\n                عدد من الميداليات الذهبية والفضية والبرونزية في الألعاب\r\n                الرياضية وفي رياضة تنس الطاولة وتنس الريشة وذلك في قسميّ\r\n                البنين والبنات، كما قدّم طلابها أداءً مميزًا على مستوى منطقة\r\n                الخليج العربي.\r\n              </p>\r\n              <p>\r\n                كما قامت الشركة بتفعيل \"ساعة البرمجة\" العالمية التي يشارك فيها\r\n                عشرات الملايين من الشباب في أكثر من 180 دولة حول العالم، وذلك\r\n                في مبادرة \"السعودية تبرمج\" التي نشأت بالتعاون بين مؤسسة مسك\r\n                الخيرية ووزارة التعليم ومايكروسوفت. وقد احتلت المملكة العربية\r\n                السعودية المركز الرابع عالميًا في هذه الحملة في العام\r\n                2017م/2018م وتشكل مشاركة طلاب وطالبات مدارس الشركة ومعلميها\r\n                نسبة كبيرة من مشاركة المملكة، وتتوقع الشركة أن تزيد نسبة\r\n                المشاركين من منسوبيها في عام 2018م/2019مم بعد أن بدأت بتنفيذ\r\n                برنامج التعلم الإلكتروني وتطبيق ساعة البرمجة في جميع مدارسها.\r\n              </p>\r\n              <p>\r\n                هذا ولا يقتصر حضور طلاب الشركة وتميزهم في المنافسات التعليمية\r\n                فقط، حيث يشارك الطلاب في مسابقات متنوعة مثل حفظ القرآن الكريم\r\n                والحديث والسيرة النبوية ومسابقات اللغة العربية والمسابقات\r\n                الثقافية الأخرى، وقد حقق بعض الطلاب مراكز متقدمة في مسابقة\r\n                الفنون التشكيلية والتصميم الفني وأولمبياد اللغة العربية على\r\n                مستوى المنطقة. كما تميزوا في المنافسات الرياضية مثل مسابقة\r\n                الجودو التي حقق فيها أحد الطلاب المركز الثاني في على مستوى\r\n                منطقة الرياض، وبطولة خادم الحرمين للفروسية التي حصل فيها أحد\r\n                الطلاب على المركز الأول على مستوى المملكة وعلى مستوى الخليج\r\n                والمركز الرابع عالميًا.\r\n              </p>\r\n              <p>\r\n                وعادة ما يلتحق طلاب وطالبات مدارس الشركة – في التعليم الأهلي\r\n                والتعليم الأجنبي على حد سواء – بجامعات مرموقة بعد تخرجهم،\r\n                الأمر الذي يعكس جودة مخرجات التعليم في مدارس الشركة وأثر جهود\r\n                الشركة في تنمية شخصية الطلاب وصقل مواهبهم في شتى المجالات.\r\n              </p>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </section>', '2020-08-23', NULL, NULL, '', NULL, NULL, NULL, NULL, 1, 0, 1, 0, 4, 'الجودة والاعتمادات الاكاديمية', 'Quality and academic accreditation', 'سينبلنميسلميسلا', 'jssdgjdslg', NULL, NULL, 'algod-oalaaatmadat-alakadymy', 'quality-and-academic-accreditation', 1, 1, '2020-08-23 08:42:08', '2021-01-05 07:36:13');
