(12, 'الأداء التعليمي المميز', 'الأداء التعليمي المميز', '<div dir=\"rtl\">تؤمن الشركة بأن كادرها التعليمي يعد أهم عوامل جودة خدماتها المقدمة، \r\nوالتي تسعى الشركة على الحفاظ عليها وتعزيزها من خلال اتباع سياسة توظيف \r\nواضحة ومهنية وتقديم التدريب المستمر في أساليب ومهارات التعليم وإتاحة \r\nالفرص للتقدم الوظيفي. بالإضافة إلى ذلك، تقوم الشركة بتجهيز الفصول \r\nوالمختبرات والمرافق التابعة لمجمعات الشركة التعليمية بأحدث الأجهزة \r\nوالبرامج للرقي المستمر بالأداء التعليمي لمجمعاتها. وقد أدت جهود الشركة \r\nالمستمرة لخلق بيئة تشجع على تطوير التعليم إلى تقديم تجربة متميزة للطلاب \r\nوتحقيق الطلاب لأداء تعليمي متميز.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br></div>', '<div dir=\"ltr\"><div class=\"accordion-title h-title\">تؤمن الشركة بأن كادرها التعليمي يعد أهم عوامل جودة خدماتها المقدمة، \r\nوالتي تسعى الشركة على الحفاظ عليها وتعزيزها من خلال اتباع سياسة توظيف \r\nواضحة ومهنية وتقديم التدريب المستمر في أساليب ومهارات التعليم وإتاحة \r\nالفرص للتقدم الوظيفي. بالإضافة إلى ذلك، تقوم الشركة بتجهيز الفصول \r\nوالمختبرات والمرافق التابعة لمجمعات الشركة التعليمية بأحدث الأجهزة \r\nوالبرامج للرقي المستمر بالأداء التعليمي لمجمعاتها. وقد أدت جهود الشركة \r\nالمستمرة لخلق بيئة تشجع على تطوير التعليم إلى تقديم تجربة متميزة للطلاب \r\nوتحقيق الطلاب لأداء تعليمي متميز.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br></div></div>', '2020-08-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 11, 0, 1, 'الاول', 'first', 'qwfwqf', 'qedf', NULL, NULL, 'alaol-2', 'first-2', 1, 1, '2020-08-23 08:45:08', '2020-09-02 05:58:17'),
(13, 'كلمة رئيس مجلس الادارة', 'The word of the Chairman of the Board of Directors', '<section id=\"content\" class=\"\">\r\n    <div class=\"container clearfix\">\r\n<h3>كلمة رئيس مجلس الادارة</h3>\r\n      <div class=\"single-post mb-0\">\r\n        <!-- Single Post -->\r\n        <div class=\"entry clearfix\">\r\n          <div class=\"entry-content mt-0\">\r\n            <!-- Entry Image -->\r\n            <div class=\"entry-image alignleft\" style=\"background-size: cover; background-position: center; height: 365px; border-radius: 6px; overflow: hidden;\">\r\n              <a href=\"#\"><img src=\"../frontEnd/img/page-06/img-right.jpg\" data-animate=\"fadeIn\" alt=\"Blog Single\"></a>\r\n            </div>\r\n            <!-- .entry-image end -->\r\n\r\n            <p>\r\n              أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n              عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n              وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n              ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n              مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n              حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n              العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n              مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n              تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n              والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n              شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n              الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n              9001:2015) من شركة SAI GLOBAL العالمية.\r\n            </p>\r\n            <p>\r\n              مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n              التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n              والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n              للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n              وتوظيفها بشكل مستمر، وإجراء عمليات التدقيق الداخلي والخارجي\r\n              وغيرها من معايير. ويوضح الجدول التالي المجمعات التعليمية\r\n              الحاصلة على شهادة الجودة الشاملة\r\n            </p>\r\n            <p>\r\n              أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n              عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n              وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n              ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n              مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n              حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n              العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n              مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n              تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n              والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n              شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n              الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n              9001:2015) من شركة SAI GLOBAL العالمية.\r\n            </p>\r\n            <p>\r\n              تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015)\r\n              مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n              التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n              والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n              للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n            </p>\r\n            <blockquote class=\"quote\">\r\n              <h3>\r\n                أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                وقدرتها على تنظيم العمليات الإدارية في\r\n              </h3>\r\n            </blockquote>\r\n            <p class=\"mt-5\">\r\n              أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n              عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n              وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n              ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n              مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n              حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n              العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n              مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n              تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n              والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n              شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n              الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n              9001:2015) من شركة SAI GLOBAL العالمية.\r\n            </p>\r\n            <p>\r\n              تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015) مدى \r\n              تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n              التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n              والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n              للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n              وتوظيفها بشكل مستمر، وإجراء عمليات التدقيق الداخلي والخارجي\r\n              وغيرها من معايير.\r\n            </p>\r\n            <!-- Post Single - Content End -->\r\n          </div>\r\n        </div>\r\n        <!-- .entry end -->\r\n      </div>\r\n    </div>\r\n  </section>', '<section id=\"content\" class=\"Board--Directors\">\r\n        <div class=\"container clearfix\">\r\n    <h3>كلمة رئيس مجلس الادارة</h3>\r\n          <div class=\"single-post mb-0\">\r\n            <!-- Single Post -->\r\n            <div class=\"entry clearfix\">\r\n              <div class=\"entry-content mt-0\">\r\n                <!-- Entry Image -->\r\n                <div class=\"entry-image alignleft\">\r\n                  <a href=\"#\"><img src=\"../frontEnd/img/page-06/img-right.jpg\" alt=\"Blog Single\"></a>\r\n                </div>\r\n                <!-- .entry-image end -->\r\n\r\n                <p>\r\n                  أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                  عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                  وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                  ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n                  مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n                  حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n                  العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n                  مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n                  تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n                  والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n                  شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n                  الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n                  9001:2015) من شركة SAI GLOBAL العالمية.\r\n                </p>\r\n                <p>\r\n                  مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n                  التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n                  والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n                  للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n                  وتوظيفها بشكل مستمر، وإجراء عمليات التدقيق الداخلي والخارجي\r\n                  وغيرها من معايير. ويوضح الجدول التالي المجمعات التعليمية\r\n                  الحاصلة على شهادة الجودة الشاملة\r\n                </p>\r\n                <p>\r\n                  أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                  عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                  وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                  ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n                  مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n                  حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n                  العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n                  مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n                  تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n                  والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n                  شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n                  الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n                  9001:2015) من شركة SAI GLOBAL العالمية.\r\n                </p>\r\n                <p>\r\n                  تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015)\r\n                  مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n                  التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n                  والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n                  للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n                </p>\r\n                <blockquote class=\"quote\">\r\n                  <h3>\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في\r\n                  </h3>\r\n                </blockquote>\r\n                <p class=\"mt-5\">\r\n                  أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                  عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                  وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                  ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n                  مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n                  حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n                  العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n                  مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n                  تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n                  والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n                  شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n                  الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n                  9001:2015) من شركة SAI GLOBAL العالمية.\r\n                </p>\r\n                <p>\r\n                  مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n                  التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n                  والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n                  للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n                  وتوظيفها بشكل مستمر، وإجراء عمليات التدقيق الداخلي والخارجي\r\n                  وغيرها من معايير. ويوضح الجدول التالي المجمعات التعليمية\r\n                  الحاصلة على شهادة الجودة الشامل\r\n                </p>\r\n                <!-- Post Single - Content End -->\r\n              </div>\r\n            </div>\r\n            <!-- .entry end -->\r\n          </div>\r\n        </div>\r\n      </section>', '2020-08-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 5, 'كلمة رئيس مجلس الادارة', 'The word of the Chairman of the Board of Directors', 'ضصبصضب', 'بثضبث', NULL, NULL, 'klm-ryys-mgls-aladar', 'the-word-of-the-chairman-of-the-board-of-directors', 1, 1, '2020-08-23 08:48:32', '2020-11-18 12:28:21'),
(14, 'محطات زمنية', 'محطات زمنية', '<h3 class=\"h-title\">ملخص الأحداث التاريخية الرئيسية للشركة</h3>\r\n          <table class=\"table table-bordered\">\r\n            <tbody>\r\n              <tr>\r\n                <td>1991م</td>\r\n                <td>\r\n                  <li>تم تأسيس مؤسسة فردية باسم مدارس الروّاد الأهلية لصاحبها عبدالله بن إبراهيم الخلف</li>\r\n                  <li>تم افتتاح أول مجمع مدارس باسم مدارس الروّاد الأهلية في حي المغرزات بمدينة الرياض</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>1992م</td>\r\n                <td>\r\n                  <li>تم افتتاح فرع لمؤسسة مدارس الروّاد الأهلية لصاحبها عبدالله بن إبراهيم الخلف</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>1995م</td>\r\n                <td>\r\n                  <li>افتتحت الشركة مدارس الرواد الأهلية فرع الازدهار بشكل جزئي</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2002م</td>\r\n                <td>\r\n                  <li>تم تحويل فرع المؤسسة إلى شركة ذات مسؤولية محدودة باسم \"مدارس الروّاد الأهلية\" برأس مال قدره 6,860,000 ريال سعودي</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2005م</td>\r\n                <td>\r\n                  <li>بلغ عدد الطلاب والطالبات في المدارس التابعة للشركة 5,000 طالبًا وطالبة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2008م</td>\r\n                <td>\r\n                  <li>استحوذت الشركة على نسبة 95% من رأس مال شركة النخبة التعليمية</li>\r\n                  <li>استحوذت الشركة على مجمع مدارس بدر الأهلية، والذي تغير اسمه إلى مدارس الروّاد الأهلية فرع الروابي</li>\r\n                  <li>بلغ عدد الطلاب والطالبات في المدارس التابعة للشركة 10,000 طالبًا وطالبة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2010م</td>\r\n                <td>\r\n                  <li>تحولت الشركة إلى شركة مساهمة مقفلة باسم \"شركة الروّاد للتربية والتعليم\" ورُفع رأس مالها إلى 180,000,000 ريال سعودي</li>\r\n                  <li>تم تأسيس شركة الروّاد للخدمات المساندة التابعة للشركة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2011م</td>\r\n                <td>\r\n                  <li>تم تعديل اسم الشركة إلى \"شركة الروّاد الأهلية للتعليم والتدريب\"</li>\r\n                  <li>تم خفض رأس مال الشركة إلى 142,000,000 ريال سعودي</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2012م</td>\r\n                <td>\r\n                  <li>تم تعديل اسم الشركة إلى \"شركة عطاء التعليمية \"</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2014م</td>\r\n                <td>\r\n                  <li>استحوذت الشركة على نسبة الملكية المتبقية 5% من رأس مال شركة النخبة التعليمية لتصبح المالك لكامل رأس المال</li>\r\n                  <li>استحوذت الشركة على شركة العروبة العالمية للخدمات التعليمية</li>\r\n                  <li>بدأت الشركة تقديم خدمات التعليم الأجنبي للمنهج الأمريكي من خلال مدارس العروبة العالمية للبنين والبنات</li>\r\n                  <li>تم افتتاح مجمع الروّاد الأهلية فرع المنصورة التي قامت ببنائه الشركة وتم نقل طلاب مدارس النخبة الأهلية في حي المنصورة إليه</li>\r\n                  <li>بلغ عدد الطلاب والطالبات في المدارس التابعة للشركة 16,000 طالبًا وطالبة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2015م</td>\r\n                <td>\r\n                  <li>تم دمج مدارس الشرق الأوسط العالمية ومدارس الشرق الأوسط الجديدة العالمية ومدارس الشرق الأوسط الحديثة العالمية ومدارس السليمانية العالمية ومدارس جرير الأهلية ومدارس الفكر الأهلية في الشركة</li>\r\n                  <li>تم رفع رأس مال الشركة إلى 216,406,000 ريال سعودي</li>\r\n                  <li>بلغ عدد الطلاب والطالبات في المدارس التابعة للشركة 25,000 طالبًا وطالبة</li>\r\n                  <li>بدأت الشركة تقديم خدمات التعليم الأجنبي للمنهج البريطاني والفرنسي والهندي من خلال المدارس المندمجة فيها</li>\r\n                  <li>بدأت الشركة في تطوير مجمع مدارس الروّاد الأهلية فرع إشبيليا</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2017م</td>\r\n                <td>\r\n                  <li>افتتحت الشركة مدارس الروّاد الأهلية فرع إشبيليا بشكل جزئي</li>\r\n                  <li>إغلاق مدارس النخبة في حي المصيف وحي الخليج ونقل طلابها إلى مدارس الروّاد الأهلية فرع إشبيليا</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2018م</td>\r\n                <td>\r\n                  <li>افتتحت الشركة مدارس روّاد إشبيليا العالمية</li>\r\n                  <li>حصلت الشركة على ترخيص وزارة التعليم لتدريس المنهج المصري في مجمع الروّاد فرع إشبيليا</li>\r\n                  <li>تمت زيادة رأس مال الشركة إلى 400,000,000 ريال سعودي</li>\r\n                </td>\r\n              </tr>\r\n            </tbody>\r\n          </table>', '<h3 class=\"h-title\">ملخص الأحداث التاريخية الرئيسية للشركة</h3>\r\n          <table class=\"table table-bordered\">\r\n            <tbody>\r\n              <tr>\r\n                <td>1991م</td>\r\n                <td>\r\n                  <li>تم تأسيس مؤسسة فردية باسم مدارس الروّاد الأهلية لصاحبها عبدالله بن إبراهيم الخلف</li>\r\n                  <li>تم افتتاح أول مجمع مدارس باسم مدارس الروّاد الأهلية في حي المغرزات بمدينة الرياض</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>1992م</td>\r\n                <td>\r\n                  <li>تم افتتاح فرع لمؤسسة مدارس الروّاد الأهلية لصاحبها عبدالله بن إبراهيم الخلف</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>1995م</td>\r\n                <td>\r\n                  <li>افتتحت الشركة مدارس الرواد الأهلية فرع الازدهار بشكل جزئي</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2002م</td>\r\n                <td>\r\n                  <li>تم تحويل فرع المؤسسة إلى شركة ذات مسؤولية محدودة باسم \"مدارس الروّاد الأهلية\" برأس مال قدره 6,860,000 ريال سعودي</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2005م</td>\r\n                <td>\r\n                  <li>بلغ عدد الطلاب والطالبات في المدارس التابعة للشركة 5,000 طالبًا وطالبة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2008م</td>\r\n                <td>\r\n                  <li>استحوذت الشركة على نسبة 95% من رأس مال شركة النخبة التعليمية</li>\r\n                  <li>استحوذت الشركة على مجمع مدارس بدر الأهلية، والذي تغير اسمه إلى مدارس الروّاد الأهلية فرع الروابي</li>\r\n                  <li>بلغ عدد الطلاب والطالبات في المدارس التابعة للشركة 10,000 طالبًا وطالبة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2010م</td>\r\n                <td>\r\n                  <li>تحولت الشركة إلى شركة مساهمة مقفلة باسم \"شركة الروّاد للتربية والتعليم\" ورُفع رأس مالها إلى 180,000,000 ريال سعودي</li>\r\n                  <li>تم تأسيس شركة الروّاد للخدمات المساندة التابعة للشركة</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2011م</td>\r\n                <td>\r\n                  <li>تم تعديل اسم الشركة إلى \"شركة الروّاد الأهلية للتعليم والتدريب\"</li>\r\n                  <li>تم خفض رأس مال الشركة إلى 142,000,000 ريال سعودي</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2012م</td>\r\n                <td>\r\n                  <li>تم تعديل اسم الشركة إلى \"شركة عطاء التعليمية \"</li>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n                <td>2014م</td>\r\n                <td>\r\n                  <li>استحوذت الشركة على نسبة الملكية المتبقية 5% من رأس مال شركة النخ