ودي</li>\r\n                </td>\r\n              </tr>\r\n            </tbody>\r\n          </table>', '2020-08-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 7, 'ملخص الاحداث التاريخية الرئيسية للشركة', 'A summary of the main historical events of the company', 'ضصيصضي', 'صيضصي', NULL, NULL, 'mlkhs-alahdath-altarykhy-alryysy-llshrk', 'a-summary-of-the-main-historical-events-of-the-company', 1, 1, '2020-08-23 08:49:53', '2020-12-15 08:35:28'),
(15, 'فريق العمل', 'فريق العمل', '<section class=\"content management-team mb-5\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"heading-block border-bottom-0\">\r\n            <h3 class=\"mb-4\">\r\n              فريق إداري ذو خبرة عالية في قطاع التعليم\r\n            </h3>\r\n            <span>قامت الشركة بتعيين فريق إداري ذو خبرة عالية في قطاع التعليم في\r\n              المملكة العربية السعودية ملم بكافة جوانبه التشغيلية والمالية حيث\r\n              تركز الشركة على <br>استقطاب الخبرات والكفاءات العالية التي\r\n              تمكنها من فهم متطلبات السوق المتغيرة وتحقيق رؤية واستراتيجية\r\n              الشركة.</span>\r\n          </div>\r\n          <div class=\"promo promo-light-a p-3 mb-4\">\r\n            <h3 class=\"text-center mb-0\">الهيكل الإداري</h3>\r\n          </div>\r\n          <div class=\"row align-items-stretch clearfix\">\r\n            <div class=\"col-lg-4 col-md-6\">\r\n              <div class=\"promo-light-a pt-4 pb-4\" style=\"background-color: #1f2883 !important;\">\r\n                <h4 class=\"text-center mb-0\" style=\"color: #fff;\">\r\n                  لجنة الترشيحات والمكافآت\r\n                </h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6 executive-committee\">\r\n              <div class=\"promo-light-a pt-4 pb-4\" style=\"background-color: #1f2883 !important;\">\r\n                <h4 class=\"text-center mb-0\" style=\"color: #fff;\">\r\n                  اللجنة التنفيذية والاستثمار\r\n                </h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6\">\r\n              <div class=\"promo-light-a pt-4 pb-4\" style=\"background-color: #1f2883 !important;\">\r\n                <h4 class=\"text-center mb-0\" style=\"color: #fff;\">لجنة المراجعة الداخلية</h4>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <hr class=\"mt-0 mb-0\" style=\"width: 68.6%; border-width: 2px;\">\r\n          <div class=\"row align-items-stretch align-items-2 clearfix\">\r\n            <div class=\"col-lg-4 col-md-6 executive-committee-top\">\r\n              <div class=\"promo-light pt-3 pb-3\" style=\"background-color: #1f28831c !important;\">\r\n                <h4 class=\"text-center mb-0\">لجنة الترشيحات والمكافآت</h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6 executive-committee executive-committee-top top-2\">\r\n              <div class=\"promo-light pt-3 pb-3\" style=\"background-color: #1f28831c !important;\"> \r\n                <h4 class=\"text-center mb-0\">اللجنة التنفيذية والاستثمار</h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6 executive-committee-top\">\r\n              <div class=\"promo-light pt-3 pb-3\" style=\"background-color: #1f28831c !important;\">\r\n                <h4 class=\"text-center mb-0\">لجنة المراجعة الداخلية</h4>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <hr class=\"mt-0 mb-0\" style=\"border-width: 2px; width: 92%;\">\r\n          <ul class=\"department list-unstyled text-center d-flex mb-0\">\r\n            <li>الإدارة المالية</li>\r\n            <li>الإدارة العامة للإشراف والتطوير التربوي</li>\r\n            <li>الإدارة العامة للمجمعات التعليمية</li>\r\n            <li>إدارة الموارد البشرية</li>\r\n            <li>إدارة التسويق والمبيعات والشراكات</li>\r\n            <li>إدارة الإيرادات والتسجيل</li>\r\n            <li>إدارة تقنية المعلومات</li>\r\n            <li>إدارة الخدمات المساندة</li>\r\n          </ul>\r\n        </div>\r\n      </section>', '<section class=\"content management-team\">\r\n        <div class=\"container clearfix\">\r\n          <div class=\"heading-block border-bottom-0\">\r\n            <h3 class=\"mb-4\">\r\n              فريق إداري ذو خبرة عالية في قطاع التعليم\r\n            </h3>\r\n            <span>قامت الشركة بتعيين فريق إداري ذو خبرة عالية في قطاع التعليم في\r\n              المملكة العربية السعودية ملم بكافة جوانبه التشغيلية والمالية حيث\r\n              تركز الشركة على <br>استقطاب الخبرات والكفاءات العالية التي\r\n              تمكنها من فهم متطلبات السوق المتغيرة وتحقيق رؤية واستراتيجية\r\n              الشركة.</span>\r\n          </div>\r\n          <div class=\"promo promo-light-a p-3 mb-4\">\r\n            <h3 class=\"text-center mb-0\">مجلس الإدارة</h3>\r\n          </div>\r\n          <div class=\"row align-items-stretch clearfix\">\r\n            <div class=\"col-lg-4 col-md-6\">\r\n              <div class=\"promo-light-a pt-4 pb-4\">\r\n                <h4 class=\"text-center mb-0\">\r\n                  لجنة الترشيحات والمكافآت\r\n                </h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6 executive-committee\">\r\n              <div class=\"promo-light-a pt-4 pb-4\">\r\n                <h4 class=\"text-center mb-0\">\r\n                  اللجنة التنفيذية والاستثمار\r\n                </h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6\">\r\n              <div class=\"promo-light-a pt-4 pb-4\">\r\n                <h4 class=\"text-center mb-0\">لجنة المراجعة الداخلية</h4>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <hr class=\"mt-0 mb-0\" style=\"width: 68.6%; border-width: 2px;\">\r\n          <div class=\"row align-items-stretch align-items-2 clearfix\">\r\n            <div class=\"col-lg-4 col-md-6 executive-committee-top\">\r\n              <div class=\"promo-light pt-3 pb-3\">\r\n                <h4 class=\"text-center mb-0\">لجنة الترشيحات والمكافآت</h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6 executive-committee executive-committee-top top-2\">\r\n              <div class=\"promo-light pt-3 pb-3\">\r\n                <h4 class=\"text-center mb-0\">اللجنة التنفيذية والاستثمار</h4>\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-lg-4 col-md-6 executive-committee-top\">\r\n              <div class=\"promo-light pt-3 pb-3\">\r\n                <h4 class=\"text-center mb-0\">لجنة المراجعة الداخلية</h4>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <hr class=\"mt-0 mb-0\" style=\"border-width: 2px; width: 92%;\">\r\n          <ul class=\"department list-unstyled text-center d-flex mb-0\">\r\n            <li>الإدارة المالية</li>\r\n            <li>الإدارة العامة للإشراف والتطوير التربوي</li>\r\n            <li>الإدارة العامة للمجمعات التعليمية</li>\r\n            <li>إدارة الموارد البشرية</li>\r\n            <li>إدارة التسويق والمبيعات والشراكات</li>\r\n            <li>إدارة الإيرادات والتسجيل</li>\r\n            <li>إدارة تقنية المعلومات</li>\r\n            <li>إدارة الخدمات المساندة</li>\r\n          </ul>\r\n          <div class=\"teaching-staff\">\r\n            <div class=\"heading-block border-bottom-0\">\r\n              <h3>الكادر التعليمي</h3>\r\n            </div>\r\n            <p>\r\n              تحرص الشركة على الارتقاء بمعلميها في الجانب التعليمي وتعمل بموجب\r\n              سياسة انتقائية لاختيار الكفاءات الأقدر على المساهمة في تحقيق رؤية\r\n              الشركة ورسالتها. ويضم الكادر التعليمي لمدارس شركة عطاء التعليمية\r\n              نحو 257 معلمًا ومعلمة حاصلين على شهادات عليا من درجة الماجستير\r\n              والدكتوراة وما يعادلهما، منهم الحاصلين على شهادة الدكتوراة وشهادة\r\n              الماجستير ومنهم من اجتاز السنة التنفيذية لدراسة الماجستير. كما يضم\r\n              الكادر التعليمي معلمون بخبرات تتجاوز العشرين عامًا في مجال\r\n              التعليم.\r\n            </p>\r\n            <p>\r\n              وفضلًا عن حرص الشركة على استقطاب الكفاءات المتميزة، تبذل الشركة\r\n              جهودًا مستمرة للتطوير منسوبيها مهنيًا وتقديم المساندة والدعم لهم،\r\n              وتقوم بعقد دورات تدريبة وورش بشكل دوري يتم تصميمها بما يتناسب مع\r\n              الاحتياج الوظيفي للشركة والاحتياج الفردي للمنسوبين.\r\n            </p>\r\n            <p>\r\n              وقد قامت الشركة باستحداث جهاز إشرافي خاص بها يُعنى بالإشراف فنيًا\r\n              على الكادر التعليمي والتأكد من تطبيق استراتيجيات الشركة داخل\r\n              المدارس. من أبرز مهامه، تقويم أداء المعلمين والمعلمات باستخدام\r\n              أساليب تقويم مختلفة تشمل – على سبيل المثال – زيارات مستمرة للمدارس\r\n              وعقد اختبارات سنوية موحدة لجميع طلاب وطالبات المدارس الأهلية\r\n              التابعة لها ضمن برنامج قياس الكفاءة التعليمية لدى الطلاب بحيث\r\n              تتأكد من إتقان المعلم في إيصال المعلومة. وتوظّف الشركة نتائج هذه\r\n              الاختبارات في تطوير خدماتها التعليمية بشكل عام والتعرف على أوجه\r\n              القصور (إن وجدت) لمعالجتها في الوقت المناسب وبالطريقة الصحيحة.\r\n              وكان لهذه الجهود أثر ملموس في تحسن أداء الطلاب والطالبات في\r\n              اختبارات القدرات والتحصيل التابعة للمركز الوطني للقياس حسب تصنيف\r\n              وزارة التعليم خلال السنوات الماضية.\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </section>', '2020-08-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 8, 'مجلس الادارة', 'Board of Directors', 'صثبثصبثص', 'صثبثصب', NULL, NULL, 'mgls-aladar', 'board-of-directors-1', 1, 1, '2020-08-23 09:32:52', '2020-12-15 08:35:28'),
(16, 'طارق بن عثمان القصبي', 'طارق بن عثمان القصبي', NULL, NULL, '2020-08-23', NULL, NULL, '15981860166592.png', NULL, NULL, NULL, NULL, 1, 0, 12, 0, 1, 'الاول', 'first', 'ضصبضصب', 'ضب', NULL, NULL, 'alaol-3', 'first-3', 1, 1, '2020-08-23 09:33:37', '2020-09-02 07:39:33');
INSERT INTO `smartend_topics` (`id`, `title_ar`, `title_en`, `details_ar`, `details_en`, `date`, `expire_date`, `video_type`, `photo_file`, `attach_file`, `video_file`, `audio_file`, `icon`, `status`, `visits`, `webmaster_id`, `section_id`, `row_no`, `seo_title_ar`, `seo_title_en`, `seo_description_ar`, `seo_description_en`, `seo_keywords_ar`, `seo_keywords_en`, `seo_url_slug_ar`, `seo_url_slug_en`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(18, 'الحوكمة', 'Governance', '<style>\r\n  section#content.governance h3.title-page-atta {\r\n    margin-top: 0;\r\n    margin-bottom: 2.5rem;\r\n}\r\nh3 {\r\n    font-size: 1.75rem;\r\n}\r\n</style>\r\n<section id=\"content\" class=\"governance pt-0 pb-3\">\r\n    <div class=\"container clearfix\">\r\n      <h3 class=\"title-page-atta\">الحوكمة</h3>\r\n      <div class=\"Board-committees mb-2\">\r\n        <div class=\"row\">\r\n            <div class=\"col-md-6 col-lg-6\">\r\n                <h3 class=\"before-title\">مجلس الإدارة واللجان</h3>\r\n                <p>\r\n                أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة عالمية،\r\n                الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها وقدرتها على تنظيم\r\n                العمليات الإدارية في المدارس بطريقة مؤسسية ومنهجية مؤطرة. بدأت\r\n                الشركة في تطبيق نظام الجودة العالمي في مدارس الروّاد الأهلية منذ\r\n                عام 1417هـ (الموافق 1997م) عندما حصلت مدارس الروّاد الأهلية فرع\r\n                الازدهار على شهادة الجودة العالمية (ISO 9001) من شركة BSI\r\n                البريطانية وأصبحت بذلك أول مؤسسة تعليمية تحصل على هذه الشهادة في\r\n                منطقة الخليج العربي. ولم تكتف الشركة بهذا الإنجاز وإنما استمرت\r\n                المراجعات الداخلية والخارجية لسنوات متتالية حصلت الشركة خلالها على\r\n                نفس الشهادة من شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس\r\n                الروّاد الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n                9001:2015) من شركة SAI GLOBAL العالمية.\r\n                </p>\r\n                <p>\r\n                تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015) مدى\r\n                تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر التعليمي،\r\n                ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء، والمراجعة\r\n                الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة للتحسين، وتوثيق\r\n                النتائج والعمليات وجمع البيانات الإحصائية وتوظيفها بشكل مستمر،\r\n                وإجراء عمليات التدقيق الداخلي والخارجي وغيرها من معايير. ويوضح\r\n                الجدول التالي المجمعات التعليمية الحاصلة على شهادة الجودة الشاملة:\r\n                </p>\r\n                \r\n            </div>\r\n            <div class=\"col-md-6 col-lg-6\">\r\n                <div class=\"entry-image\">\r\n                    <a href=\"#\" data-lightbox=\"image\"><img src=\"../frontEnd/img/home-page/about-us.png\" data-animate=\"fadeIn\" alt=\"Standard Post with Image\"></a>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n        \r\n      </div>\r\n     \r\n      <div class=\"entry-committees mt-0\">\r\n        <div class=\"block-entry-committees\">\r\n          <h3 class=\"before-title-bord\">لجنة المراجعة</h3>\r\n          <p>\r\n            أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n            عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n            وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n            ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n            مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n            حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n            العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n            مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n            تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n            والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n            شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n            الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n            9001:2015) من شركة SAI GLOBAL العالمية.\r\n          </p>\r\n        </div>\r\n        <div class=\"block-entry-committees\">\r\n          <h3 class=\"before-title-bord\">اللجنة التنفيذية و الاستثمار</h3>\r\n          <p>\r\n            أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n            عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n            وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n            ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n            مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n            حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n            العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n            مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n            تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n            والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n            شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n            الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n            9001:2015) من شركة SAI GLOBAL العالمية.\r\n          </p>\r\n          <p>\r\n            تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015)\r\n            مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n            التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n            والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n            للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n            وتوظيفها بشكل مستمر، وإجراء عمليات التدقيق الداخلي والخارجي\r\n            وغيرها من معايير. ويوضح الجدول التالي المجمعات التعليمية\r\n            الحاصلة على شهادة الجودة الشاملة:\r\n          </p>\r\n        </div>\r\n        <div class=\"block-entry-committees\">\r\n          <h3 class=\"before-title-bord\">لجنة الترشيحات و المكافات</h3>\r\n          <p>\r\n            أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n            عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n            وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n            ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n            مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n            حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n            العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n            مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n            تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n            والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n            شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n            الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n            9001:2015) من شركة SAI GLOBAL العالمية.\r\n          </p>\r\n        </div>\r\n      </div>\r\n\r\n      \r\n    </div>\r\n    <div class=\"regulations-policies pb-0\">\r\n      <div class=\"container\">\r\n        <h3 class=\"before-title\">اللوائح والسياسات</h3>\r\n        <p>\r\n          أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n          عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n          وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n          ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n          مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n          حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n          العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n          مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n          تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n          والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n          شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n          الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n          9001:2015) من شركة SAI GLOBAL العالمية.\r\n        </p>\r\n        <p>\r\n          تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015)\r\n          مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n          التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n          والم