(35, 'عنوان الوظيفة يوضع هنا', 'emp first', 'أبدى الطلاب والطالبات المسجلين في مدارس الشركة – في التعليم الأهلي والتعليم الأجنبي على حد سواء – أداءً تعليميًا مميزًا في نتائج الاختبارات ذات الصلة. فمن جانب التعليم الأهلي، أداء الطلاب والطالبات في اختبارات القدرات والتحصيل التابعة للمركز الوطني للقياس في ارتفاع مستمر وفق إحصائيات وزارة التعليم، وقد حصلت مدارس الروّاد الأهلية فرع الازدهار (قسم البنات) على المركز الأول بين جميع مدارس البنات (علمي ونظري) على مستوى الرياض في نتائج اختبارات القدرات العامة للعامين 1438هـ/1439هـ. (المركز الثاني للمسار النظري والمركز السابع للمسار العلمي على مستوى المملكة). كما حصل فرع الازدهار للبنين على المركز الثاني على مستوى الرياض في نتائج اختبارات القدرات (المركز التاسع على مستوى المملكة). وعادة ما يجتاز عدد من طلاب مدارس الشركة اختبار مقياس موهبة المقدم من مؤسسة الملك عبد العزيز ورجاله للموهبة والإبداع.\r\n\r\nومن جانب التعليم الأجنبي، حظيت مدارس الشركة بسمعة جيدة فيما يتعلق بالتميز التعليمي. فعلى سبيل المثال، يبلغ معدل نجاح طلاب المنهج الهندي في مدارس الشرق الأوسط الحديثة العالمية ومدارس الشرق الأوسط الجديدة العالمية نسبة 100٪ في اختبارات المجلس المركزي للتعليم الثانوي (CBSE) وحصل عدد كبير من الطلاب على درجات تزيد عن 90٪ منذ عام 2004م وحتى عام 2018م.  إضافة إلى ذلك، تم تصنيف مدارس الشرق الأوسط الجديدة العالمية من قبل المركز الموحد لاختبار البحث في المواهب العلمية على المستوى الوطني (National Level Science Talent Search Examination) كأفضل مدرسة في هذا الاختبار منذ عام 2007م وحتى عام 2018م،  كما حصل العديد من طلاب مدرسة الشرق الأوسط الجديدة العالمية على أعلى درجات في امتحانات الشهادة الدولية العامة للتعليم الثانوي (IGCSE) في المملكة العربية السعودية منذ عام 2004م وحتى عام 2018م وتفوقوا بالمجمل على أقرانهم في دول الخليج العربي في عدد من المجالات، وذلك في المستويين (A) ADVANCED LEVEL و( AS)SUBSIDIARY LEVEL ADVANCED المتعلقة بالمنهج البريطاني.', 'صثب', '2020-08-24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 18, 0, 1, 'الوظيفة الاولى', 'emp first', 'صثب', 'صثب', NULL, NULL, 'alothyf-alaol', 'emp-first', 1, 1, '2020-08-24 05:42:39', '2020-11-18 12:46:28'),
(36, 'عنوان الوظيفة يوضع هنا', 'emp 2', 'أبدى الطلاب والطالبات المسجلين في مدارس الشركة – في التعليم الأهلي والتعليم الأجنبي على حد سواء – أداءً تعليميًا مميزًا في نتائج الاختبارات ذات الصلة. فمن جانب التعليم الأهلي، أداء الطلاب والطالبات في اختبارات القدرات والتحصيل التابعة للمركز الوطني للقياس في ارتفاع مستمر وفق إحصائيات وزارة التعليم، وقد حصلت مدارس الروّاد الأهلية فرع الازدهار (قسم البنات) على المركز الأول بين جميع مدارس البنات (علمي ونظري) على مستوى الرياض في نتائج اختبارات القدرات العامة للعامين 1438هـ/1439هـ. (المركز الثاني للمسار النظري والمركز السابع للمسار العلمي على مستوى المملكة). كما حصل فرع الازدهار للبنين على المركز الثاني على مستوى الرياض في نتائج اختبارات القدرات (المركز التاسع على مستوى المملكة). وعادة ما يجتاز عدد من طلاب مدارس الشركة اختبار مقياس موهبة المقدم من مؤسسة الملك عبد العزيز ورجاله للموهبة والإبداع.\r\n\r\nومن جانب التعليم الأجنبي، حظيت مدارس الشركة بسمعة جيدة فيما يتعلق بالتميز التعليمي. فعلى سبيل المثال، يبلغ معدل نجاح طلاب المنهج الهندي في مدارس الشرق الأوسط الحديثة العالمية ومدارس الشرق الأوسط الجديدة العالمية نسبة 100٪ في اختبارات المجلس المركزي للتعليم الثانوي (CBSE) وحصل عدد كبير من الطلاب على درجات تزيد عن 90٪ منذ عام 2004م وحتى عام 2018م.  إضافة إلى ذلك، تم تصنيف مدارس الشرق الأوسط الجديدة العالمية من قبل المركز الموحد لاختبار البحث في المواهب العلمية على المستوى الوطني (National Level Science Talent Search Examination) كأفضل مدرسة في هذا الاختبار منذ عام 2007م وحتى عام 2018م،  كما حصل العديد من طلاب مدرسة الشرق الأوسط الجديدة العالمية على أعلى درجات في امتحانات الشهادة الدولية العامة للتعليم الثانوي (IGCSE) في المملكة العربية السعودية منذ عام 2004م وحتى عام 2018م وتفوقوا بالمجمل على أقرانهم في دول الخليج العربي في عدد من المجالات، وذلك في المستويين (A) ADVANCED LEVEL و( AS)SUBSIDIARY LEVEL ADVANCED المتعلقة بالمنهج البريطاني.', 'ثضبثصب', '2020-08-24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 18, 0, 2, 'الوظيفة التانية', 'emp 2', 'صثبب', 'ثضبثصب', NULL, NULL, 'alothyf-altany', 'emp-2', 1, 1, '2020-08-24 05:43:12', '2020-11-18 12:47:06'),
(37, 'الوظائف المطلوبة', 'Required jobs', '<div dir=\"rtl\">ضثب</div>', '<div dir=\"ltr\">ثضيب</div>', '2020-08-24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 1, 0, 9, 'الوظائف المطلوبة', 'Required jobs', 'ضثب', 'ثضيب', NULL, NULL, 'alothayf-almtlob-1', 'required-jobs-1', 1, 1, '2020-08-24 05:47:46', '2020-12-15 08:35:28'),
(39, 'الخبر الاول', 'الخبر الاول', '<p class=\"pr-img\"> تعود بداية تأسيس شركة عطاء التعليمية إلى العام 1413هـ \r\n(الموافق 1992م) وهي الآن شركة مساهمة مقفلة سعودية تعمل الشركة في قطاع \r\nالتعليم العام الأهلي منذ ما يقارب الثلاثون عامًا، وتمارس أنشطتها \r\nالرئيسية من خلال تملك وتشغيل ثلاثة عشر مجمعًا تعليميًا في منطقة الرياض \r\nمتخصصة في تقديم خدمات التعليم في المناهج الأهلية والمناهج الأجنبية، بما \r\nفي ذلك المنهج الأمريكي والمنهج البريطاني والمنهج الهندي والمنهج الفرنسي \r\nوالمنهج المصري لمختلف مراحل التعليم العام (قبل الجامعي). بالإضافة إلى \r\nذلك، تملك الشركة مركز لتعليم اللغة الإنجليزية بالشراكة مع المجلس الثقافي\r\n البريطاني معتمد لعقد اختبار الآيلتس (IELTS) ومعتمد من كامبردج \r\n(Cambridge English Language Assessment) لعقد اختبارات تقييم اللغة \r\nالإنجليزية.تعود بداية تأسيس شركة عطاء التعليمية إلى العام 1413هـ \r\n(الموافق 1992م) وهي الآن شركة مساهمة مقفلة سعودية تعمل الشركة في قطاع \r\nالتعليم العام الأهلي منذ ما يقارب الثلاثون عامًا، وتمارس أنشطتها \r\n                </p><p>تعد الشركة إحدى أكبر الشركات التعليمية الرائدة في \r\nالمملكة العربية السعودية حيث تقع المجمعات التابعة للشركة على مساحة \r\n199,038 مترًا مربعًا وتحتوي على 1,640 فصلًا دراسيًا بطاقة استيعابية \r\nإجمالية تبلغ نحو 35,616 طالبًا وطالبة للمجمعات مجتمعة، وبلغ إجمالي عدد \r\nالطلاب والطالبات المسجلين في مدارس الشركة كما في عام 2018م أكثر من \r\n26,000 طالبًا وطالبة وبلغ إجمالي عدد موظفيّ الشركة وشركاتها التابعة \r\n3,488 موظفًا وموظفة من الكادر التعليمي والإداري\r\n                </p><p>\r\n                  وقد قامت الشركة في إطار خططها في التوسع والنمو بمجموعة\r\n عمليات اندماج واستحواذ ناجحة تمثلت في الاستحواذ على مدارس بدر الأهلية \r\nومدارس العروبة العالمية ومدارس النخبة التعليمية بالإضافة إلى دمج ست \r\nمدارس أخرى في الشركة.\r\n                </p><p>\r\n                  تولي الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير \r\nجودة عالمية في مدارسها والخدمات التي تقدمها حيث حققت مجموعة من المجمعات \r\nالتعليمية التابعة للشركة تصنيف ممتاز من وزارة التعليم حيث حصلت على \r\n“الفئة الأولى” في سجل تقييم المدارس السنوي على مستوى مدارس المنطقة لعدة \r\nأعوام دراسية، فضلًا عن حصول بعض المجمعات التعليمية على اعتمادات أكاديمية\r\n من جهات عالمية تعكس مدى تحقيق تلك المجمعات للمعايير ذات العلاقة .تعد \r\nالشركة إحدى أكبر الشركات التعليمية الرائدة في المملكة العربية السعودية \r\nحيث تقع المجمعات التابعة للشركة على مساحة 199,038 مترًا مربعًا وتحتوي \r\nعلى 1,640 فصلًا دراسيًا بطاقة استيعابية إجمالية تبلغ نحو 35,616 طالبًا \r\nوطالبة للمجمعات مجتمعة، وبلغ إجمالي عدد الطلاب والطالبات المسجلين في \r\nمدارس الشركة كما في عام 2018م أكثر من 26,000 طالبًا وطالبة وبلغ إجمالي \r\nعدد موظفيّ الشركة وشركاتها التابعة 3,488 موظفًا وموظفة من الكادر \r\nالتعليمي والإداري.\r\n                </p><p class=\"mb-3\">\r\n                \r\n                \r\n                \r\n                </p><p>\r\n                  وقد قامت الشركة في إطار خططها في التوسع والنمو بمجموعة\r\n عمليات اندماج واستحواذ ناجحة تمثلت في الاستحواذ على مدارس بدر الأهلية \r\nومدارس العروبة العالمية ومدارس النخبة التعليمية بالإضافة إلى دمج ست \r\nمدارس أخرى في الشركة.                 </p>', '<p class=\"pr-img\" style=\"text-align: left; \">                   تعود بداية تأسيس شركة عطاء التعليمية إلى العام 1413هـ \r\n(الموافق 1992م) وهي الآن شركة مساهمة مقفلة سعودية تعمل الشركة في قطاع \r\nالتعليم العام الأهلي منذ ما يقارب الثلاثون عامًا، وتمارس أنشطتها \r\nالرئيسية من خلال تملك وتشغيل ثلاثة عشر مجمعًا تعليميًا في منطقة الرياض \r\nمتخصصة في تقديم خدمات التعليم في المناهج الأهلية والمناهج الأجنبية، بما \r\nفي ذلك المنهج الأمريكي والمنهج البريطاني والمنهج الهندي والمنهج الفرنسي \r\nوالمنهج المصري لمختلف مراحل التعليم العام (قبل الجامعي). بالإضافة إلى \r\nذلك، تملك الشركة مركز لتعليم اللغة الإنجليزية بالشراكة مع المجلس الثقافي\r\n البريطاني معتمد لعقد اختبار الآيلتس (IELTS) ومعتمد من كامبردج \r\n(Cambridge English Language Assessment) لعقد اختبارات تقييم اللغة \r\nالإنجليزية.تعود بداية تأسيس شركة عطاء التعليمية إلى العام 1413هـ \r\n(الموافق 1992م) وهي الآن شركة مساهمة مقفلة سعودية تعمل الشركة في قطاع \r\nالتعليم العام الأهلي منذ ما يقارب الثلاثون عامًا، وتمارس أنشطتها \r\n                </p><p style=\"text-align: left;\">\r\n                  عد الشركة إحدى أكبر الشركات التعليمية الرائدة في \r\nالمملكة العربية السعودية حيث تقع المجمعات التابعة للشركة على مساحة \r\n199,038 مترًا مربعًا وتحتوي على 1,640 فصلًا دراسيًا بطاقة استيعابية \r\nإجمالية تبلغ نحو 35,616 طالبًا وطالبة للمجمعات مجتمعة، وبلغ إجمالي عدد \r\nالطلاب والطالبات المسجلين في مدارس الشركة كما في عام 2018م أكثر من \r\n26,000 طالبًا وطالبة وبلغ إجمالي عدد موظفيّ الشركة وشركاتها التابعة \r\n3,488 موظفًا وموظفة من الكادر التعليمي والإداري\r\n                </p><p style=\"text-align: left;\">\r\n                  وقد قامت الشركة في إطار خططها في التوسع والنمو بمجموعة\r\n عمليات اندماج واستحواذ ناجحة تمثلت في الاستحواذ على مدارس بدر الأهلية \r\nومدارس العروبة العالمية ومدارس النخبة التعليمية بالإضافة إلى دمج ست \r\nمدارس أخرى في الشركة.\r\n                </p><p style=\"text-align: left;\">\r\n                  تولي الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير \r\nجودة عالمية في مدارسها والخدمات التي تقدمها حيث حققت مجموعة من المجمعات \r\nالتعليمية التابعة للشركة تصنيف ممتاز من وزارة التعليم حيث حصلت على \r\n“الفئة الأولى” في سجل تقييم المدارس السنوي على مستوى مدارس المنطقة لعدة \r\nأعوام دراسية، فضلًا عن حصول بعض المجمعات التعليمية على اعتمادات أكاديمية\r\n من جهات عالمية تعكس مدى تحقيق تلك المجمعات للمعايير ذات العلاقة .تعد \r\nالشركة إحدى أكبر الشركات التعليمية الرائدة في المملكة العربية السعودية \r\nحيث تقع المجمعات التابعة للشركة على مساحة 199,038 مترًا مربعًا وتحتوي \r\nعلى 1,640 فصلًا دراسيًا بطاقة استيعابية إجمالية تبلغ نحو 35,616 طالبًا \r\nوطالبة للمجمعات مجتمعة، وبلغ إجمالي عدد الطلاب والطالبات المسجلين في \r\nمدارس الشركة كما في عام 2018م أكثر من 26,000 طالبًا وطالبة وبلغ إجمالي \r\nعدد موظفيّ الشركة وشركاتها التابعة 3,488 موظفًا وموظفة من الكادر \r\nالتعليمي والإداري.\r\n                </p><p class=\"mb-3\">\r\n                \r\n                \r\n                \r\n                </p><p style=\"text-align: left; \">\r\n                  وقد قامت الشركة في إطار خططها في التوسع والنمو بمجموعة\r\n عمليات اندماج واستحواذ ناجحة تمثلت في الاستحواذ على مدارس بدر الأهلية \r\nومدارس العروبة العالمية ومدارس النخبة التعليمية بالإضافة إلى دمج ست \r\nمدارس أخرى في الشركة.                 </p>', '2020-08-24', NULL, NULL, '16061435422576.jpg', NULL, NULL, NULL, NULL, 1, 2, 3, 0, 1, 'الاول', 'first', 'wef', 'ewf', NULL, NULL, 'alaol', 'first', 1, 1, '2020-08-24 07:56:37', '2020-11-23 14:59:02'),
