(41, 'حدود سطرين فقط هذا النص هو مثال لنص في', 'حدود سطرين فقط هذا النص هو مثال لنص في', '<p class=\"mb-3\">\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\n                  </p>', '<p class=\"mb-3\">\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\n                  </p>', '2020-08-24', NULL, NULL, '16061435752145.jpg', NULL, NULL, NULL, NULL, 1, 0, 3, 0, 2, 'فففف', 'ffff', 'شسبشسب', 'ششيبشسب', NULL, NULL, 'ffff', 'ffff', 1, 1, '2020-08-24 09:10:20', '2020-11-23 14:59:35'),
