(47, 'نبذة مختصرة', 'Brief summary', '<style>.Investor-relations h3.h-title {\r\n    margin-bottom: 0.5rem !important;\r\n}</style>\r\n<div class=\"single-post mb-0\">\r\n            <!-- Single Post -->\r\n            <div class=\"entry clearfix\">\r\n              <div class=\"entry-content mt-0\">\r\n                <!-- Entry Image -->\r\n                <div class=\"entry-image alignright mt-0\">\r\n                  <a href=\"#\"><img src=\"../frontEnd/img/page-06/img-left.png\" data-animate=\"fadeIn\" alt=\"Blog Single\"></a>\r\n                </div>\r\n                <!-- .entry-image end -->\r\n             <h3 class=\"h-title mb-5\">\r\n                  عنوان جديد مختصر عن المستثمرين بحدود سطرين فقط\r\n                </h3>\r\n                <p class=\"p-title mb-0\" style=\"margin-bottom: 0 !important;\">\r\nتعود بداية تأسيس شركة عطاء التعليمية إلى العام 1413هـ (الموافق 1992م).<br>\r\n                     تعمل الشركة في قطاع التعليم العام الأهلي منذ ما يقارب الثلاثين عامًا، وتمارس أنشطتها الرئيسية من خلال تملك وتشغيل ثلاثة عشر مجمعًا تعليميًا في منطقة الرياض متخصصة في تقديم خدمات التعليم في المناهج الأهلية والمناهج الأجنبية، بما في ذلك المنهج الأمريكي والمنهج البريطاني والمنهج الهندي والمنهج الفرنسي والمنهج المصري لمختلف مراحل التعليم العام (قبل الجامعي).    \r\n                </p>\r\n                <!-- Post Single - Content End -->\r\n              </div>\r\n              <p class=\"p-title mb-4 mt-0\">\r\n              وتعد الشركة إحدى أكبر الشركات التعليمية الرائدة في المملكة العربية السعودية، حيث تقع المجمعات التابعة للشركة على مساحة تتجاوز 200 ألف مترًا مربعًا تقريباً وتحتوي على 1,788فصلًا دراسيًا بطاقة استيعابية إجمالية تبلغ نحو 40,165 طالبًا وطالبة للمجمعات مجتمعة، وبلغ إجمالي عدد الطلاب والطالبات المسجلين في مدارس الشركة في عام 2019-2020م أكثر من 27,300 طالبًا وطالبة.\r\n\r\n              </p>\r\n              <p class=\"p-title mb-3\">\r\n                تولي الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة عالمية في مدارسها والخدمات التي تقدمها، حيث حققت مجموعة من المجمعات التعليمية التابعة للشركة تصنيف ممتاز من وزارة التعليم، حيث حصلت على «الفئة الأولى» في سجل تقييم المدارس السنوي على مستوى مدارس المنطقة لعدة أعوام دراسية، فضلًا عن حصول بعض المجمعات التعليمية على اعتمادات أكاديمية من جهات عالمية تعكس مدى تحقيق تلك المجمعات للمعايير ذات العلاقة.\r\n              </p>\r\n\r\n              <p class=\"p-title mb-1\">\r\nيتمثل النشاط الرئيسي للشركة في تقديم الخدمات التعليمية لمرحلة التعليم العام قبل الجامعي، بالإضافة إلى الخدمات المكملة لها مثل خدمات نقل الطلاب والطالبات والنوادي الرياضية وبرامج الأندية الصيفية التي تنظمها سنويًا تحت إشراف وزارة التعليم وخدمات تعليم اللغة الإنجليزية. \r\n              </p>\r\n\r\n              <p class=\"p-title\">\r\nتشغّل الشركة وتملك – بشكل مباشر وغير مباشر – ثلاثة عشر مجمعًا تعليميًا موزعة في مواقع متفرقة في منطقة الرياض في المملكة العربية السعودية، وتشغّل الشركة نوعين من المجمعات:\r\n              </p>\r\n              \r\n              <h3 class=\"mb-3 mt-3\">مجمعات التعليم الأهلي</h3>\r\n              <p>\r\nوتشمل مجموعة المدارس المرخصة من وزارة التعليم لتدريس المنهج الوطني السعودي وفق المقررات الصادرة من وزارة التعليم بالإضافة إلى عددٍ من المقررات الإضافية المعتمدة من وزارة التعليم، بلغ عدد مجمعات التعليم الأهلي التابعة للشركة سبعة مجمعات تقدم خدماتها التعليمية وفق المنهج الوطني السعودي.\r\n              </p>\r\n\r\n              <h3 class=\"mb-3 mt-3\">مجمعات التعليم الأجنبي</h3>\r\n              <p>\r\nوتشمل مجموعة المدارس المرخصة من وزارة التعليم لتدريس المناهج غير السعودية وفق اشتراطات ومعايير محددة، بلغ عدد مجمعات التعليم الأجنبي التابعة للشركة ستة مجمعات تقدم خدماتها التعليمية وفق المنهج الأمريكي والمنهج البريطاني والمنهج الفرنسي والمنهج الهندي.\r\n              </p>\r\n            </div>\r\n            <!-- .entry end -->\r\n          </div>', '<div class=\"single-post mb-0\">\r\n            <!-- Single Post -->\r\n            <div class=\"entry clearfix\">\r\n              <div class=\"entry-content mt-0\">\r\n                <!-- Entry Image -->\r\n                <div class=\"entry-image alignright\">\r\n                  <a href=\"#\"><img src=\"../frontEnd/img/page-06/img-left.png\" alt=\"Blog Single\"></a>\r\n                </div>\r\n                <!-- .entry-image end -->\r\n             <h3 class=\"h-title mb-5\">\r\n                  عنوان جديد مختصر عن المستثمرين بحدود سطرين فقط\r\n                </h3>\r\n                <p class=\"p-title mb-5\">\r\n                  تعود بداية تأسيس شركة عطاء التعليمية إلى العام 1413هـ (الموافق\r\n                  1992م) وهي الآن شركة مساهمة مقفلة سعودية تعمل الشركة في قطاع\r\n                  التعليم العام الأهلي منذ ما يقارب الثلاثون عامًا، وتمارس\r\n                  أنشطتها الرئيسية من خلال تملك وتشغيل ثلاثة عشر مجمعًا تعليميًا\r\n                  في منطقة الرياض متخصصة في تقديم خدمات التعليم في المناهج\r\n                  الأهلية والمناهج الأجنبية، بما في ذلك المنهج الأمريكي والمنهج\r\n                  البريطاني والمنهج الهندي والمنهج الفرنسي والمنهج المصري لمختلف\r\n                  مراحل التعليم العام (قبل الجامعي). بالإضافة إلى ذلك، تملك\r\n                  الشركة مركز لتعليم اللغة الإنجليزية بالشراكة مع المجلس الثقافي\r\n                  البريطاني معتمد لعقد اختبار الآيلتس (IELTS) ومعتمد من كامبردج\r\n                  (Cambridge English Language Assessment) لعقد اختبارات تقييم\r\n                  اللغة الإنجليزية.\r\n                </p>\r\n                <!-- Post Single - Content End -->\r\n              </div>\r\n              <p class=\"p-title mb-4 mt-5\">\r\n                أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                ومنهجية مؤطرة. بدأت الشركة في تطبيق نظام الجودة العالمي في\r\n                مدارس الروّاد الأهلية منذ عام 1417هـ (الموافق 1997م) عندما\r\n                حصلت مدارس الروّاد الأهلية فرع الازدهار على شهادة الجودة\r\n                العالمية (ISO 9001) من شركة BSI البريطانية وأصبحت بذلك أول\r\n                مؤسسة تعليمية تحصل على هذه الشهادة في منطقة الخليج العربي. ولم\r\n                تكتف الشركة بهذا الإنجاز وإنما استمرت المراجعات الداخلية\r\n                والخارجية لسنوات متتالية حصلت الشركة خلالها على نفس الشهادة من\r\n                شركة QMI الكندية، إلى أن حصلت جميع مجمعات مدارس الروّاد\r\n                الأهلية على شهادة الجودة الشاملة وفق أحدث مواصفة (ISO\r\n                9001:2015) من شركة SAI GLOBAL العالمية.\r\n              </p>\r\n              <p class=\"p-title\">\r\n                تشمل معايير الحصول على شهادة الجودة الشاملة (ISO 9001:2015)\r\n                مدى تحقيق رضا المستفيدين من الطلاب وأولياء الأمور والكادر\r\n                التعليمي، ووجود إجراءات التقويم الذاتي وصولًا لتحسين الأداء،\r\n                والمراجعة الشاملة لكافة الأشكال التنظيمية والإجراءات المتبعة\r\n                للتحسين، وتوثيق النتائج والعمليات وجمع البيانات الإحصائية\r\n                وتوظيفها بشكل مستمر، وإجراء عمليات التدقيق الداخلي والخارجي\r\n                وغيرها من معايير. ويوضح الجدول التالي المجمعات التعليمية\r\n                الحاصلة على شهادة الجودة الشاملة:\r\n              </p>\r\n            </div>\r\n            <!-- .entry end -->\r\n          </div>\r\n        \r\n      \r\n\r\n      <section id=\"content\" class=\"Company-Data\">\r\n        <div class=\"container\">\r\n          <h3 class=\"h-title\">بيانات الشركة في تداول</h3>\r\n          <div class=\"row\">\r\n            <div class=\"col-md-3 pr-0 pl-0\">\r\n              <img src=\"../frontEnd/img/page-06/right-tadawl.png\" alt=\"tadawl\">\r\n            </div>\r\n            <div class=\"col-md-9\">\r\n              <p class=\"p-title mb-5\">\r\n                تعمل شركة عطاء في قطاع التعليم منذ ما يقارب الثلاثين عامًا،\r\n                وتعتبر إحدى أكبر الشركات التعليمية الرائدة في المملكة العربية\r\n                السعودية. تمارس الشركة أنشطتها الرئيسية من خلال تملكها ثلاثة عشر\r\n                مجمعًا تعليميًا في منطقة الرياض متخصصة في تقديم خدمات التعليم\r\n                الأهلي والتعليم الأجنبي لمختلف مراحل التعليم العام (قبل\r\n                الجامعي).\r\n              </p>\r\n              <p class=\"p-title last-child\">\r\n                للمزيد من المعلومات حول الشركة وأداء السهم عبر موقع تداول\r\n              </p>\r\n              <a href=\"#\" class=\"button button-border button-rounded button-about-company\">أقراء المزيد</a>\r\n            </div>\r\n            \r\n          </div>\r\n     </div></section>', '2020-08-26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 23, 0, 1, 'ف', 'ف', 'ف', 'ف', NULL, NULL, 'f', 'f', 1, 1, '2020-08-26 08:13:43', '2020-12-14 13:09:29'),
(49, 'السؤال الاول', 'question one', 'السؤال الاول', 'question one', '2020-08-28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 26, 0, 1, 'السؤال الاول', 'question one', 'السؤال الاول', 'question one', NULL, NULL, 'alsoal-alaol', 'question-one', 1, 1, '2020-08-28 02:57:14', '2020-11-21 12:57:37'),
(50, 'نبذة عن المجمعات', 'About the complexes', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n            <h3>المجمعات التعليمية</h3>\r\n            <span>بدأت الشركة مسيرتها نحو الريادة في قطاع التعليم في عام 1991م من مجمع مدارس الروّاد الأهلية (فرع الازدهار حاليًا)، وقامت بتوسيع أعمالها خلال سنوات إلى أن أصبحت تشغّل ثلاثة عشر مجمعًا تعليميًا في منطقة الرياض على مستوى عالٍ من الجودة والكفاءة بمساحة إجمالية تبلغ 199,038 مترًا مربعًا وبطاقة استيعابية تبلغ 35,616 طالبًا وطالبة .</span>\r\n          </div>\r\n          <div class=\"row mt-0 mt-lg-5 strategy\">\r\n            <div class=\"col-md-6 text-center text-md-left\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\" style=\"text-align: right; \">مجمعات التعليم الأهلي</h3>\r\n              </div>\r\n              <p class=\"p-title mb-3\" style=\"text-align: right;\">وتشمل مجموعة المدارس المرخصة من وزارة التعليم لتدريس المنهج الوطني السعودي وفق المقررات الصادرة من وزارة التعليم بالإضافة إلى عددٍ من المقررات الإضافية المعتمدة من وزارة التعليم. وتقدم الشركة خدمات التعليم الأهلي في سبعة مجمعات وذلك لجميع مراحل التعليم العام، بدءًا من مرحلة رياض الأطفال وحتى المرحلة الثانوية وفق المنهج الوطني السعودي الذي يعتمد على المقررات الصادرة من وزارة التعليم بالإضافة إلى عدد من المقررات الإضافية والإثرائية المعتمدة من الوزارة. وتسعى الشركة لتقديم خدمات تعليمية متميزة مع حرصها على الاستجابة لمتطلبات السوق وتوفير خيارات متعددة لأولياء الأمور في اختيار المسار الأنسب لأبنائهم وبناتهم الراغبين في الالتحاق بمدارس التعليم الأهلي.</p>\r\n            </div>\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/img-left-mjm3at.png\" data-animate=\"fadeIn\" alt=\"Image\" class=\"center-block\">\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"row mt-3 mt-lg-5  objectives-company\">\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/img-right-mjm3at.png\" data-animate=\"fadeIn\" alt=\"Image\" class=\"center-block\">\r\n            </div>\r\n            <div class=\"col-md-6 text-center text-md-left strategy mt-3 mt-md-0\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\" style=\"text-align: right; \">مجمعات التعليم الأجنبي</h3>\r\n              </div>\r\n              <p class=\"p-title\" style=\"text-align: right;\">وتشمل مجموعة المدارس المرخصة من وزارة التعليم لتدريس المناهج غير السعودية وفق اشتراطات ومعايير محددة، بلغ عدد مجمعات التعليم الأجنبي التابعة للشركة ستة مجمعات تقدم خدماتها التعليمية وفق المنهج الأمريكي والمنهج البريطاني والمنهج الفرنسي والمنهج الهندي والمنهج المصري.</p>\r\n              <ul>\r\n                <li style=\"text-align: right;\">المنهج الأمريكي</li>\r\n                <li style=\"text-align: right;\">المنهج البريطاني</li>\r\n                <li style=\"text-align: right;\">المنهج الفرنسي</li>\r\n                <li style=\"text-align: right;\">المنهج الهندي</li>\r\n                <li style=\"text-align: right; \">المنهج المصري</li>\r\n              </ul>\r\n            </div>\r\n          </div>', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n            <h3>المجمعات التعليمية</h3>\r\n            <span>بدأت الشركة مسيرتها نحو الريادة في قطاع التعليم في عام 1991م من مجمع مدارس الروّاد الأهلية (فرع الازدهار حاليًا)، وقامت بتوسيع أعمالها خلال سنوات إلى أن أصبحت تشغّل ثلاثة عشر مجمعًا تعليميًا في منطقة الرياض على مستوى عالٍ من الجودة والكفاءة بمساحة إجمالية تبلغ 199,038 مترًا مربعًا وبطاقة استيعابية تبلغ 35,616 طالبًا وطالبة .</span>\r\n          </div>\r\n          <div class=\"row mt-0 mt-lg-5 strategy\">\r\n            <div class=\"col-md-6 text-center text-md-left\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\" style=\"text-align: right; \">مجمعات التعليم الأهلي</h3>\r\n              </div>\r\n              <p class=\"p-title mb-3\" style=\"text-align: right;\">وتشمل مجموعة المدارس المرخصة من وزارة التعليم لتدريس المنهج الوطني السعودي وفق المقررات الصادرة من وزارة التعليم بالإضافة إلى عددٍ من المقررات الإضافية المعتمدة من وزارة التعليم. وتقدم الشركة خدمات التعليم الأهلي في سبعة مجمعات وذلك لجميع مراحل التعليم العام، بدءًا من مرحلة رياض الأطفال وحتى المرحلة الثانوية وفق المنهج الوطني السعودي الذي يعتمد على المقررات الصادرة من وزارة التعليم بالإضافة إلى عدد من المقررات الإضافية والإثرائية المعتمدة من الوزارة. وتسعى الشركة لتقديم خدمات تعليمية متميزة مع حرصها على الاستجابة لمتطلبات السوق وتوفير خيارات متعددة لأولياء الأمور في اختيار المسار الأنسب لأبنائهم وبناتهم الراغبين في الالتحاق بمدارس التعليم الأهلي.</p>\r\n            </div>\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/img-left-mjm3at.png\" alt=\"Image\" class=\"center-block\">\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"row mt-lg-5 objectives-company\">\r\n            <div class=\"col-md-6\">\r\n              <img src=\"../frontEnd/img/page-02/img-right-mjm3at.png\" alt=\"Image\" class=\"center-block\">\r\n            </div>\r\n            <div class=\"col-md-6 text-center text-md-left strategy\">\r\n              <div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\" style=\"text-align: right; \">مجمعات التعليم الأجنبي</h3>\r\n              </div>\r\n              <p class=\"p-title\" style=\"text-align: right;\">وتشمل مجموعة المدارس المرخصة من وزارة التعليم لتدريس المناهج غير السعودية وفق اشتراطات ومعايير محددة، بلغ عدد مجمعات التعليم الأجنبي التابعة للشركة ستة مجمعات تقدم خدماتها التعليمية وفق المنهج الأمريكي والمنهج البريطاني والمنهج الفرنسي والمنهج الهندي والمنهج المصري.</p>\r\n              <ul>\r\n                <li style=\"text-align: right;\">المنهج الأمريكي</li>\r\n                <li style=\"text-align: right;\">المنهج البريطاني</li>\r\n                <li style=\"text-align: right;\">المنهج الفرنسي</li>\r\n                <li style=\"text-align: right;\">المنهج الهندي</li>\r\n                <li style=\"text-align: right; \">المنهج المصري</li>\r\n              </ul>\r\n            </div>\r\n          </div>', '2020-08-29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 27, 0, 1, 'نبذة عن المجمعات', 'About the complexes', 'صثبثصل', 'صبثصب', NULL, NULL, 'nbth-aan-almgmaaat', 'about-the-complexes', 1, 1, '2020-08-29 12:12:02', '2020-11-23 12:55:33'),
(51, 'ما يميز المجمعات', 'What distinguishes the complexes', '<div class=\"container clearfix\">\r\n<h3 class=\" mb-5\">مايميز المجمعات التعليمية</h3>\r\n <p class=\"mb-3\">\r\n            تسعى شركة عطاء التعليمية  لتهيئة بيئة مدرسية فريدة من نوعها تكون جاذبة ومحفّزة لطلابها بتوفير كافة الإمكانات اللازمة لإثرائهم معرفيًا من خلال تنظيم العديد من الأنشطة والفعاليات التي تساهم في بناء شخصية الطالب وإثرائه علميًا وثقافيًا من الناحية الشخصية والاجتماعية، حيث تنظم مدارس الشركة برامج متنوعة تهدف إلى تقديم مادة علمية إثرائية للراغبين في الاستزادة في أحد الجوانب العلمية أو تطوير مهارات معينة. فبالإضافة إلى الحصص الأسبوعية المقررة ضمن الجدول الدراسي لتدريب الطلاب على اختبارات القدرات والتحصيل، توفر الشركة لطلابها برامج تدريبية متخصصة في هذين الاختبارين تُعقد خارج أوقات عمل المدارس.\r\n          </p>\r\n\r\n<p class=\"mb-5\">\r\nبالإضافة إلى اهتمام الشركة في الجانب التعليمي لطلابها، تحرص الشركة على توفير بيئة مدرسية تساهم في بناء شخصية الطالب وإكسابه مهارات جديدة في الجوانب الأخرى، حيث تنظم الشركة برامج للتدريب على السباحة والفروسية وأنشطة رياضية مسائية أخرى. كما تنظم بين الحين والآخر برامج للتدريب على المهارات الحياتية مثل القيادة والإلقاء والحوار والتواصل الاجتماعي والتفكير الابداعي.\r\n</p>\r\n<div class=\"teaching-staff\">\r\n            <div class=\"heading-block border-bottom-0\">\r\n              <h3>الكادر التعليمي</h3>\r\n            </div>\r\n            <p>\r\n              تحرص الشركة على الارتقاء بمعلميها في الجانب التعليمي وتعمل بموجب\r\n              سياسة انتقائية لاختيار الكفاءات الأقدر على المساهمة في تحقيق رؤية\r\n              الشركة ورسالتها. ويضم الكادر التعليمي لمدارس شركة عطاء التعليمية\r\n              نحو 257 معلمًا ومعلمة حاصلين على شهادات عليا من درجة الماجستير\r\n              والدكتوراة وما يعادلهما، منهم الحاصلين على شهادة الدكتوراة وشهادة\r\n              الماجستير ومنهم من اجتاز السنة التنفيذية لدراسة الماجستير. كما يضم\r\n              الكادر التعليمي معلمون بخبرات تتجاوز العشرين عامًا في مجال\r\n              التعليم.\r\n            </p>\r\n            <p>\r\n              وفضلًا عن حرص الشركة على استقطاب الكفاءات المتميزة، تبذل الشركة\r\n              جهودًا مستمرة للتطوير منسوبيها مهنيًا وتقديم المساندة والدعم لهم،\r\n              وتقوم بعقد دورات تدريبة وورش بشكل دوري يتم تصميمها بما يتناسب مع\r\n              الاحتياج الوظيفي للشركة والاحتياج الفردي للمنسوبين.\r\n            </p>\r\n            <p>\r\n              وقد قامت الشركة باستحداث جهاز إشرافي خاص بها يُعنى بالإشراف فنيًا\r\n              على الكادر التعليمي والتأكد من تطبيق استراتيجيات الشركة داخل\r\n              المدارس. من أبرز مهامه، تقويم أداء المعلمين والمعلمات باستخدام\r\n              أساليب تقويم مختلفة تشمل – على سبيل المثال – زيارات مستمرة للمدارس\r\n              وعقد اختبارات سنوية موحدة لجميع طلاب وطالبات المدارس الأهلية\r\n              التابعة لها ضمن برنامج قياس الكفاءة التعليمية لدى الطلاب بحيث\r\n              تتأكد من إتقان المعلم في إيصال المعلومة. وتوظّف الشركة نتائج هذه\r\n              الاختبارات في تطوير خدماتها التعليمية بشكل عام والتعرف على أوجه\r\n              القصور (إن وجدت) لمعالجتها في الوقت المناسب وبالطريقة الصحيحة.\r\n              وكان لهذه الجهود أثر ملموس في تحسن أداء الطلاب والطالبات في\r\n              اختبارات القدرات والتحصيل التابعة للمركز الوطني للقياس حسب تصنيف\r\n              وزارة التعليم خلال السنوات الماضية.\r\n            </p>\r\n          </div>\r\n\r\n          <h3 class=\"h-title mb-3 mt-5\" \"=\"\">خدمات النقل</h3>\r\n          <p class=\"p-title mb-5\">\r\n            حرصًا من الشركة على تقديم خدمات متكاملة وتوفير كافة سبل الراحة\r\n            لعملائها من الطلاب والطالبات وأولياء أمورهم، تقدّم الشركة خدمات نقل\r\n            الطلاب والطالبات من المدارس وإليها برسوم سنوية محددة في جميع\r\n            مجمعاتها التعليمية، ولدى الشركة وشركاتها التابعة أسطولًا يضم أكثر من\r\n            مائتين (200) حافلة مخصصة لنقل الطلاب والطالبات من المجمعات التعليمية\r\n            وإليها.\r\n          </p>\r\n          <h3 class=\"h-title mb-3\" \"=\"\">البيئة المدرسية</h3>\r\n          <p class=\"p-title mb-5\">\r\n            تسعى الشركة لتهيئة بيئة مدرسية فريدة من نوعها تكون جاذبة ومحفّزة\r\n            لمنسوبي المدارس من الطلاب والمعلمين والإداريين، وتهتم الشركة بشكل\r\n            خاص بجودة مرافق مدارسها وكفاءة كادرها التعليمي من الناحية التعليمية،\r\n            بالإضافة إلى تنظيم العديد من الأنشطة والفعاليات التي تساهم في بناء\r\n            شخصية الطالب وإثرائه علميًا وثقافيًا من الناحية الشخصية والاجتماعية.\r\n            وفيما يلي وصف مختصر للبيئة المدرسية داخل المجمعات.\r\n          </p>\r\n          <div class=\"school-facilities\">\r\n            <h3 class=\"h-title mb-3\" \"=\"\">مرافق المدارس</h3>\r\n            <p class=\"p-title mb-5\">\r\n              تعتبر مرافق المدارس أحد المعايير المؤثرة على مدى إقبال الطلاب\r\n              والطالبات على الانضمام لمدارس الشركة. وقد أولت الشركة عناية خاصة\r\n              لهذا الجانب لتوفير بيئة مناسبة ترقى لمستوى جودة الخدمات التعليمية\r\n              المقدمة حيث تم تجهيز المرافق التابعة لمجمعات الشركة بأحدث الأجهزة\r\n              والبرامج لدعم الأداء التعليمي، وتقوم الشركة بأعمال صيانة وتحسينات\r\n              دورية مستمرة للحفاظ على مبانيها والمرافق التابعة لها مع حرصها على\r\n              الالتزام بمتطلبات وزارة التعليم والجهات الحكومية ذات الصلة فيما\r\n              يتعلق بسلامة المنشآت وجودتها. وتشتمل جميع المجمعات بحد أدنى على\r\n              المرافق الأساسية التالية:\r\n            </p>\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-6\">\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">الفصول الدراسية</h4>\r\n                  <p class=\"p-title\">\r\n                    تم تجهيز جميع فصول مدارس الشركة بالتقنيات الحديثة من جهاز حاسب\r\n                    آلي مع ملحقاته وبروجكتر وسبورات ذكية تشجع التعليم التفاعلي\r\n                    داخل الفصل. كما تحتوي بعض الفصول الدراسية على البروجكتر\r\n                    التفاعلي.\r\n                  </p>\r\n                </div>\r\n\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">المسارح</h4>\r\n                  <p class=\"p-title\">\r\n                    وهي مسارح متعددة الأغراض مجهزة بأهم التقنيات اللازمة تخدم\r\n                    المجمع<br> بالكامل.\r\n                  </p>\r\n                </div>\r\n\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">معامل الحاسب الآلي</h4>\r\n                  <p class=\"p-title\">\r\n                    تحتوي مجمعات الشركة على معامل للحاسب الآلي مجهزة بالكامل\r\n                    بأنظمة حديثة. وإضافة إلى ذلك، تحتوي بعض مجمعات الشركة على\r\n                    معامل خاصة للغة.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n\r\n              <div class=\"col-lg-6\">\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">المقاصف</h4>\r\n                  <p class=\"p-title\">\r\n                    تخضع مقاصف مدارس الشركة لمراجعات دورية للتأكد من امتثالها\r\n                    لاشتراطات النظافة والصحة، وعادة ما تتعاقد الشركة مع جهات\r\n                    خارجية لتشغيل مقاصفها.\r\n                  </p>\r\n                </div>\r\n\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">المختبرات</h4>\r\n                  <p class=\"p-title\">\r\n                    تم تجهيز المختبرات العلمية في مدارس الشركة بكل ما يحتاجه\r\n                    الطالب والمعلم من أجهزة وأدوات ومواد مناسبة للمناهج المقدمة\r\n                    لتطبيق الدروس عمليًا.\r\n                  </p>\r\n                </div>\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">الساحات</h4>\r\n                  <p class=\"p-title\">\r\n                    تحتوي مدارس الشركة على ساحات داخلية و/أو خارجية يقضي فيها\r\n                    الطلاب أوقاتهم خارج الفصول الدراسية ويتم تنظيم بعض الأنشطة\r\n                    اللامنهجية فيها من وقتٍ لآخر.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n            <p class=\"p-title\">\r\n              وبالإضافة إلى المرافق الأساسية المذكورة أعلاه، تحتوي بعض مدارس\r\n              الشركة على مرافق إضافية تميزها عن غيرها، منها على سبيل المثال:\r\n            </p>\r\n          </div>\r\n\r\n</div>          \r\n        \r\n      \r\n\r\n     <section class=\"content scientific-clubs\">\r\n    <div class=\"container clearfix\">\r\n      <h3 class=\"h-title mb-3\" \"=\"\">النوادي العلمية</h3>\r\n      <p class=\"p-title mb-5\">\r\n        تولي الشركة اهتمامًا كبيرًا للبحث العلمي والابتكار وتسعى لإعداد\r\n        جيل من الطلاب يكون قادرًا على الابتكار والتعامل مع التقنية ليسير\r\n        بخطى واثقة نحو رؤية المملكة 2030. وقد كان للشركة قدم السبق في\r\n        هذا المجال إذ افتتحت في عام 1420هـ (الموافق 1999م) أول نادٍ علمي\r\n        مدرسي على مستوى منطقة الرياض يهدف إلى رعاية الطلاب في مجالات\r\n        العلوم المختلفة وتدريبهم على البحث العلمي وتطوير أفكارهم\r\n        لتحويلها إلى ابتكارات علمية مع التركيز على إعداد الطلاب للمشاركة\r\n        في المسابقات والأنشطة العلمية على مستوى الوزارة والمنشآت\r\n        التعليمية الأخرى. ويحتوي على خمسة أقسام مختلفة:\r\n      </p>\r\n      <div class=\"accordion\" data-collapsible=\"true\">\r\n        <div class=\"toggle toggle-border toggle-active p-4\">\r\n          <div class=\"accordion-header accordion-active\">\r\n            <div class=\"accordion-title h-title\">\r\n              الورشة الإلكترونية\r\n            </div>\r\n            <div class=\"accordion-icon\">\r\n              <i class=\"accordion-open icon-chevron-down\"></i>\r\n              <i class=\"accordion-closed icon-chevron-up\"></i>\r\n            </div>\r\n          </div>\r\n          <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: block\">\r\n            وهي ورشة مجهزة بكافة أجزاء ومكونات الدوائر الإلكترونية، يتعلم فيها الطالب توصيل الدوائر الإلكترونية وتصنيع وصيانة الأجهزة الكهربائية والإلكترونية\r\n          </div>\r\n        </div>\r\n\r\n        <div class=\"toggle toggle-border toggle-active p-4\">\r\n          <div class=\"accordion-header\">\r\n            <div class=\"accordion-title h-title\">القبة الفلكية</div>\r\n            <div class=\"accordion-icon\">\r\n              <i class=\"accordion-open icon-chevron-down\"></i>\r\n              <i class=\"accordion-closed icon-chevron-up\"></i>\r\n            </div>\r\n          </div>\r\n          <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n            يتعلم فيها الطالب أساسيات علم الفلك والأجرام السماوية ويشبع رغباته في معرفة الفضاء الشاسع من خلال مرصد فلكي رقمي بالنادي يّمكن الطالب من رؤية الكواكب والأقمار بوضوح وتتبع مساراتها. \r\n          </div>\r\n        </div>\r\n\r\n        <div class=\"toggle toggle-border toggle-active p-4\">\r\n          <div class=\"accordion-header\">\r\n            <div class=\"accordion-title h-title\">\r\n              الصناعات الكيميائية\r\n            </div>\r\n            <div class=\"accordion-icon\">\r\n              <i class=\"accordion-open icon-chevron-down\"></i>\r\n              <i class=\"accordion-closed icon-chevron-up\"></i>\r\n            </div>\r\n          </div>\r\n          <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n            وهي غرفة للصناعات الكيميائية يتعلم فيها الطالب تركيب العطور وصناعة الصابون والمنظفات.\r\n          </div>\r\n        </div>\r\n\r\n        <div class=\"toggle toggle-border toggle-active p-4\">\r\n          <div class=\"accordion-header\">\r\n            <div class=\"accordion-title h-title\">معمل الروبوتات</div>\r\n            <div class=\"accordion-icon\">\r\n              <i class=\"accordion-open icon-chevron-down\"></i>\r\n              <i class=\"accordion-closed icon-chevron-up\"></i>\r\n            </div>\r\n          </div>\r\n          <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n            يضم العديد من أنواع الروبوتات، حيث يتعلم الطالب مكونات الروبوت وفك الجهاز وتركيبه ثم برمجته وتشغيله. \r\n          </div>\r\n        </div>\r\n\r\n        <div class=\"toggle toggle-border toggle-active p-4 mb-5\">\r\n          <div class=\"accordion-header\">\r\n            <div class=\"accordion-title h-title\">\r\n              متحف الحيوانات المحنطة\r\n            </div>\r\n            <div class=\"accordion-icon\">\r\n              <i class=\"accordion-open icon-chevron-down\"></i>\r\n              <i class=\"accordion-closed icon-chevron-up\"></i>\r\n            </div>\r\n          </div>\r\n          <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n            وهو متحف مجهز على أحدث مستوى يضم عدد من الحيوانات من بيئات مختلفة مثل الضب والغزال من جزيرة العرب، والفلامنجو من أمريكا الجنوبية، والكنغر من أستراليا، والفهد من أفريقيا. ويهدف المتحف إلى تعريف الطلاب على الحيوانات من مختلف البيئات والتي تم تشريحها وتحنيطها من قبل الطلاب من خلال دورات تدريبية في هذا المجال. \r\n          </div>\r\n        </div>\r\n      </div>\r\n      <p class=\"p-title mb-3\">\r\n        إضافة إلى اهتمام الشركة في تطوير نواديها العلمية، بدأت الشركة في\r\n        تبني مناهج العلوم وتقنية المعلومات والهندسة والرياضيات (STEM)،\r\n        وهي فلسفة للتعلم قائمة على التكامل بين العلوم وتقنية المعلومات\r\n        والهندسة والرياضيات، بحيث تعتمد على التعلم المستند للمشكلات مع\r\n        توظيف الأساليب الإبداعية لحلها مع تقديم تجارب علمية تركز على ربط\r\n        التعليم بالحياة اليومية. وقد أوجدت الشركة قسمًا خاصًا لها في بعض\r\n        المجمعات التعليمية مجهّزًا بالأدوات والمواد اللازمة.\r\n      </p>\r\n      <p class=\"p-title mb-5\">\r\n        ينظم النادي العلمي عدد من الدورات في مجالات العلوم، مثل دورة الالكترونيات و الروبوت ودورة الصناعات الكيميائية ودورة الفلك ودورة تشريح وتحنيط الحيوانات. وقد حقق النادي العلمي لمدارس الروّاد الأهلية المركز الأول كأفضل نادي علمي على مستوى منطقة الرياض للأعوام 1421هـ – 1430هـ على التوالي. إضافة إلى اهتمام الشركة في تطوير نواديها العلمية، بدأت الشركة في تبني مناهج العلوم وتقنية المعلومات والهندسة والرياضيات (STEM)، وهي فلسفة للتعلم قائمة على التكامل بين العلوم وتقنية المعلومات والهندسة والرياضيات، بحيث تعتمد على التعلم المستند للمشكلات مع توظيف الأساليب الإبداعية لحلها مع تقديم تجارب علمية تركز على ربط التعليم بالحياة اليومية. وقد أوجدت الشركة قسمًا خاصًا لها في بعض المجمعات التعليمية مجهّزًا بالأدوات والمواد اللازمة.\r\n      </p>\r\n      <h3 class=\"h-title mb-3\" \"=\"\">مرافق أخرى</h3>\r\n      <p class=\"p-title\">\r\n        تحتوي بعض مدارس الشركة على مرافق إضافية غير ما سبق ذكره أعلاه\r\n        مثل الصالات الرياضية في قسم البنين والورش المهنية وغرف الموهبة\r\n        ومركز اللغة العربية ومقرأة في المجمعات التي تقدم مسار تحفيظ\r\n        القرآن الكريم وغيرها.\r\n      </p>\r\n      <h3 class=\"h-title mb-3\" \"=\"\">أنشطة وبرامج إثرائية</h3>\r\n      <div class=\"activities-programs\">\r\n        <p class=\"p-title\">\r\n          تحرص الشركة على توفير بيئة مدرسية جاذبة لطلابها وتوفير كافة\r\n          الإمكانات اللازمة لإثرائهم معرفيًا، حيث تنظم مدارس الشركة\r\n          برامج متنوعة تهدف إلى تقديم مادة علمية إثرائية للراغبين في\r\n          الاستزادة في أحد الجوانب العلمية أو تطوير مهارات معينة.\r\n          بالإضافة إلى الحصص الأسبوعية المقررة ضمن الجدول الدراسي لتدريب\r\n          الطلاب على اختبارات القدرات والتحصيل، توفر الشركة لطلابها\r\n          برامج تدريبية متخصصة في هذين الاختبارين تُعقد خارج أوقات عمل\r\n          المدارس.\r\n        </p>\r\n        <p class=\"p-title\">\r\n          بالإضافة إلى اهتمام الشركة في الجانب التعليمي لطلابها، تحرص\r\n          الشركة على توفير بيئة مدرسية تساهم في بناء شخصية الطالب\r\n          وإكسابه مهارات جديدة في الجوانب الأخرى، حيث تنظم الشركة برامج\r\n          للتدريب على السباحة والفروسية وأنشطة رياضية مسائية أخرى. كما\r\n          تنظم بين الحين والآخر برامج للتدريب على المهارات الحياتية مثل\r\n          القيادة والإلقاء والحوار والتواصل الاجتماعي والتفكير الابداعي.\r\n        </p>\r\n        <p class=\"p-title mb-0\">\r\n          جدير بالذكر أن الشركة تنظم خلال فترة الصيف نوادٍ صيفية تحت\r\n          إشراف وزارة التعليم تتضمن برامج علمية وثقافية ورياضية متنوعة\r\n          تسعى من ورائها إلى الجمع بين الترفيه واستثمار أوقات الطلاب\r\n          والطالبات بما يعود بالنفع عليهم. وتستهدف هذه البرامج الصيفية\r\n          الطلاب والطالبات من منسوبيّ مدارس الشركة ومن خارجها. وقد حصلت\r\n          بعض النوادي الصيفية التابعة لمدارس الشركة على مدى السنوات\r\n          الماضية على تصنيف ممتاز من وزارة التعليم مقارنة بغيرها من\r\n          النوادي في المنطقة، كما حصلت على المركز الثاني لأفضل تقرير\r\n          إعلامي مصوّر للأندية الموسمية مما يعكس جودة هذه البرامج ودورها\r\n          الإيجابي في استثمار الجيل الناشئ.\r\n        </p>\r\n      </div>\r\n </div></section>', '<div class=\"container clearfix\">\r\n<h3 class=\" mb-5\">مايميز المجمعات التعليمية</h3>\r\n          <h3 class=\"h-title mb-3\" \"=\"\">خدمات النقل</h3>\r\n          <p class=\"p-title mb-5\">\r\n            حرصًا من الشركة على تقديم خدمات متكاملة وتوفير كافة سبل الراحة\r\n            لعملائها من الطلاب والطالبات وأولياء أمورهم، تقدّم الشركة خدمات نقل\r\n            الطلاب والطالبات من المدارس وإليها برسوم سنوية محددة في جميع\r\n            مجمعاتها التعليمية، ولدى الشركة وشركاتها التابعة أسطولًا يضم أكثر من\r\n            مائتين (200) حافلة مخصصة لنقل الطلاب والطالبات من المجمعات التعليمية\r\n            وإليها.\r\n          </p>\r\n          <h3 class=\"h-title mb-3\" \"=\"\">البيئة المدرسية</h3>\r\n          <p class=\"p-title mb-5\">\r\n            تسعى الشركة لتهيئة بيئة مدرسية فريدة من نوعها تكون جاذبة ومحفّزة\r\n            لمنسوبي المدارس من الطلاب والمعلمين والإداريين، وتهتم الشركة بشكل\r\n            خاص بجودة مرافق مدارسها وكفاءة كادرها التعليمي من الناحية التعليمية،\r\n            بالإضافة إلى تنظيم العديد من الأنشطة والفعاليات التي تساهم في بناء\r\n            شخصية الطالب وإثرائه علميًا وثقافيًا من الناحية الشخصية والاجتماعية.\r\n            وفيما يلي وصف مختصر للبيئة المدرسية داخل المجمعات.\r\n          </p>\r\n          <div class=\"school-facilities\">\r\n            <h3 class=\"h-title mb-3\" \"=\"\">مرافق المدارس</h3>\r\n            <p class=\"p-title mb-5\">\r\n              تعتبر مرافق المدارس أحد المعايير المؤثرة على مدى إقبال الطلاب\r\n              والطالبات على الانضمام لمدارس الشركة. وقد أولت الشركة عناية خاصة\r\n              لهذا الجانب لتوفير بيئة مناسبة ترقى لمستوى جودة الخدمات التعليمية\r\n              المقدمة حيث تم تجهيز المرافق التابعة لمجمعات الشركة بأحدث الأجهزة\r\n              والبرامج لدعم الأداء التعليمي، وتقوم الشركة بأعمال صيانة وتحسينات\r\n              دورية مستمرة للحفاظ على مبانيها والمرافق التابعة لها مع حرصها على\r\n              الالتزام بمتطلبات وزارة التعليم والجهات الحكومية ذات الصلة فيما\r\n              يتعلق بسلامة المنشآت وجودتها. وتشتمل جميع المجمعات بحد أدنى على\r\n              المرافق الأساسية التالية:\r\n            </p>\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-6\">\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">الفصول الدراسية</h4>\r\n                  <p class=\"p-title\">\r\n                    تم تجهيز جميع فصول مدارس الشركة بالتقنيات الحديثة من جهاز حاسب\r\n                    آلي مع ملحقاته وبروجكتر وسبورات ذكية تشجع التعليم التفاعلي\r\n                    داخل الفصل. كما تحتوي بعض الفصول الدراسية على البروجكتر\r\n                    التفاعلي.\r\n                  </p>\r\n                </div>\r\n\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">المسارح</h4>\r\n                  <p class=\"p-title\">\r\n                    وهي مسارح متعددة الأغراض مجهزة بأهم التقنيات اللازمة تخدم\r\n                    المجمع<br> بالكامل.\r\n                  </p>\r\n                </div>\r\n\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">معامل الحاسب الآلي</h4>\r\n                  <p class=\"p-title\">\r\n                    تحتوي مجمعات الشركة على معامل للحاسب الآلي مجهزة بالكامل\r\n                    بأنظمة حديثة. وإضافة إلى ذلك، تحتوي بعض مجمعات الشركة على\r\n                    معامل خاصة للغة.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n\r\n              <div class=\"col-lg-6\">\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">المقاصف</h4>\r\n                  <p class=\"p-title\">\r\n                    تخضع مقاصف مدارس الشركة لمراجعات دورية للتأكد من امتثالها\r\n                    لاشتراطات النظافة والصحة، وعادة ما تتعاقد الشركة مع جهات\r\n                    خارجية لتشغيل مقاصفها.\r\n                  </p>\r\n                </div>\r\n\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">المختبرات</h4>\r\n                  <p class=\"p-title\">\r\n                    تم تجهيز المختبرات العلمية في مدارس الشركة بكل ما يحتاجه\r\n                    الطالب والمعلم من أجهزة وأدوات ومواد مناسبة للمناهج المقدمة\r\n                    لتطبيق الدروس عمليًا.\r\n                  </p>\r\n                </div>\r\n                <div class=\"block-school-facilities\">\r\n                  <h4 class=\"h-title\">الساحات</h4>\r\n                  <p class=\"p-title\">\r\n                    تحتوي مدارس الشركة على ساحات داخلية و/أو خارجية يقضي فيها\r\n                    الطلاب أوقاتهم خارج الفصول الدراسية ويتم تنظيم بعض الأنشطة\r\n                    اللامنهجية فيها من وقتٍ لآخر.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n            <p class=\"p-title\">\r\n              وبالإضافة إلى المرافق الأساسية المذكورة أعلاه، تحتوي بعض مدارس\r\n              الشركة على مرافق إضافية تميزها عن غيرها، منها على سبيل المثال:\r\n            </p>\r\n          </div>\r\n\r\n</div>          \r\n        \r\n      \r\n\r\n      <section class=\"content scientific-clubs\">\r\n        <div class=\"container clearfix\">\r\n          <h3 class=\"h-title mb-3\" \"=\"\">النوادي العلمية</h3>\r\n          <p class=\"p-title mb-5\">\r\n            تولي الشركة اهتمامًا كبيرًا للبحث العلمي والابتكار وتسعى لإعداد\r\n            جيل من الطلاب يكون قادرًا على الابتكار والتعامل مع التقنية ليسير\r\n            بخطى واثقة نحو رؤية المملكة 2030. وقد كان للشركة قدم السبق في\r\n            هذا المجال إذ افتتحت في عام 1420هـ (الموافق 1999م) أول نادٍ علمي\r\n            مدرسي على مستوى منطقة الرياض يهدف إلى رعاية الطلاب في مجالات\r\n            العلوم المختلفة وتدريبهم على البحث العلمي وتطوير أفكارهم\r\n            لتحويلها إلى ابتكارات علمية مع التركيز على إعداد الطلاب للمشاركة\r\n            في المسابقات والأنشطة العلمية على مستوى الوزارة والمنشآت\r\n            التعليمية الأخرى. ويحتوي على خمسة أقسام مختلفة:\r\n          </p>\r\n          <div class=\"accordion\" data-collapsible=\"true\">\r\n            <div class=\"toggle toggle-border toggle-active p-4\">\r\n              <div class=\"accordion-header accordion-active\">\r\n                <div class=\"accordion-title h-title\">\r\n                  الورشة الإلكترونية\r\n                </div>\r\n                <div class=\"accordion-icon\">\r\n                  <i class=\"accordion-open icon-chevron-down\"></i>\r\n                  <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                </div>\r\n              </div>\r\n              <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: block\">\r\n                وهي ورشة مجهزة بكافة أجزاء ومكونات الدوائر الإلكترونية،\r\n                يتعلم فيها الطالب توصيل الدوائر الإلكترونية وتصنيع وصيانة\r\n                الأجهزة الكهربائية والإلكترونية.\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"toggle toggle-border toggle-active p-4\">\r\n              <div class=\"accordion-header\">\r\n                <div class=\"accordion-title h-title\">القبة الفلكية</div>\r\n                <div class=\"accordion-icon\">\r\n                  <i class=\"accordion-open icon-chevron-down\"></i>\r\n                  <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                </div>\r\n              </div>\r\n              <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n                وهي ورشة مجهزة بكافة أجزاء ومكونات الدوائر الإلكترونية،\r\n                يتعلم فيها الطالب توصيل الدوائر الإلكترونية وتصنيع وصيانة\r\n                الأجهزة الكهربائية والإلكترونية.\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"toggle toggle-border toggle-active p-4\">\r\n              <div class=\"accordion-header\">\r\n                <div class=\"accordion-title h-title\">\r\n                  الصناعات الكيميائية\r\n                </div>\r\n                <div class=\"accordion-icon\">\r\n                  <i class=\"accordion-open icon-chevron-down\"></i>\r\n                  <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                </div>\r\n              </div>\r\n              <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n                وهي ورشة مجهزة بكافة أجزاء ومكونات الدوائر الإلكترونية،\r\n                يتعلم فيها الطالب توصيل الدوائر الإلكترونية وتصنيع وصيانة\r\n                الأجهزة الكهربائية والإلكترونية.\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"toggle toggle-border toggle-active p-4\">\r\n              <div class=\"accordion-header\">\r\n                <div class=\"accordion-title h-title\">معمل الروبوتات</div>\r\n                <div class=\"accordion-icon\">\r\n                  <i class=\"accordion-open icon-chevron-down\"></i>\r\n                  <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                </div>\r\n              </div>\r\n              <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n                وهي ورشة مجهزة بكافة أجزاء ومكونات الدوائر الإلكترونية،\r\n                يتعلم فيها الطالب توصيل الدوائر الإلكترونية وتصنيع وصيانة\r\n                الأجهزة الكهربائية والإلكترونية.\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"toggle toggle-border toggle-active p-4 mb-5\">\r\n              <div class=\"accordion-header\">\r\n                <div class=\"accordion-title h-title\">\r\n                  متحف الحيوانات المحنطة\r\n                </div>\r\n                <div class=\"accordion-icon\">\r\n                  <i class=\"accordion-open icon-chevron-down\"></i>\r\n                  <i class=\"accordion-closed icon-chevron-up\"></i>\r\n                </div>\r\n              </div>\r\n              <div class=\"accordion-content pb-0 p-title mb-0\" style=\"display: none\">\r\n                وهي ورشة مجهزة بكافة أجزاء ومكونات الدوائر الإلكترونية،\r\n                يتعلم فيها الطالب توصيل الدوائر الإلكترونية وتصنيع وصيانة\r\n                الأجهزة الكهربائية والإلكترونية.\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <p class=\"p-title mb-5\">\r\n            إضافة إلى اهتمام الشركة في تطوير نواديها العلمية، بدأت الشركة في\r\n            تبني مناهج العلوم وتقنية المعلومات والهندسة والرياضيات (STEM)،\r\n            وهي فلسفة للتعلم قائمة على التكامل بين العلوم وتقنية المعلومات\r\n            والهندسة والرياضيات، بحيث تعتمد على التعلم المستند للمشكلات مع\r\n            توظيف الأساليب الإبداعية لحلها مع تقديم تجارب علمية تركز على ربط\r\n            التعليم بالحياة اليومية. وقد أوجدت الشركة قسمًا خاصًا لها في بعض\r\n            المجمعات التعليمية مجهّزًا بالأدوات والمواد اللازمة.\r\n          </p>\r\n          <h3 class=\"h-title mb-3\" \"=\"\">مرافق أخرى</h3>\r\n          <p class=\"p-title\">\r\n            تحتوي بعض مدارس الشركة على مرافق إضافية غير ما سبق ذكره أعلاه\r\n            مثل الصالات الرياضية في قسم البنين والورش المهنية وغرف الموهبة\r\n            ومركز اللغة العربية ومقرأة في المجمعات التي تقدم مسار تحفيظ\r\n            القرآن الكريم وغيرها.\r\n          </p>\r\n          <h3 class=\"mb-5 mt-5\">أنشطة وبرامج إثرائية</h3>\r\n          <div class=\"activities-programs\">\r\n            <p class=\"p-title\">\r\n              تحرص الشركة على توفير بيئة مدرسية جاذبة لطلابها وتوفير كافة\r\n              الإمكانات اللازمة لإثرائهم معرفيًا، حيث تنظم مدارس الشركة\r\n              برامج متنوعة تهدف إلى تقديم مادة علمية إثرائية للراغبين في\r\n              الاستزادة في أحد الجوانب العلمية أو تطوير مهارات معينة.\r\n              بالإضافة إلى الحصص الأسبوعية المقررة ضمن الجدول الدراسي لتدريب\r\n              الطلاب على اختبارات القدرات والتحصيل، توفر الشركة لطلابها\r\n              برامج تدريبية متخصصة في هذين الاختبارين تُعقد خارج أوقات عمل\r\n              المدارس.\r\n            </p>\r\n            <p class=\"p-title\">\r\n              بالإضافة إلى اهتمام الشركة في الجانب التعليمي لطلابها، تحرص\r\n              الشركة على توفير بيئة مدرسية تساهم في بناء شخصية الطالب\r\n              وإكسابه مهارات جديدة في الجوانب الأخرى، حيث تنظم الشركة برامج\r\n              للتدريب على السباحة والفروسية وأنشطة رياضية مسائية أخرى. كما\r\n              تنظم بين الحين والآخر برامج للتدريب على المهارات الحياتية مثل\r\n              القيادة والإلقاء والحوار والتواصل الاجتماعي والتفكير الابداعي.\r\n            </p>\r\n            <p class=\"p-title mb-0\">\r\n              جدير بالذكر أن الشركة تنظم خلال فترة الصيف نوادٍ صيفية تحت\r\n              إشراف وزارة التعليم تتضمن برامج علمية وثقافية ورياضية متنوعة\r\n              تسعى من ورائها إلى الجمع بين الترفيه واستثمار أوقات الطلاب\r\n              والطالبات بما يعود بالنفع عليهم. وتستهدف هذه البرامج الصيفية\r\n              الطلاب والطالبات من منسوبيّ مدارس الشركة ومن خارجها. وقد حصلت\r\n              بعض النوادي الصيفية التابعة لمدارس الشركة على مدى السنوات\r\n              الماضية على تصنيف ممتاز من وزارة التعليم مقارنة بغيرها من\r\n              النوادي في المنطقة، كما حصلت على المركز الثاني لأفضل تقرير\r\n              إعلامي مصوّر للأندية الموسمية مما يعكس جودة هذه البرامج ودورها\r\n              الإيجابي في استثمار الجيل الناشئ.\r\n            </p>\r\n          </div>\r\n     </div></section>', '2020-08-29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 27, 0, 2, 'ما يميز المجمعات', 'What distinguishes the complexes', 'ضبضص', 'ضي', NULL, NULL, 'ma-ymyz-almgmaaat', 'what-distinguishes-the-complexes', 1, 1, '2020-08-29 12:14:30', '2020-12-08 12:00:16'),
(52, 'مجمعاتنا التعليمية', 'educations complex', NULL, NULL, '2020-08-29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 27, 0, 3, 'المجمعات التعليمية', 'educations complex', 'صثبث', 'ثبصث', NULL, NULL, 'almgmaaat-altaalymy', 'educations-complex', 1, 1, '2020-08-29 12:18:01', '2020-12-08 12:05:19');
INSERT INTO `smartend_topics` (`id`, `title_ar`, `title_en`, `details_ar`, `details_en`, `date`, `expire_date`, `video_type`, `photo_file`, `attach_file`, `video_file`, `audio_file`, `icon`, `status`, `visits`, `webmaster_id`, `section_id`, `row_no`, `seo_title_ar`, `seo_title_en`, `seo_description_ar`, `seo_description_en`, `seo_keywords_ar`, `seo_keywords_en`, `seo_url_slug_ar`, `seo_url_slug_en`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(53, 'مدارس الرواد التعليمية', 'مدارس الرواد التعليمية', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\">نبذة عن المدرسة</h3>\r\n              </div>\r\n              <div class=\"row\">\r\n              	<div class=\"col-md-3 mb-4\"><img src=\"http://ataa.dreamsdevs.com/frontEnd/img/home-page/educational.png\" alt=\"Logo\" style=\"height: 100%;/* width: 166px; */object-fit: contain;border: 1px solid #eee;padding: 15px;\"></div>\r\n              	<div class=\"col-md-9\"><p class=\"p-title mb-3\">	قبل أكثر من ثلاثين عاماً أنشئت مدارس الرواد (عام 1411 هـ ) لتسهم في مسيرة العلم والبناء، ولتكون لبنة من لبنات التنمية الشاملة المتوازنة في المملكة العربية السعودية، فقد كانت انطلاقة مدارس الرواد – ولله الحمد – محددة الأهداف واضحة المعالم، بما يضمن تحقيق طموحات أولياء الأمور ويرضي تطلعاتهم في حسن تربية أبنائهم وتعلمهم. حيث سلكت مدارس الرواد منهجية تربوية وتعليمية متميزة بتخطيط بعيد المدى لتسهم في تعزيز عملية التعلم والبحث والابتكار والتطوير لتقديم خدمة رفيعة ومتميزة لأبنائها الطلاب.</p></div>\r\n              	<div class=\"col-md-12\"><p class=\"p-title mb-3\">كما جعلت الرواد من التقنية والتعلم الإلكتروني جزءًا من ممارساتها في كافة المناشط التربوية والتعليمية. حتى غدت مدارس الرواد رائدة على مستوى المملكة والوطن العربي في خدماتها التعليمية والتربوية، فقد حققت عام 1441 هـ في اختبارات مركز قياس على مستوى منطقة الرياض المركز الثاني على (البنين) والمركز الأول على (البنات). وما زالت مسيرة الرواد متواصلة بتوفيق الله تعالى، في ظلال منهجية منحتها استقراراً وتطوراً مطرداً.\r\n                 </p>\r\n                 </div>\r\n              	\r\n                 </div>', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\">نبذة عن المدرسة</h3>\r\n              </div>\r\n              <div class=\"row\">\r\n              	<div class=\"col-md-3 mb-4\"><img src=\"http://ataa.dreamsdevs.com/frontEnd/img/home-page/educational.png\" alt=\"Logo\" style=\"height: 100%;/* width: 166px; */object-fit: contain;border: 1px solid #eee;padding: 15px;\"></div>\r\n              	<div class=\"col-md-9\"><p class=\"p-title mb-3\">	قبل أكثر من عشرين عاماً  أنشئت مدارس الرواد عام 1411 هـ لتسهم في مسيرة العلم والبناء ، ولتكون لبنة من لبنات التنمية الشاملة المتوازنة في المملكة العربية السعودية ، بما تقدمه من برامج تربوية متميزة وخدمات تعليمية متطورة لرعاية أبنائها الطلاب .</p></div>\r\n\r\n\r\n\r\n              	<div class=\"col-md-12\"><p class=\"p-title mb-3\"><br></p><p class=\"p-title mb-3\">ولقد كانت انطلاقة مدارس الرواد  – ولله الحمد – محددة الأهداف واضحة المعالم ، اتخذت من السياسة التعليمية للمملكة المنطلقة من مبادئ الشريعة الغراء ، أساساً لرسالتها ، ولتحقيق توجيهات أولي الأمر لإعداد الإنسان الصالح والمجتمع المتعاون بما يضمن تحقيق طموحات أولياء الأمور ويرضي تطلعاتهم في حسن تربية أبنائهم وتعلمهم . وسلكت منهجية تربوية وتعليمية متميزة أثمرت – بفضل الله تعالى – ازدهار مدارسها فحققت نجاحات مطردة . وريادة متميزة ، وتجربة ثرية فريدة المنهج ، بتخطيط بعيد المدى للمشاركة في إعداد المواطن الصالح والمجتمع المتوازن.\r\n\r\n                 </p>\r\n\r\n                 </div>\r\n\r\n                 \r\n\r\n              	<div class=\"col-md-12\"><p class=\"p-title mb-3\"><br></p><p class=\"p-title mb-3\">ولقد كان من منهجية مدارس الرواد تعزيز البحث والابتكار والتطوير للعديد من البرامج التربوية والتعليمية لتقديم خدمة رفيعة ومتميزة لأبنائها الطلاب. كما جعلت المدارس من التقنية والتعليم الإلكتروني جزءًا من ممارساتها في كافة المناشط التربوية والتعليمية. حيث غدت مدارس الرواد رائدة على مستوى المملكة والوطن العربي فقد حققت عام 1439 هـ في اختبارات مركز قياس على مستوى منطقة الرياض المركز الثاني على ( البنين ) والمركز الأول على ( البنات ) . وما زالت مسيرة الرواد  متواصلة بتوفيق الله تعالى ، في ظلال منهجية أدت إلى تأسيس حصيلة من الخبرات المتنوعة من خلال نخبة من الخبراء المتخصصين في مجالات التربية والتعليم منحت الرواد استقراراً وتطوراً مطرداً.\r\n\r\n                 </p>\r\n\r\n                 </div>\r\n\r\n\r\n              </div>', '2020-08-29', NULL, NULL, '15991451806986.png', '16062003533636.docx', NULL, NULL, NULL, 1, 0, 29, 0, 4, 'شسب', 'شيبشب', 'شسب', '', NULL, NULL, 'shsb', 'shybshb', 1, 1, '2020-08-29 12:43:28', '2020-12-10 13:15:17'),
(54, 'البنين - القسم الابتدائي', 'البنين - القسم الابتدائي', '<div class=\"toggle-content\" style=\"display: block\">\r\n        <p class=\"p-title\">\r\n          المسار العام: مسار يهتم بالمواد الرئيسة في التعليم العام مع\r\n          الاهتمام البالغ بباقي المواد الأخرى، حيث تدرس مواد إضافية علمية\r\n          وثقافية ورياضية صفية ولا صفية، وفق استراتيجيات التعلم النشط. ويقدم\r\n          برامج تعليمية خاصة لمن يعانون في مهارة أو أكثر من مهارات التعلم من\r\n          خلال وسائل وبيئة تعليمية جاذبة تسهم في تعزيز مستوياتهم، على يد معلمين\r\n          متخصصين.\r\n        </p>\r\n        <p class=\"p-title\">\r\n          مسار التحفيظ: مسار يعني بحفظ كتاب الله وعلومه، من خلال تطبيقات\r\n          استراتيجيات التعلم الحديثة على يد معلمين مختصين في تدريس القرآن الكريم\r\n          وعلومه ومجازين بالقراءات العشر.\r\n        </p>\r\n        <p class=\"p-title\">\r\n          المسار المطور: مسار يركز بشكل مكثف على تدريس منهج اللغة\r\n          الإنجليزية والرياضيات والعلوم بالإضافة إلى اللغة العربية ضمن نظام\r\n          متكامل ومدمج للمرحلة العمرية ووفق استراتيجيات التعلم المختلفة التي\r\n          تواكب مستجدات القرن الواحد والعشرين ووفق رؤية المملكة وتطلعاتها\r\n          المستقبلية.\r\n        </p>\r\n      </div>', '<div class=\"toggle-content\" style=\"display: block;\">\r\n                                      <p class=\"p-title\">-  المسار العام .. مسار يهتم بالمواد الرئيسة في قسم  \" التعليم العام \" مع الاهتمام البالغ بباقي المواد الأخرى ، حيث تدرس  مواد إضافية علمية وثقافية ورياضية صفية ولا صفية , وفق استراتيجيات التعلم النشط. كما أن المسار يقدم برامج تعليمية خاصة لمن يعانون في مهارة أو أكثر من مهارات التعلم من خلال وسائل و بيئة تعليمية جاذبة تسهم في تعزيز مستوياتهم ، على يد معلمين متخصصين في مجال صعوبات التعلم .\r\n                                      </p>\r\n                                      <p class=\"p-title\">-  مسار التحفيظ..  مسار يعني بحفظ كتاب الله وعلومه , من خلال تطبيقات استراتيجيات التعلم الحديثة على يد معلمين مختصين في تدريس القرآن الكريم وعلومه ومجازين بالقراءات العشر.  \r\n                                      </p>\r\n                                      <p class=\"p-title\">-  المسار المطور ..  مسار يركز بشكل مكثف على تدريس منهج اللغة الإنجليزية والرياضيات والعلوم بالإضافة إلى تدريس اللغة العربية ضمن نظام متكامل ومدمج للمرحلة العمرية ووفق استراتيجيات التعلم المختلفة التي تواكب مستجدات القرن الواحد والعشرين ووفق رؤية المملكة وتطلعاتها المستقبلية.\r\n                                      </p>\r\n                                    </div>', '2020-08-30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 30, 0, 1, 'المرحلة الاولى', 'first stage', 'ضبضصبصض', 'ثبثصبضثب', NULL, NULL, 'almrhl-alaol', 'first-stage', 1, 1, '2020-08-30 04:56:29', '2020-12-15 12:57:46'),
(55, 'البنين - القسم المتوسط', 'البنين - القسم المتوسط', '<div class=\"toggle-content\" style=\"display: block\">\r\n        <p>\r\n          المسار العام: مسار يهتم بالمواد الرئيسة في قسم \" التعليم العام \" مع\r\n          الاهتمام البالغ بباقي المواد الأخرى، حيث تدرس مواد إضافية علمية\r\n          وثقافية ورياضية صفية ولا صفية، وفق استراتيجيات التعلم النشط. ويقدم\r\n          برامج تعليمية خاصة لمن يعانون في مهارة أو أكثر من مهارات التعلم من\r\n          خلال وسائل وبيئة تعليمية جاذبة تسهم في تعزيز مستوياتهم، على يد معلمين\r\n          متخصصين.\r\n        </p>\r\n        <p>\r\n          مسار التحفيظ: مسار يعني بحفظ كتاب الله وعلومه، من خلال تطبيقات\r\n          استراتيجيات التعلم الحديثة على يد معلمين مختصين في تدريس القرآن الكريم\r\n          وعلومه ومجازين بالقراءات العشر.\r\n        </p>\r\n        <p>\r\n          المقررات: مناهج الوزارة المعتمدة\r\n        </p>\r\n      </div>', '<div class=\"toggle-content\" style=\"display: block;\">\r\n                                      <p class=\"p-title\">- مسار العام \r\n                                      </p>\r\n                                      <p class=\"p-title\">- مسار التحفيظ \r\n                                      </p>\r\n                                    </div>', '2020-08-30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 30, 0, 2, 'المرحلة التانية', 'second stage', 'ضصبصضب', 'ضصي', NULL, NULL, 'almrhl-altany', 'second-stage', 1, 1, '2020-08-30 04:57:01', '2020-12-15 12:58:18'),
(56, 'صالات رياضية :1', 'صالات رياضية :1', NULL, NULL, '2020-08-30', NULL, NULL, NULL, NULL, NULL, NULL, 'fa-500px', 1, 0, 31, 0, 1, 'ffff', 'ffff', '', '', NULL, NULL, 'ffff-1', 'ffff-1', 1, 1, '2020-08-30 06:15:04', '2020-11-23 19:06:15'),
(58, 'عن الشركة', 'about company', '<div class=\"text-center text-md-right\">\r\n              <div class=\"heading-block border-bottom-0\">\r\n                <h3>عن الشركة</h3>\r\n                <span>مرحبًا بكم في شركة عطاء التعليمية</span>\r\n              </div>\r\n              <p>\r\n                شركة عطاء التعليمية هي شركة سعودية مساهمة مدرجة وتعد من أكبر\r\n                الشركات التعليمية الرائدة في المملكة العربية السعودية وتعود\r\n                بداية تأسيس الشركة إلى العام 1413هـ (الموافق 1992م)، وتعمل\r\n                الشركة في قطاع التعليم منذ ما يقارب الثلاثين عامًا، وتعتبر إحدى\r\n                أكبر الشركات التعليمية الرائدة في المملكة العربية السعودية\r\n              </p>\r\n              <p>\r\n                وتمارس الشركة أنشطتها الرئيسية من خلال تملكها ثلاثة عشر مجمعًا\r\n                تعليميًا في منطقة الرياض متخصصة في تقديم خدمات التعليم الأهلي\r\n                والتعليم الأجنبي لمختلف مراحل التعليم العام (قبل الجامعي)\r\n                وبمختلف المناهج؛ السعودي بشقيه العام والتحفيظ، والمنهج البريطاني\r\n                والأمريكي والفرنسي والهندي بالإضافة إلى المسار المصري\r\n              </p>\r\n            \r\n            </div>', '<div class=\" text-center text-md-right\">\r\n              <div class=\"heading-block border-bottom-0\">\r\n                <h3 style=\"text-align: left; \">About company</h3><p style=\"text-align: left; \">Welcome to Ataa Educational Company<br>Ataa Educational Company is a listed Saudi joint stock company and is one of the largest leading educational companies in the Kingdom of Saudi Arabia. Saudi<br>The company carries out its main activities through its ownership of thirteen educational complexes in the Riyadh region specialized in providing private education and foreign education services for various stages of public education (pre-university) and in various curricula. The Saudi curriculum has two parts, general and memorization, and the British, American, French and Indian curriculum in addition to the Egyptian track</p></div>\r\n            \r\n            </div>', '2020-08-31', NULL, NULL, '16005986698628.png', NULL, NULL, NULL, NULL, 1, 31, 32, 0, 1, 'عن الشركة', 'about company', '&nbsp;&lt;div class=\"section my-0 about-company\"&gt;&nbsp; &nbsp; &nbsp; &nbsp; &lt;div class=\"container\"&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;div class=\"row al', '&nbsp;&lt;div class=\"section my-0 about-company\"&gt;&nbsp; &nbsp; &nbsp; &nbsp; &lt;div class=\"container\"&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;div class=\"row al', NULL, NULL, 'aan-alshrk', 'about-company', 1, 1, '2020-08-31 14:35:27', '2020-09-21 03:49:31'),
