(64, 'الاعتمادات', 'الاعتمادات', '<div class=\"heading-block border-bottom-0 text-center\">\r\n            <span>\r\n              ابرز الجوائز والاعتمادات التي حصلنا عليها مؤخراً\r\n            </span>\r\n          </div>', '<div class=\"heading-block border-bottom-0 text-center\">\r\n            \r\n            <span>\r\n              ابرز الجوائز والاعتمادات التي حصلنا عليها مؤخراً\r\n            </span>\r\n          </div>', '2020-09-01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 32, 0, 3, 'الاعتمادات', 'الاعتمادات', 'ابرز الجوائز والاعتمادات التي حصلنا عليها مؤخراً', 'ابرز الجوائز والاعتمادات التي حصلنا عليها مؤخراً', NULL, NULL, 'alaaatmadat-1', 'alaaatmadat-1', 1, 1, '2020-09-01 04:00:30', '2020-09-22 04:49:57'),
(65, 'شهادة الجودة الشاملة (ISO 9001:2015)', 'شهادة الجودة الشاملة (ISO 9001:2015)', '<p class=\"mb-3\">\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\n                  </p>', '<p class=\"mb-3\">\r\n                    أولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\nأولت الشركة منذ تأسيسها اهتمامًا بالغًا بتحقيق معايير جودة\r\n                    عالمية، الأمر الذي انعكس بشكل واضح على كفاءة عمل مدارسها\r\n                    وقدرتها على تنظيم العمليات الإدارية في المدارس بطريقة مؤسسية\r\n                    ومنهجية مؤطرة\r\n                  </p>', '2020-09-01', NULL, NULL, '16061441055235.jpg', NULL, NULL, NULL, NULL, 1, 0, 10, 0, 2, 'شهادة الجودة الشاملة (ISO 9001:2015)', 'شهادة الجودة الشاملة (ISO 9001:2015)', 'أولت الشركة منذ تأسيسها اهتمامًا