(72, 'الكادر التعليمي', 'الكادر التعليمي', '<div dir=\"rtl\"><div class=\"accordion-content pb-0 p-title mb-0\"><span style=\"font-size: 13.92px;\">تؤمن الشركة بأن كادرها التعليمي يعد أهم عوامل جودة خدماتها المقدمة، والتي تسعى الشركة على الحفاظ عليها وتعزيزها من خلال اتباع سياسة توظيف واضحة ومهنية وتقديم التدريب المستمر في أساليب ومهارات التعليم وإتاحة الفرص للتقدم الوظيفي. بالإضافة إلى ذلك، تقوم الشركة بتجهيز الفصول والمختبرات والمرافق التابعة لمجمعات الشركة التعليمية بأحدث الأجهزة والبرامج للرقي المستمر بالأداء التعليمي لمجمعاتها. وقد أدت جهود الشركة المستمرة لخلق بيئة تشجع على تطوير التعليم إلى تقديم تجربة متميزة للطلاب وتحقيق الطلاب لأداء تعليمي متميز.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br></div></div>', '<div dir=\"ltr\"><div class=\"accordion-content pb-0 p-title mb-0\"><span style=\"font-size: 13.92px;\">تؤمن الشركة بأن كادرها التعليمي يعد أهم عوامل جودة خدماتها المقدمة، والتي تسعى الشركة على الحفاظ عليها وتعزيزها من خلال اتباع سياسة توظيف واضحة ومهنية وتقديم التدريب المستمر في أساليب ومهارات التعليم وإتاحة الفرص للتقدم الوظيفي. بالإضافة إلى ذلك، تقوم الشركة بتجهيز الفصول والمختبرات والمرافق التابعة لمجمعات الشركة التعليمية بأحدث الأجهزة والبرامج للرقي المستمر بالأداء التعليمي لمجمعاتها. وقد أدت جهود الشركة المستمرة لخلق بيئة تشجع على تطوير التعليم إلى تقديم تجربة متميزة للطلاب وتحقيق الطلاب لأداء تعليمي متميز.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br></div></div>', '2020-09-02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 11, 0, 2, 'الكادر التعليمي', 'الكادر التعليمي', '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;تؤمن الشركة بأن كادرها التعليمي يعد أهم عوامل جودة \r\nخدماتها المقدمة، والتي تسعى الشركة على الحفاظ عليه', '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;تؤمن الشركة بأن كادرها التعليمي يعد أهم عوامل جودة \r\nخدماتها المقدمة، والتي تسعى الشركة على الحفاظ عليه', NULL, NULL, 'alkadr-altaalymy', 'alkadr-altaalymy', 1, 1, '2020-09-02 05:58:51', '2020-09-20 16:55:33