(75, 'عنوان الوظيفة يوضع هنا', 'الوظيفة الثالثة', 'أبدى الطلاب والطالبات المسجلين في مدارس الشركة – في التعليم الأهلي والتعليم الأجنبي على حد سواء – أداءً تعليميًا مميزًا في نتائج الاختبارات ذات الصلة. فمن جانب التعليم الأهلي، أداء الطلاب والطالبات في اختبارات القدرات والتحصيل التابعة للمركز الوطني للقياس في ارتفاع مستمر وفق إحصائيات وزارة التعليم، وقد حصلت مدارس الروّاد الأهلية فرع الازدهار (قسم البنات) على المركز الأول بين جميع مدارس البنات (علمي ونظري) على مستوى الرياض في نتائج اختبارات القدرات العامة للعامين 1438هـ/1439هـ. (المركز الثاني للمسار النظري والمركز السابع للمسار العلمي على مستوى المملكة). كما حصل فرع الازدهار للبنين على المركز الثاني على مستوى الرياض في نتائج اختبارات القدرات (المركز التاسع على مستوى المملكة). وعادة ما يجتاز عدد من طلاب مدارس الشركة اختبار مقياس موهبة المقدم من مؤسسة الملك عبد العزيز ورجاله للموهبة والإبداع.\r\n\r\nومن جانب التعليم الأجنبي، حظيت مدارس الشركة بسمعة جيدة فيما يتعلق بالتميز التعليمي. فعلى سبيل المثال، يبلغ معدل نجاح طلاب المنهج الهندي في مدارس الشرق الأوسط الحديثة العالمية ومدارس الشرق الأوسط الجديدة العالمية نسبة 100٪ في اختبارات المجلس المركزي للتعليم الثانوي (CBSE) وحصل عدد كبير من الطلاب على درجات تزيد عن 90٪ منذ عام 2004م وحتى عام 2018م.  إضافة إلى ذلك، تم تصنيف مدارس الشرق الأوسط الجديدة العالمية من قبل المركز الموحد لاختبار البحث في المواهب العلمية على المستوى الوطني (National Level Science Talent Search Examination) كأفضل مدرسة في هذا الاختبار منذ عام 2007م وحتى عام 2018م،  كما حصل العديد من طلاب مدرسة الشرق الأوسط الجديدة العالمية على أعلى درجات في امتحانات الشهادة الدولية العامة للتعليم الثانوي (IGCSE) في المملكة العربية السعودية منذ عام 2004م وحتى عام 2018م وتفوقوا بالمجمل على أقرانهم في دول الخليج العربي في عدد من المجالات، وذلك في المستويين (A) ADVANCED LEVEL و( AS)SUBSIDIARY LEVEL ADVANCED المتعلقة بالمنهج البريطاني.', 'الوظيفة الثالثة', '2020-09-02', '2020-08-24', NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 18, 0, 3, 'الوظيفة الثالثة', 'الوظيفة الثالثة', 'الوظيفة الثالثة', 'الوظيفة الثالثة', NULL, NULL, 'alothyf-althalth', 'alothyf-althalth', 1, 1, '2020-09-02 16:32:07', '2020-11-18 12:47:31'),
