(92, 'البنات - قسم رياض الأطفال', 'البنات - قسم رياض الأطفال', '<div class=\"toggle-content\" style=\"display: block\">\r\n        <p>\r\n          الحضانة: مسار تربوي , مكمل لدور الأسرة, يعنى برعاية وتربية الأطفال من\r\n          عمر شهر وحتى ثلاث سنوات, من خلال برنامج تربوي وصحي, تم إعداده وفق\r\n          منهجية علمية, يتم من خلالها العمل غرس القيم الإسلامية لدى الطفل,\r\n          وتكوين اتجاهاته الإيجابية , وتنمية مهاراته اللغوية والحياتية , وتدريبه\r\n          على العديد من المهارات الحركية التي تنمي عضلاته الصغرى والكبرى, وتنمية\r\n          ذوقه الجمالي والإبداعي , وحمايته صحياً والمحافظة عليه من الأخطار\r\n          ومواجهة المشكلات, ونقله برفق من الذاتية المركزية إلى الحياة\r\n          الاجتماعية, من خلال الخبرات اليومية المخطط لها في البرنامج اليومي,\r\n          بإشراف حاضنات مدربات, قادرات على رعاية الأطفال في هذه المرحلة الحساسة.\r\n        </p>\r\n        <p>\r\n          العام: مسار تعليمي وتربوي يتلقى خلاله الطفل العديد من المكتسبات\r\n          المعرفية ويسعى لتأهيلهم للخروج للعالم بعيداُ عن محيط المنزل حيث إنه\r\n          يعتبر مكملاً لنمط الحياة التي يعيشها الطفل.\r\n        </p>\r\n        <p>\r\n          المنتسوري: المنتسوري. مبنى على إعطاء الحرية للطفل الذي يسمح له\r\n          بالتفاعل العفوي مع البيئة، والتي هي جوهر أسلوب منتسوري ويتم إعدادها\r\n          لتلبية احتياجات الطفل اجتماعياَ وعاطفياَ َوعضوياً َوذهنياَ َوروحياَ،\r\n          ودور المعلمة هو العناية والتسهيل والمراقبة لتمكين الطفل من التعلم خلال\r\n          تفاعله مع الطبيعة.\r\n        </p>\r\n      </div>', '<div class=\"toggle-content\" style=\"display: block;\">\r\n                                  \r\n    <p class=\"p-title\">\r\n                                     -  الحضانة .. مسار  تربوي , مكمل لدور الأسرة, يعنى برعاية وتربية الأطفال من عمر شهر وحتى ثلاث سنوات, من خلال برنامج تربوي وصحي, تم إعداده وفق منهجية علمية, يتم من خلالها العمل غرس القيم الإسلامية لدى الطفل, وتكوين اتجاهاته  الإيجابية , وتنمية مهاراته اللغوية والحياتية , وتدريبه على العديد من المهارات الحركية التي تنمي عضلاته الصغرى والكبرى, وتنمية ذوقه الجمالي والإبداعي , وحمايته صحياً والمحافظة عليه من الأخطار ومواجهة المشكلات, ونقله برفق من الذاتية المركزية إلى الحياة الاجتماعية, من خلال الخبرات اليومية المخطط لها في البرنامج اليومي, بإشراف حاضنات مدربات, قادرات على رعاية الأطفال في هذه المرحلة الحساسة.\r\n\r\n                                      </p>\r\n\r\n          \r\n    <p class=\"p-title\">\r\n                                     -  العام .. مسار تعليمي وتربوي يتلقى خلاله الطفل العديد من المكتسبات المعرفية ويسعى لتأهيلهم للخروج للعالم الأخر بعيداُ عن محيط المنزل حيث إنه يعتبر مكملاً لنمط الحياة التي يعيشها الطفل .\r\n                                      </p>\r\n\r\n\r\n          \r\n    <p class=\"p-title\">\r\n                                    -  المنتسوري .. مبنى على إعطاء الحرية للطفل  الذي يسمح له بالتفاعل العفوي  مع البيئة ، و التي  هي جوهر أسلوب منتسوري ويتم إعدادها لتلبية احتياجات الطفل اجتماعياََ وعاطفياَ َوعضوياً َوذهنياَ َوروحياََ ، ودور المعلمة  هو العناية و التسهيل و المراقبة لتمكين الطفل من التعلم خلال تفاعله مع الطبيعة  .\r\n                                      </p>\r\n\r\n\r\n                                    </div>', '2020-11-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 30, 0, 4, '(بنات) قسم رياض الأطفال  وبه ثلاث مسارات', '(بنات) قسم رياض الأطفال  وبه ثلاث مسارات', '\r\n                                  \r\n    \r\n                                     أولا : الحضانة .. مسار  تربوي , مكمل لدور الأسرة, يعنى برعاية وتربية الأطفال من عمر ', '\r\n                                  \r\n    \r\n                                     أولا : الحضانة .. مسار  تربوي , مكمل لدور الأسرة, يعنى برعاية وتربية الأطفال من عمر ', NULL, NULL, 'bnat-ksm-ryad-alatfal-obh-thlath-msarat', 'bnat-ksm-ryad-alatfal-obh-thlath-msarat', 1, 1, '2020-11-23 18:20:22', '2020-12-15 12:59:36');
