(93, 'البنات - القسم الابتدائي', 'البنات - القسم الابتدائي', '<div class=\"toggle-content\" style=\"display: block\">\r\n        <p>\r\n          المسار العام: مسار يهتم بالمواد الرئيسة في قسم \" التعليم العام \" مع\r\n          الاهتمام البالغ بباقي المواد الأخرى، حيث تدرس مواد إضافية علمية\r\n          وثقافية ورياضية صفية ولا صفية، وفق استراتيجيات التعلم النشط. ويقدم\r\n          برامج تعليمية خاصة لمن يعانون في مهارة أو أكثر من مهارات التعلم من\r\n          خلال وسائل وبيئة تعليمية جاذبة تسهم في تعزيز مستوياتهم، على يد معلمين\r\n          متخصصين.\r\n        </p>\r\n        <p>\r\n          مسار التحفيظ: مسار يعني بحفظ كتاب الله وعلومه، من خلال تطبيقات\r\n          استراتيجيات التعلم الحديثة على يد معلمين مختصين في تدريس القرآن الكريم\r\n          وعلومه ومجازين بالقراءات العشر.\r\n        </p>\r\n        <p>\r\n          مسار المطور: مسار يركز بشكل مكثف على تدريس منهج اللغة الإنجليزية\r\n          والرياضيات والعلوم بالإضافة إلى اللغة العربية ضمن نظام متكامل ومدمج\r\n          للمرحلة العمرية ووفق استراتيجيات التعلم المختلفة التي تواكب مستجدات\r\n          القرن الواحد والعشرين ووفق رؤية المملكة وتطلعاتها المستقبلية.\r\n        </p>\r\n      </div>', '<div class=\"toggle-content\" style=\"display: block;\">\r\n                                      <p class=\"p-title\">- العام \r\n                                      </p>\r\n                                       <p class=\"p-title\">- التحفيظ \r\n                                      </p>\r\n                                       <p class=\"p-title\">- المطور \r\n                                      </p>\r\n                                    </div>', '2020-11-23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 30, 0, 5, 'القسم الابتدائي (بنات) ثلاث مسارات', 'القسم الابتدائي (بنات) ثلاث مسارات', '\r\n                                      - العام \r\n                                      \r\n                                       - التحفيظ \r\n                        ', '\r\n                                      - العام \r\n                                      \r\n                                       - التحفيظ \r\n                        ', NULL, NULL, 'alksm-alabtdayy-bnat-thlath-msarat', 'alksm-alabtdayy-bnat-thlath-msarat', 1, 1, '2020-11-23 18:24:24', '2020-12-15 13:01:57'),
