(118, 'مدارس العروبة العالمية', 'مدارس العروبة العالمية', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\">نبذة عن المدرسة</h3>\r\n              </div>\r\n              <div class=\"row\">\r\n              	<div class=\"col-md-3 mb-4\"><img src=\"http://ataa.dreamsdevs.com/frontEnd/img/home-page/educational.png\" alt=\"Logo\" style=\"height: 100%;/* width: 166px; */object-fit: contain;border: 1px solid #eee;padding: 15px;\"></div>\r\n              	<div class=\"col-md-9\"><p class=\"p-title mb-3\">	- تم انشاء مدارس العروبة العالمية عام 1998، للمراحل من K-12 بقسميها البنين والبنات.\r\n- حصلت المدارس على الاعتماد الأكاديمي من عدة منظمات عالمية، آخرها ومستمرة حتى الآن Cognia (formerly\r\nAdvancED)\r\n- تؤهل المدارس طلابها لاجتياز اختباراتI SATII & SAT\r\n- توفر المدرسة أنشطة متنوعة -صفية وغير صفية-كجزء لا يتجزأ من العملية التعليمية مما يشجع الطلاب في تعزيز\r\nمهاراتهم التعليمية والحياتية.\r\n- يؤدي.</p></div>\r\n\r\n\r\n\r\n              \r\n\r\n              </div>', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\">نبذة عن المدرسة</h3>\r\n              </div>\r\n              <div class=\"row\">\r\n              	<div class=\"col-md-3 mb-4\"><img src=\"http://ataa.dreamsdevs.com/frontEnd/img/home-page/educational.png\" alt=\"Logo\" style=\"height: 100%;/* width: 166px; */object-fit: contain;border: 1px solid #eee;padding: 15px;\"></div>\r\n              	<div class=\"col-md-9\"><p class=\"p-title mb-3\">	- تم انشاء مدارس العروبة العالمية عام 1998، للمراحل من K-12 بقسميها البنين والبنات.\r\n- حصلت المدارس على الاعتماد الأكاديمي من عدة منظمات عالمية، آخرها ومستمرة حتى الآن Cognia (formerly\r\nAdvancED)\r\n- تؤهل المدارس طلابها لاجتياز اختباراتI SATII & SAT\r\n- توفر المدرسة أنشطة متنوعة -صفية وغير صفية-كجزء لا يتجزأ من العملية التعليمية مما يشجع الطلاب في تعزيز\r\nمهاراتهم التعليمية والحياتية.\r\n- يؤدي.</p></div>\r\n\r\n\r\n\r\n              \r\n\r\n              </div>', '2020-11-2