(128, 'مدرسة الرواد الاهلية الاندلس', 'مدرسة الرواد الاهلية الاندلس', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\">نبذة عن المدرسة</h3>\r\n              </div>\r\n              <div class=\"row\">\r\n              	<div class=\"col-md-3 mb-4\"><img src=\"http://ataa.dreamsdevs.com/frontEnd/img/home-page/educational.png\" alt=\"Logo\" style=\"height: 100%;/* width: 166px; */object-fit: contain;border: 1px solid #eee;padding: 15px;\"></div>\r\n              	<div class=\"col-md-9\"><p class=\"p-title mb-3\">	تقع مدرسة الأندلس بشارع أبي موسى الأشعري في الأندلس بالرياض هو أحد سلسلة مجمعات شركة عطاء التعليمية الشركة الرائدة في مجال التعليم الأهلي والعالمي والتي تهدف الي تقديم خدمات تعليمية مميزة وزيادة فعالية التعليم وتحقيق أهدافه من حيث تنمية قدرات الطلاب في مختلف المجالات .\r\nوقد حرصت إدارة الشركة في هذه المجمعات على إيجاد بيئة تعليمية جاذبة من خلال تهيئة البيئة المدرسية بمواصفات عالية ومواكبة للتطور العلمي مع توفير أفضل الكفاءات  في المجال التربوي مما جعلها تحقق نمو في زيادة أعداد الطلاب عن العام الماضي . \r\n.</p></div>\r\n\r\n\r\n\r\n           \r\n               \r\n\r\n\r\n              </div>', '<div class=\"heading-block border-bottom-0 mb-4\">\r\n                <h3 class=\"h-title\">نبذة عن المدرسة</h3>\r\n              </div>\r\n              <div class=\"row\">\r\n              	<div class=\"col-md-3 mb-4\"><img src=\"http://ataa.dreamsdevs.com/frontEnd/img/home-page/educational.png\" alt=\"Logo\" style=\"height: 100%;/* width: 166px; */object-fit: contain;border: 1px solid #eee;padding: 15px;\"></div>\r\n              	<div class=\"col-md-9\"><p class=\"p-title mb-3\">	تقع مدرسة الأندلس بشارع أبي موسى الأشعري في الأندلس بالرياض هو أحد سلسلة مجمعات شركة عطاء التعليمية الشركة الرائدة في مجال التعليم الأهلي والعالمي والتي تهدف الي تقديم خدمات تعليمية مميزة وزيادة فعالية التعليم وتحقيق أهدافه من حيث تنمية قدرات الطلاب في مختلف المجالات .\r\nوقد حرصت إدارة الشركة في هذه المجمعات على إيجاد بيئة تعليمية جاذبة من خلال تهيئة البيئة المدرسية بمواصفات عالية ومواكبة للتطور العلمي مع توفير أفضل الكفاءات  في المجال التربوي مما جعلها تحقق نمو في زيادة أعداد الطلاب عن العام الماضي . \r\n.</p></div>\r\n\r\n\r\n\r\n           \r\n               \r\n\r\n\r\n              </div>', '2020-12-01', NULL, NULL, '16068187862433.png', '16068187864876.docx', NULL, NULL, NULL, 1, 0, 29, 0, 7, 'مدرسة الرواد الاهلية الاندلس', 'مدرسة الرواد الاهلية الاندلس', '\r\n                نبذة عن المدرسة\r\n              \r\n              \r\n              	\r\n              		تقع مدرسة الأندلس بشارع أبي موسى الأشعري في الأندلس بالرياض هو أح', '\r\n                نبذة عن المدرسة\r\n              \r\n              \r\n              	\r\n              		تقع مدرسة الأندلس بشارع أبي موسى الأشعري في الأندلس بالرياض هو أح', NULL, NULL, 'mdrs-alroad-alahly-alandls', 'mdrs-alroad-alahly-alandls', 1, 1, '2020-12-01 10:33:06', '2020-12-01 10:35:30'),
(129, 'بيانات الشركة في تداول', 'Company data in Tadawul', '<section id=\"content\" class=\"Company-Data\">\r\n        <div class=\"container\">\r\n          <h3 class=\"h-title\">بيانات الشركة في تداول</h3>\r\n          <div class=\"row mt-4 pt-2\">\r\n            <div class=\"col-md-3 pr-0 pl-0\">\r\n              <img src=\"../frontEnd/img/page-06/right-tadawl.png\" data-animate=\"fadeIn\" alt=\"tadawl\">\r\n            </div>\r\n            <div class=\"col-md-9\">\r\n              <p class=\"p-title mb-5\">\r\n                تعمل شركة عطاء في قطاع التعليم منذ ما يقارب الثلاثين عامًا، وتعتبر إحدى أكبر الشركات التعليمية الرائدة في المملكة العربية السعودية. تمارس الشركة أنشطتها الرئيسية من خلال تملكها ثلاثة عشر مجمعًا تعليميًا في منطقة الرياض متخصصة في تقديم خدمات التعليم الأهلي والتعليم الأجنبي لمختلف مراحل التعليم العام (قبل الجامعي).\r\n              </p>\r\n              <p class=\"p-title last-child\">\r\n                للمزيد من المعلومات حول الشركة وأداء السهم عبر موقع تداول\r\n\r\n              </p>\r\n              <a href=\"https://www.tadawul.com.sa/wps/portal/tadawul/market-participants/issuers/issuers-directory/company-details/!ut/p/z1/pZBLb4JQEIV_iwvW9zigYncUFChIpBQfd2OubUpJeKVBjf56b9GNiWKNs5vk-85kDuNswXghtmki6rQsRCb3Je-vAsc3Hejk2aMPFUbfmpjvgUsA2LwBiEy9O9Tgwx90JWDDDSeailBl_CHfdoMBjNBwZuOZRHV6zof2Px83xsA9_43xJCvXp6p-6rp6UaCgFl9it8kUqX-WeSWKfbTP16WENBqSPMovc-GQJXNHnmeZPcJr7wy09XoJXCmuFfhrpgFaXo_EL6vyOI4XB_87ctNp0ukcAZ66wSg!/\" class=\"button button-border button-rounded button-about-company\" target=\"_blank\">أقراء المزيد</a>\r\n            </div>\r\n            \r\n          </div>\r\n     </div></section>', '<style>.Investor-relations h3.h-title {\r\n    margin-bottom: 0.5rem !important;\r\n}</style>\r\n      \r\n      <section id=\"content\" class=\"Company-Data\">\r\n        <div class=\"container\">\r\n          <h3 class=\"h-title\">بيانات الشركة في تداول</h3>\r\n          <div class=\"row mt-4 pt-2\">\r\n            <div class=\"col-md-3 pr-0