(138, 'كلمة الرئيس التنفيذي', 'CEO word', '<section id=\"content\" class=\"\">\r\n    <div class=\"container clearfix\">\r\n      <div class=\"single-post mb-0\">\r\n        <!-- Single Post -->\r\n        <div class=\"entry clearfix\">\r\n          <div class=\"entry-content mt-0\">\r\n            <!-- Entry Image -->\r\n            <div class=\"entry-image alignleft\" style=\"background-size: cover; background-position: center; height: 365px; border-radius: 6px; overflow: hidden;\">\r\n              <a href=\"#\"><img src=\"../frontEnd/img/page-06/img-right.jpg\" data-animate=\"fadeIn\" alt=\"Blog Single\"></a>\r\n            </div>\r\n            <!-- .entry-image end -->\r\n\r\n            <p>\r\n              شركة عطاء التعليمية في المملكة العربية السعودية -نجمة مضيئة ولبنة قوية في مجال التعليم والتعلم وبناء الإنسان- ذات رؤية واعية ورسالة سامية تطبقها من خلال مدارسها في التعليم الأهلي والتعليم الأجنبي ، وقد تخطى عدد طلابها حاجز الـ 26 ألف طالب وطالبة ليكونوا حاضر الأمة العربية والإسلامية السامي ومستقبلها الزاهر بإذن الله تعالى.\r\n            </p>\r\n            <!-- Post Single - Content End -->\r\n          </div>\r\n        </div>\r\n        <!-- .entry end -->\r\n      </div>\r\n    </div>\r\n  </section>', '<div dir=ltr><br></div>', '2020-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 6, 'كلمة الرئيس التنفيذي', 'CEO word', '\r\n    \r\nكلمة الرئيس التنفيذي\r\n      \r\n        \r\n        \r\n          \r\n            \r\n            \r\n              \r\n            \r\n            \r\n\r\n            \r\n       ', '', NULL, NULL, 'klm-alryys-altnfythy', 'ceo-word', 1, 1, '2020-12-10 11:52:05', '2020-12-15 08:35:28'),
