(1638, 83, 46, '<p class=\"color:#fff\"><font color=\"#f7f7f7\">مميزات المدرسة</font></p>\r\n              <ul>\r\n               \r\n\r\n               <li>موقع المدرسة في احياء متميزة .</li>\r\n<li>مجتمعات الطلاب والطالبات على درجة عالية من الوعي والتعليم .</li>\r\n<li>القرب من جامعة الملك سعود ومدينة الملك عبدالعزيز .</li>\r\n<li>فصول الكترونية متكاملة لجميع المراحل .</li>\r\n<li>وجود ساحات ومعامل وخدمات متعددة .</li>\r\n<li>رفع مستوى الطلاب .</li>\r\n<li>حل المشكلات عن طريق التواصل بين البيت والمدرسة .</li>\r\n<li>تنمية التفكير العلمي .</li>\r\n<li>تقديم فكر متميز يساعد الطلاب على مواجهة التكنلوجيا الحديثة .</li>\r\n \r\n\r\n               </ul>', '2020-11-24 09:40:05', '2020-11-24 09:40:05'),
