(1995, 118, 46, '<p class=\"color:#fff\"><font color=\"#f7f7f7\">مميزات المدرسة</font></p>\r\n              <ul>\r\n              \r\n\r\n\r\n<li>تتمتع المدارس بمباني مجهزة بأحدث الوسائل والتقنيات الحديثة التي تخدم العملية التعليمية كما يتوفر بها ملاعب متعددة ومركز رياضي متكامل.</li>\r\n<li>جميع فصول المدارس فصول تفاعلية مجهزة بأحدث النظم التقنية والتعليمية.</li>\r\n<li>يخضع طلاب مدارس العروبة العالمية لاختبارات قياس طبقا للمعايير العالمية (MAP TEST) في مادتي اللغة الإنجليزية والرياضيات لقياس معدل تقدمهم الأكاديمي مقارنة بأقرانهم على مستوى العالم. </li>\r\n<li>حصول طلاب مدارس العروبة العالمية على أعلى معدلات في امتحانات ال SAT مما يؤهلهم للحصول على منح دراسية في أفضل </li><li>الجامعات على مستوى العالم، ويميز طلابنا على مستوى الرياض.</li>\r\n\r\n\r\n\r\n               </ul>', '2020-11-25 09:27:50', '2020-11-25 09:27:50'),
