(2310, 87, 35, '<ul>\r\n	<li>\r\n		نائب رئيس مجلس إدارة شركة عطاء التعليمية منذ عام 2018م وحتى تاريخ هذه النشرة.\r\n	</li>\r\n	<li>\r\n		رئيس اللجنة التنفيذية والاستثمار في شركة عطاء التعليمية منذ عام 2018م وعضو فيها منذ عام 2015م حتى تاريخ هذه النشرة.\r\n	</li>\r\n	<li>\r\n		رئيس مجلس مديري شركة النخبة التعليمية، شركة ذات مسؤولية محدودة مقرها الرياض وتعمل في قطاع التعليم، منذ عام 2015م وحتى تاريخ هذه النشرة.\r\n	</li>\r\n	<li>\r\n		رئيس مجلس مديري شركة العروبة العالمية للخدمات التعليمية، شركة ذات مسؤولية محدودة مقرها الرياض وتعمل في قطاع التعليم، منذ عام 2015م وحتى تاريخ هذه النشرة.\r\n	</li>\r\n	<li>\r\n		رئيس مجلس مديري شركة الروّاد للخدمات المساندة، شركة ذات مسؤولية محدودة مقرها الرياض وتعمل في مجال مقاولة الصيانة والتشغيل، منذ عام 2015م وحتى تاريخ هذه النشرة.\r\n	</li>\r\n	<li>\r\n		عضو اللجنة التنفيذية والاستثمار لشركة عطاء التعليمية منذ عام 2015م وحتى تاريخ هذه النشرة.\r\n	</li>\r\n</ul>', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2311, 87, 36, '69', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2312, 87, 37, '<ul>\r\n	<li>\r\n		دكتوراه التحليل العددي، جامعة مانشستر، مانشستر، المملكة المتحدة، عام 1977م.\r\n	</li>\r\n	<li>\r\n		ماجستير التحليل العددي والحسابات الآلية، جامعة مانشستر، مانشستر، المملكة المتحدة، عام 1974م.\r\n	</li>\r\n	<li>\r\n		بكالوريوس الرياضيات البحتة والفيزياء، جامعة الملك سعود (كلية العلوم)، الرياض، المملكة العربية السعودية، عام 1970م.\r\n	</li>\r\n</ul>', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2313, 87, 38, 'سعودي', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2314, 87, 39, '<ul>\r\n	<li>\r\n		عضو مجلس الإدارة المنتدب لشركة عطاء التعليمية منذ عام 2016م وحتى عام 2018م\r\n	</li>\r\n	<li>\r\n		مالك ومؤسس مدارس جرير الأهلية (مدارس الروّاد الأهلية فرع الأندلس حاليًا) منذ عام 2013م وحتى عام 2015م.\r\n	</li>\r\n	<li>\r\n		مالك ومؤسس مدارس الشرق الأوسط الحديثة العالمية منذ عام 2012م وحتى عام 2015م.\r\n	</li>\r\n	<li>\r\n		مالك ومؤسس مدارس السليمانية العالمية منذ عام 2002م وحتى عام 2015م.\r\n	</li>\r\n	<li>\r\n		مالك ومؤسس مدارس الفكر الأهلية منذ عام 1999م وحتى عام 2015م.\r\n	</li>\r\n	<li>\r\n		مالك ومؤسس مدارس الشرق الأوسط الجديدة منذ عام 1998م وحتى عام 2015م.\r\n	</li>\r\n	<li>\r\n		مالك ومؤسس مدارس الشرق الأوسط العالمية منذ عام 1998م وحتى عام 2015م.\r\n	</li>\r\n	<li>\r\n		رئيس مؤسسة الجريسي لخدمات الكمبيوتر والاتصالات، شركة ذات مسؤولية محدودة مقرها الرئيس بالرياض وتعمل في مجال الحاسب والاتصالات، منذ عام 1991م وحتى عام 1997م.\r\n	</li>\r\n	<li>\r\n		أمين عام جامعة الملك سعود، الرياض، منذ عام 1988م وحتى عام 1991م.\r\n	</li>\r\n	<li>\r\n		عميد كلية العلوم في جامعة الملك سعود، الرياض، منذ عام 1982م وحتى عام 1988م.\r\n	</li>\r\n	<li>\r\n		وكيل كلية العلوم في جامعة الملك سعود، الرياض، منذ عام 1980م وحتى عام 1982م.\r\n	</li>\r\n	<li>\r\n		مدرس بقسم الرياضيات في كلية العلوم، جامعة الملك سعود، الرياض، منذ عام 1977م وحتى عام 1997م.\r\n	</li>\r\n	<li>\r\n		معيد مبتعث لدراسة الماجستير والدكتوراة في جامعة مانشستر في المملكة المتحدة، منذ عام 1972م وحتى عام 1977م.\r\n	</li>\r\n	<li>\r\n		معيد بقسم الرياضيات في كلية العلوم، جامعة الملك سعود، الرياض، منذ عام 1970م وحتى عام 1972م.\r\n	</li>\r\n</ul>', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2315, 87, 56, '2020-09-29', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2316, 87, 63, 'نائب رئيس مجلس الإدارة', '2020-12-15 09:44:07', '2020-12-15 09:44:07'),
(2317, 16, 35, '<ul>\r\n        <li>\r\n          رئيس مجلس إدارة بنك الجزيرة، شركة مساهمة مدرجة مركزها الرئيس بجدة\r\n          وتعمل في مجال الأعمال المصرفية والاستثمارية، منذ عام 2016م وحتى تاريخ\r\n          هذه النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة عطاء التعليمية منذ عام 2010م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة رزم للاستثمار، شركة مساهمة مقفلة مركزها الرئيس\r\n          بالرياض وتعمل في قطاع الاستثمار، منذ عام 2009م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          نائب رئيس مجلس إدارة شركة عسير للتجارة والسياحة والصناعة، شركة مساهمة\r\n          مدرجة مركزها الرئيس بأبها وتعمل في قطاع المقاولات والعقارات، منذ عام\r\n          2007م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة دله للخدمات الصحية، شركة مساهمة مدرجة مركزها\r\n          الرئيس بالرياض وتعمل في القطاع الصحي، منذ عام 1995م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس مديريّ الشركة الفنية لتوطين التقنية، شركة ذات مسؤولية محدودة\r\n          تعمل في تجارة الجملة والتجزئة في أجهزة الحاسب الآلي وقطع غيارها وخدمات\r\n          الحاسب الآلي ونظام تطبيقه وقواعد البيانات، منذ عام 1998م وحتى تاريخ\r\n          هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة شركة البلد الأمين للتنمية والتطوير العمراني، شركة\r\n          مساهمة مقفلة تعمل في قطاع المقاولات والإنشاءات، منذ عام 2018م وحتى\r\n          تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس مديريّ شركة ضاحية سمو، شركة ذات مسؤولية محدودة مقرها مكة\r\n          المكرمة وتعمل في قطاع المقاولات والإنشاءات، منذ عام 2018م وحتى تاريخ\r\n          هذه النشرة.\r\n        </li>\r\n      </ul>', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2318, 16, 36, '67', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2319, 16, 37, '<ul>\r\n        <li>بكالوريوس هندسة مدنية، جامعة الملك سعود، الرياض، المملكة العربية السعودية، عام 1976م.</li>\r\n      </ul>', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2320, 16, 38, 'سعودي', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2321, 16, 39, '<ul>\r\n        <li>\r\n          نائب رئيس مجلس إدارة شركة القصبي للمقاولات، شركة مساهمة مقفلة مركزها\r\n          الرئيس بالرياض وتعمل في قطاع المقاولات، منذ عام 2018م وحتى ديسمبر عام\r\n          2018م.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة سرب للاستثمار العقاري، شركة مساهمة مقفلة تعمل في\r\n          نشاط الاستثمار العقاري، منذ عام 2012م وحتى عام 2018م.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة الجزيرة للأوراق المالية، شركة مساهمة مقفلة مركزها\r\n          الرئيس بالرياض وتعمل في مجال تقديم خدمات الأوراق المالية، منذ عام\r\n          2015م وحتى عام 2016م.\r\n        </li>\r\n        <li>رئيس المجلس البلدي لمدينة الرياض منذ عام 2014م وحتى عام 2015م.</li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة الجزيرة للأوراق المالية، شركة مساهمة مقفلة مركزها\r\n          الرئيس بالرياض وتعمل في مجال تقديم خدمات الأوراق المالية، منذ عام\r\n          2008م وحتى عام 2013م\r\n        </li>\r\n        <li>\r\n          نائب رئيس المجلس البلدي لمدينة الرياض منذ عام 2005م وحتى عام 2014م.\r\n        </li>\r\n        <li>\r\n          نائب رئيس مجلس إدارة مجموعة دله البركة، شركة ذات مسؤولية محدودة\r\n          (قابضة) مركزها الرئيس بجدة وتعمل في مجال الاستثمار، منذ عام 1990م وحتى\r\n          عام 2012م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة جمعية الهلال الأحمر منذ عام 2001م وحتى عام 2007م.\r\n        </li>\r\n        <li>\r\n          مدير عام شركة مكة للإنشاء والتعمير، شركة ذات مسؤولية محدودة مركزها\r\n          الرئيس بمكة المكرمة وتعمل في مجال المقاولات، منذ عام 1988م وحتى عام\r\n          1990م\r\n        </li>\r\n        <li>\r\n          نائب رئيس مؤسسة كرا، مؤسسة فردية مقرها في مكة المكرمة وتعمل في مجال\r\n          المقاولات، منذ عام 1981م وحتى عام 1988م.\r\n        </li>\r\n        <li>مدير مشروع، مؤسسة كرا، منذ عام 1978م وحتى عام 1981م.</li>\r\n      </ul>', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2322, 16, 56, '2010-01-01', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2323, 16, 63, 'رئيس مجلس الإدارة', '2020-12-15 09:45:03', '2020-12-15 09:45:03'),
(2324, 130, 35, '<ul>\r\n        <li>\r\n          عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2010م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة التنفيذية والاستثمار في شركة عطاء التعليمية منذ عام 2010م\r\n          وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس مديري شركة النخبة التعليمية، شركة ذات مسؤولية محدودة مقرها\r\n          الرياض وتعمل في قطاع التعليم، منذ عام 2006م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس مديري شركة العروبة العالمية للخدمات التعليمية، شركة ذات\r\n          مسؤولية محدودة مقرها الرياض وتعمل في قطاع التعليم، منذ عام 2015م وحتى\r\n          تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس مديري شركة الروّاد للخدمات المساندة، شركة ذات مسؤولية محدودة\r\n          مقرها الرياض وتعمل في مجال مقاولة الصيانة والتشغيل، منذ عام 2015م وحتى\r\n          تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          مؤسس ورئيس مجلس إدارة صندوق رواج التعليمي، صندوق استثماري مركزه الرئيس\r\n          بالرياض ويعمل في مجال الاستثمار في التعليم والتدريب، منذ عام 2017م\r\n          وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          نائب رئيس مجلس إدارة شركة رزم للاستثمار، شركة مساهمة مقفلة مركزها\r\n          الرئيس بالرياض وتعمل في قطاع الاستثمار، منذ عام 2009م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          شريك ومدير شركة صالح الدويش وعثمان القصبي، شركة تضامنية مقرها الرياض\r\n          وتعمل في مجال الاستشارات الإدارية منذ عام 2008م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n      </ul>', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2325, 130, 36, '42', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2326, 130, 37, '<ul>\r\n        <li>\r\n          ماجستير إدارة الأعمال، جامعة بريدجبورت، كونيكتيكت، الولايات المتحدة الأمريكية، عام 2000م.\r\n        </li>\r\n        <li>\r\n          بكالوريوس محاسبة، جامعة الملك سعود، الرياض، المملكة العربية السعودية، عام 1997م.\r\n        </li>\r\n      </ul>', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2327, 130, 38, 'سعودي', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2328, 130, 39, '<ul>\r\n        <li>\r\n          مؤسس وشريك ورئيس مجلس إدارة شركة فنادق ميرا التجارية، شركة مساهمة مقفلة مركزها الرئيس بالرياض وتعمل في مجال الفنادق والمنتجعات السياحية، منذ عام 2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس لجنة التعليم الأهلي في الغرفة التجارية بالرياض منذ عام 2012م وحتى عام 2016م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة الغرف التجارية الصناعية بالرياض منذ عام 2012م وحتى عام 2016م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة التنفيذية والاستثمار في شركة عطاء التعليمية منذ عام 2011م وحتى عام 2012م.\r\n        </li>\r\n        <li>\r\n          مؤسس وشريك في شركة النخبة التعليمية، شركة ذات مسؤولية محدودة مقرها الرياض وتعمل في قطاع التعليم، منذ عام 2006م وحتى عام 2012م.\r\n        </li>\r\n        <li>\r\n          الرئيس التنفيذي لشركة عطاء التعليمية منذ عام 2010م وحتى عام 2011م.\r\n        </li>\r\n        <li>\r\n          الرئيس التنفيذي لشركة النخبة التعليمية، شركة ذات مسؤولية محدودة مقرها الرياض وتعمل في قطاع التعليم، منذ عام 2006م وحتى عام 2010م.\r\n        </li>\r\n      </ul>', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2329, 130, 56, '2010-01-01', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2330, 130, 63, 'عضو مجلس الإدارة', '2020-12-15 09:55:34', '2020-12-15 09:55:34'),
(2331, 131, 35, '<ul>\r\n        <li>\r\n          عضو مجلس إدرة شركة القصبي للمقاولات، شركة مساهمة مقفلة مقرها الرياض\r\n          وتعمل في قطاع المقاولات، منذ عام 2019م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة شركة المشفى الطبية، شركة مساهمة مقفلة مقرها الرياض\r\n          وتعمل في المجال الصحي، منذ عام 2017م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو لجنة الشركات العائلية، الغرفة التجارية بالرياض، منذ عام 2017م وحتى\r\n          تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          مدير شركة الفنية لتوطين التقنية، شركة ذات مسؤولية محدودة مركزها الرئيس\r\n          بالرياض وتعمل في مجال تقنية المعلومات، منذ عام 2012م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2010م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          عضو لجنة المراجعة لشركة عطاء التعليمية منذ عام 2010م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة شركة رزم للاستثمار، شركة مساهمة مقفلة مركزها الرئيس\r\n          بالرياض وتعمل في قطاع الاستثمار، منذ عام 2009م والعضو المنتدب منذ عام\r\n          2017م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n      </ul>', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2332, 131, 36, '38', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2333, 131, 37, '<ul>\r\n        <li>ماجستير علوم إدارية، جامعة ميجيل، مونتريال، كندا، عام 2017م.</li>\r\n        <li>بكالوريوس علوم إدارية، جامعة الملك سعود، الرياض، المملكة العربية السعودية، عام 2004م.</li>\r\n      </ul>', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2334, 131, 38, 'سعودي', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2335, 131, 39, '<ul>\r\n        <li>\r\n          محاضر بدوام جزئي، جامعة اليمامة بالرياض، منذ عام 2018م وحتى عام 2019م.\r\n        </li>\r\n        <li>\r\n          الرئيس التنفيذي لشركة رزم للاستثمار، شركة مساهمة مقفلة مركزها الرئيس\r\n          بالرياض وتعمل في قطاع الاستثمار، منذ عام 2009م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس مجلس إدارة مستشفى الأسرة الدولي، شركة مساهمة مقفلة مركزها الرئيس\r\n          بالرياض وتعمل في القطاع الصحي، منذ عام 2014م وحتى عام 2016م.\r\n        </li>\r\n        <li>\r\n          مدير التسويق في الشركة الفنية لتوطين التقنية، شركة ذات مسؤولية محدودة\r\n          مركزها الرئيس بالرياض وتعمل في مجال تقنية المعلومات، منذ عام 2009م\r\n          وحتى عام 2011م.\r\n        </li>\r\n        <li>\r\n          مسؤول مبيعات، الشركة الفنية لتوطين التقنية، شركة ذات مسؤولية محدودة\r\n          مركزها الرئيس بالرياض وتعمل في مجال تقنية المعلومات، منذ عام 2007م\r\n          وحتى عام 2009م.\r\n        </li>\r\n        <li>\r\n          باحث، شركة الجزيرة لإدارة الأصول، شركة ذات مسؤولية محدودة مركزها\r\n          الرئيس بالرياض وتعمل في مجال الاستشارات المالية منذ عام 2005م وحتى عام\r\n          2007م.\r\n        </li>\r\n        <li>\r\n          مدير محافظ مالية، شركة نعيم لإدارة الأصول، شركة ذات مسؤولية محدودة\r\n          مركزها الرئيس بالرياض وتعمل في مجال سوق المال، منذ عام 2004م وحتى عام\r\n          2005م.\r\n        </li>\r\n      </ul>', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2336, 131, 56, '2010-01-01', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2337, 131, 63, 'عضو مجلس الإدارة', '2020-12-15 10:34:28', '2020-12-15 10:34:28'),
(2338, 132, 35, '<ul>\r\n        <li>\r\n          عضو اللجنة العقارية في غرفة الرياض التجارية منذ عام 2016م وحتى تاريخ\r\n          هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2013م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          رئيس لجنة المراجعة لشركة عطاء التعليمية منذ عام 2013م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          الرئيس التنفيذي للشركة السعودية لتمويل المساكن، شركة مساهمة مقفلة\r\n          مركزها الرئيس بالرياض وتعمل في مجال التمويل العقاري، منذ عام 2011م\r\n          وحتى تاريخ هذه النشرة.\r\n        </li>\r\n      </ul>', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2339, 132, 36, '60', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2340, 132, 37, '<ul>\r\n        <li>\r\n          ماجستير علوم إدارية، جامعة شرق نيو مكسيكو، ولاية نيو مكسيكو، الولايات المتحدة الأمريكية عام 1988م.\r\n        </li>\r\n        <li>\r\n          بكالوريوس علوم إدارية، جامعة بورتلاند ستيت، ولاية اوريجن، الولايات المتحدة الأمريكية، عام 1985م.\r\n        </li>\r\n      </ul>', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2341, 132, 38, 'سعودي', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2342, 132, 39, '<ul>\r\n        <li>\r\n          مدير عام قطاع الشركات، البنك الأول، (البنك السعودي الهولندي سابقًا)،\r\n          شركة مساهمة مدرجة مركزها الرئيس بالرياض وتعمل في مجال مزاولة عمليات\r\n          البنوك، منذ عام 2001م وحتى عام 2010م.\r\n        </li>\r\n        <li>\r\n          مدير إقليمي للمنطقة الوسطى، البنك الأول (البنك السعودي الهولندي\r\n          سابقًا)، شركة مساهمة مدرجة مركزها الرئيس بالرياض وتعمل في مجال مزاولة\r\n          عمليات البنوك، منذ عام 1998م وحتى عام 2001م.\r\n        </li>\r\n        <li>\r\n          مدير عام إدارة العملاء في المنطقة الوسطى، البنك السعودي الفرنسي، شركة\r\n          مساهمة مدرجة مركزها الرئيس بالرياض وتعمل في مجال مزاولة عمليات البنوك،\r\n          منذ عام 1996م وحتى عام 1998م.\r\n        </li>\r\n        <li>\r\n          مدير إقليمي لقطاع الشركات، البنك السعودي الفرنسي، شركة مساهمة مدرجة\r\n          مركزها الرئيس بالرياض وتعمل في مجال مزاولة عمليات البنوك، منذ عام\r\n          1994م وحتى عام 1995م.\r\n        </li>\r\n        <li>\r\n          مدير فرع العليا، البنك السعودي الفرنسي، شركة مساهمة مدرجة مركزها\r\n          الرئيس بالرياض وتعمل في مجال مزاولة عمليات البنوك، منذ عام 1993م وحتى\r\n          عام 1993م.\r\n        </li>\r\n        <li>\r\n          مدير علاقات عملاء إدارة الشركات، البنك السعودي الفرنسي، شركة مساهمة\r\n          مدرجة مركزها الرئيس بالرياض وتعمل في مجال مزاولة عمليات البنوك، منذ\r\n          عام 1988م وحتى عام 1992م.\r\n        </li>\r\n      </ul>', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2343, 132, 56, '2014-01-01', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2344, 132, 63, 'عضو مجلس الإدارة', '2020-12-15 10:43:44', '2020-12-15 10:43:44'),
(2345, 133, 35, '<ul>\r\n        <li>\r\n          عضو اللجنة التنفيذية والاستثمار في شركة عطاء التعليمية منذ عام 2018م\r\n          وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس مديريّ شركة الإبداع الوطني المتطورة للتجارة، شركة ذات مسؤولية\r\n          محدودة مركزها الرئيس بالرياض وتعمل في مجال التجارة والاستثمار، منذ عام\r\n          2017م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2015م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          عضو مجلس مديري شركة العروبة العالمية للخدمات التعليمية، شركة ذات\r\n          مسؤولية مقرها الرياض وتعمل في قطاع التعليم، منذ عام 2015م وحتى تاريخ\r\n          هذه النشرة\r\n        </li>\r\n        <li>\r\n          عضو مجلس مديري شركة الروّاد للخدمات المساندة، شركة ذات مسؤولية مقرها\r\n          الرياض وتعمل في مجال مقاولة الصيانة والتشغيل، منذ عام 2015م وحتى تاريخ\r\n          هذه النشرة،\r\n        </li>\r\n        <li>\r\n          مدير إدارة الخدمات المساندة في وقف خادم الحرمين الشريفين الملك عبد\r\n          الله بن عبد العزيز للموهبة والابداع، مؤسسة وطنية غير ربحية، منذ عام\r\n          2012م وحتى تاريخ هذه النشرة.\r\n        </li>\r\n      </ul>', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2346, 133, 36, '54', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2347, 133, 37, '<ul>\r\n  <li>بكالوريوس علوم إدارية، جامعة الملك سعود، الرياض، المملكة العربية السعودية، عام 1987م.</li>\r\n</ul>', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2348, 133, 38, 'سعودي', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2349, 133, 39, '<ul>\r\n        <li>\r\n          مسؤول تطوير الأعمال والاستثمار، الشركة العامة للأعمال الاستثمارية\r\n          العقارية المحدودة، شركة ذات مسؤولية محدودة مركزها الرئيس بالرياض وتعمل\r\n          في مجال التجارة والاستثمار، منذ عام 2000م وحتى عام 2012م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة شركة المجموعة المتحدة للتأمين التعاوني (الدورة الأولى)،\r\n          شركة مساهمة مدرجة مركزها الرئيس بالرياض وتعمل في مجال التأمين وإعادة\r\n          التأمين، منذ عام 2007م وحتى عام 2008م.\r\n        </li>\r\n        <li>\r\n          مدير قسم الشؤون المالية، مشروع الخزن الاستراتيجي، هو مشروع حكومي يتبع\r\n          لمجلس الوزارء ويشرف عليه الأمير سلطان بن عبد العزيز بصفته النائب\r\n          الثاني لرئاسة مجلس الوزراء وقتها وتم اسناده في أواخر التسعينات لشركة\r\n          أرامكو وهو يختص بالتخزين للطاقة والبترول كمواد استراتيجية، منذ عام\r\n          1988م وحتى عام 2000م.\r\n        </li>\r\n      </ul>', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2350, 133, 56, '2015-01-01', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2351, 133, 63, 'عضو مجلس الإدارة', '2020-12-15 11:55:39', '2020-12-15 11:55:39'),
(2352, 134, 35, '<ul>\r\n  <li>عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2018م وحتى تاريخ هذه النشرة.</li>\r\n</ul>', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2353, 134, 36, '59', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2354, 134, 37, '<ul>\r\n        <li>\r\n          دبلوم الإدارة التربوية، جامعة كولورادو، الولايات المتحدة الأمريكية،\r\n          عام 1997م.\r\n        </li>\r\n        <li>\r\n          دكتوراة آداب ولغة بمرتبة الشرف الأولى، جامعة الإمام محمد بن سعود\r\n          الإسلامية، الرياض، المملكة العربية السعودية، عام 1994م.\r\n        </li>\r\n        <li>\r\n          ماجستير لغة وآداب، جامعة الإمام محمد بن سعود الإسلامية، الرياض،\r\n          المملكة العربية السعودية، عام 1987م\r\n        </li>\r\n        <li>\r\n          بكالوريوس كلية اللغة العربية، جامعة الإمام محمد بن سعود الإسلامية،\r\n          الرياض، المملكة العربية السعودية، عام 1982م.\r\n        </li>\r\n      </ul>', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2355, 134, 38, 'سعودي', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2356, 134, 39, '<ul>\r\n        <li>\r\n          عضو مجلس إدارة الشركة التعليمية المتطورة، شركة ذات مسؤولية محدودة\r\n          مركزها الرئيس في الرياض وتعمل في مجال التعليم والتدريب، منذ عام 2017م\r\n          وحتى يناير 2019م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة التنفيذية في الشركة التعليمية المتطورة، شركة ذات مسؤولية\r\n          محدودة مركزها الرئيس في الرياض وتعمل في مجال التعليم والتدريب، منذ عام\r\n          2017م وحتى يناير 2019م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة التوجيهية لبرنامج \"خـبرات: للإيفاد الخارجي\"، إدارة\r\n          التعليم، الرياض، منذ عام 2015م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة الدائمة للتوعية الفكرية \"حصانة\"، إدارة التعليم، الرياض،\r\n          منذ عام 2015م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس لجنة التشكيلات الإشرافية، إدارة التعليم، الرياض، منذ عام 2014م\r\n          وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس لجنة الترقيات العليا، إدارة التعليم، الرياض، منذ عام 2014م وحتى\r\n          عام 2017م.\r\n        </li>\r\n        <li>\r\n          نائب رئيس اللجنة التأسيسية لمتابعة احتياجات تشغيل مراكز الخدمات\r\n          المساندة للتربية الخاصة، إدارة التعليم، الرياض، منذ عام 2014م وحتى عام\r\n          2017م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة العليا لاختيار القيادات (مديري العموم بوزارة التعليم\r\n          للتعليم العام ـ مديري إدارات التعليم ومساعديهم)، وزارة التعليم، الرياض\r\n          منذ عام 2014م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة التدريب والابتعاث بوزارة الخدمة المدنية، الرياض، منذ عام\r\n          2014م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة التوجيهات المستقبلية للتعليم، إدارة التعليم، الرياض، منذ عام\r\n          2014م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة المواءمة مع التعليم الجامعي، إدارة التعليم العالي، الرياض،\r\n          منذ عام 2014م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة الإدارة التربوية الإلكترونية، إدارة التعليم، الرياض، منذ عام\r\n          2014م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة دارة الملك عبدالعزيز، دارة الملك عبدالعزيز، الرياض، منذ\r\n          عام 2013م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة العليا للإشراف على مشروع المناهج، إدارة التعليم، الرياض،\r\n          منذ عام 2013م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة دراسة الاستفادة من خريجي الجامعات المعدين للتدريس، إدارة\r\n          التعليم العالي، الرياض، منذ عام 2013م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة رفع قيمة التعليم، إدارة التعليم، الرياض، منذ عام 2013م وحتى\r\n          عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو المنتدى والمعرض الدولي للتعليم العام \"مجتمع معرفة\"، إدارة التعليم،\r\n          الرياض، منذ عام 2013م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة الإشرافية على المراكز العلمية، إدارة التعليم، الرياض، منذ\r\n          عام 2013م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة الإشرافية العليا للإشراف التربوي، إدارة التعليم، الرياض،\r\n          منذ عام 2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة العليا للأولمبيات الدولية، الهيئة العامة للرياضة، الرياض،\r\n          منذ عام 2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس أمناء جائزة خادم الحرمين الشريفين لتكريم المخترعين\r\n          والموهوبين، مدينة الملك عبد الله للعلوم والتقنية، الرياض، منذ عام\r\n          2011م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة الفرعية لمشروع تدريب معلمي ومعلمات الرياضيات والعلوم، إدارة\r\n          التعليم، الرياض، منذ عام 2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة رعاية الفكر وتعزيز السلوك بوزارة الداخلية، الرياض، منذ عام\r\n          2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو لجنة خط مساندة الطفل \"برنامج الأمان الأسري\"، الرياض، منذ عام 2012م\r\n          وحتى عام 2017م.\r\n        </li>\r\n        <li>عضو مهرجان سوق عكاظ، الرياض، منذ عام 2012م وحتى عام 2017م.</li>\r\n        <li>\r\n          عضو فريق عمل الاستراتيجية الوطنية لتنمية الحرف والصناعات اليدوية،\r\n          الرياض، منذ عام 2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة الأولمبية العربية السعودية، الهيئة العامة للرياضة، الرياض،\r\n          منذ عام 2012م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          رئيس اللجنة الإشرافية العليا لجائزة التعليم للتميز، إدارة التعليم،\r\n          الرياض، منذ عام 2011م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة الوطنية للسلامة المرورية بمدينة الملك عبدالعزيز، الرياض،\r\n          منذ عام 2011م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة العليا للسلامة المرورية في الأمن العام، الرياض، منذ عام\r\n          2011م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو اللجنة الوطنية للعناية بالفكر والسلوك، وزارة الداخلية، الرياض، منذ\r\n          عام 2011م وحتى عام 2017م.\r\n        </li>\r\n        <li>عضو مجلس إدارة مركز قياس، الرياض، منذ عام 2011م وحتى عام 2017م.</li>\r\n        <li>\r\n          عضو اللجنة الوطنية لرعاية السجناء، الشؤون الاجتماعية، الرياض، منذ عام\r\n          2011م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          وكيل وزارة التعليم ومستشار للوزير للشؤون التعليمية، وزارة التعليم،\r\n          الرياض، منذ عام 2010م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة الهيئة العامة للسياحة والتراث الوطني، هيئة السياحة،\r\n          الرياض، منذ عام 2010م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          عضو مجلس إدارة الهيئة الوطنية للتقويم والاعتماد الأكاديمي، الرياض، منذ\r\n          عام 2010م وحتى عام 2017م.\r\n        </li>\r\n        <li>\r\n          الرئيس التنفيذي لشركة معارف للتعليم والتدريب، شركة مساهمة مقفلة مقرها\r\n          في الرياض وتعمل في مجال التعليم والتدريب، منذ عام 2006م وحتى عام\r\n          2010م.\r\n        </li>\r\n        <li>\r\n          أمين عام إدارات التعليم، وزارة التعليم، الرياض، منذ عام 2004م وحتى عام\r\n          2005م.\r\n        </li>\r\n        <li>\r\n          مدير عام التعليم الأهلي، وزارة التعليم، الرياض، منذ عام 1997م وحتى عام\r\n          2005م.\r\n        </li>\r\n        <li>\r\n          مدير عام النشاط الطلابي، وزارة التعليم، الرياض، منذ عام 1993م وحتى عام\r\n          1997م.\r\n        </li>\r\n        <li>\r\n          مدير النشاط الطلابي، إدارة تعليم الرياض، الرياض، منذ عام 1991م وحتى\r\n          عام 1992م.\r\n        </li>\r\n      </ul>', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2357, 134, 56, '0007-11-20', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2358, 134, 63, 'عضو مجلس الإدارة', '2020-12-15 12:03:28', '2020-12-15 12:03:28'),
(2359, 135, 35, '<ul>\r\n        <li>\r\n          عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2018م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          عضو لجنة المراجعة في شركة عطاء التعليمية منذ عام 2016م وحتى تاريخ هذه\r\n          النشرة.\r\n        </li>\r\n        <li>\r\n          المدير التنفيذي لقطاع الخدمات المساندة في شركة تطوير للخدمات\r\n          التعليمية، شركة ذات مسؤولية محدودة مركزها الرئيس بالرياض وتعمل في مجال\r\n          تطوير التعليم في المملكة العربية السعودية، منذ عام 2016م.\r\n        </li>\r\n      </ul>', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2360, 135, 36, '50', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2361, 135, 37, '<ul>\r\n        <li>\r\n          شهادة محاسب قانوني (SOCPA)، الهيئة السعودية للمحاسبين القانونيين،\r\n          المملكة العربية السعودية، عام 1997م.\r\n        </li>\r\n        <li>عضو IRCA ، International Register of Certified Auditor</li>\r\n        <li>عضو IIA – International Internal Auditor.</li>\r\n        <li>بكالوريوس محاسبة، جامعة الكويت، الكويت، عام 1993م.</li>\r\n      </ul>', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2362, 135, 38, 'سعودي', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2363, 135, 39, '<ul>\r\n        <li>\r\n          عضو لجنة المراجعة، الشركة السعودية للأسماك، شركة مساهمة مركزها الرئيس\r\n          بالرياض وتعمل في مجال الصيد وتربية الأسماك، منذ عام 2016 وحتى عام\r\n          2017م.\r\n        </li>\r\n        <li>\r\n          المدير التنفيذي للشؤون المالية، شركة نوبكو للشراء الموحد، شركة مساهمة\r\n          مقفلة مركزها الرئيس بالرياض وتعمل في القطاع الصحي، منذ عام 2009م وحتى\r\n          عام 2013م.\r\n        </li>\r\n        <li>\r\n          مدير عام الشؤون المالية، مجلس إدارة أعمال الشيخ صالح الراجحي، شركة ذات\r\n          مسؤولية محدودة مركزها الرئيس بالرياض وتعمل في مجال الاستثمار المالي\r\n          والعقاري، منذ عام 2006م وحتى عام 2009م.\r\n        </li>\r\n        <li>\r\n          مدير عام الشؤون المالية والإدارية، شركة أي جي آند جي الشرق الأوسط،\r\n          شركة ذات مسؤولية محدودة مركزها الرئيس بالرياض وتعمل في المجالات\r\n          التقنية والأمنية، منذ عام 1997م وحتى عام 2006م.\r\n        </li>\r\n        <li>\r\n          رئيس الحسابات، شركة أي بي في روك قروب، شركة ذات سجل تجاري خاص مركزها\r\n          الرئيس بالرياض وتعمل في تنفيذ المشروع السعودي للخزن الاستراتيجي –\r\n          وزارة الدفاع، منذ عام 1993م وحتى عام 1997م.\r\n        </li>\r\n      </ul>', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2364, 135, 56, '0007-11-20', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2365, 135, 63, 'عضو مجلس الإدارة', '2020-12-15 12:08:08', '2020-12-15 12:08:08'),
(2366, 136, 35, '<ul>\r\n  <li>عضو مجلس إدارة شركة عطاء التعليمية منذ عام 2018م وحتى تاريخ هذه النشرة.</li>\r\n  <li>المدير العام المساعد للمدارس العالمية في شركة عطاء التعليمية منذ عام 2015م وحتى تاريخ هذه النشرة.</li>\r\n  <li>قائدة مدارس الشرق الأوسط الجديدة العالمية ومساعدة المشرف العام منذ عام 2006م وحتى تاريخ هذه النشرة.</li>\r\n</ul>', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2367, 136, 36, '38', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2368, 136, 37, '<ul>\r\n  <li>ماجستير بحوث الأعمال، جامعة إسكس، كولشستر، المملكة المتحدة، عام 2014م.</li>\r\n  <li>ماجستير إدارة الأعمال، جامعة الملك سعود، الرياض، المملكة العربية السعودية، عام 2009م.</li>\r\n  <li>بكالوريوس الحاسب الآلي والتربية، جامعة الملك سعود، الرياض، المملكة العربية السعودية، عام 2004م.</li>\r\n</ul>', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2369, 136, 38, 'سعودية', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2370, 136, 39, '<ul>\r\n  <li>أستاذة متعاونة في كلية إدارة الأعمال، جامعة الملك سعود، منذ عام 2009م وحتى عام 2010م.</li>\r\n  <li>معلمة حاسب آلي، مدارس الفكر الأهلية، منذ عام 2004م وحتى عام 2006م.</li>\r\n</ul>', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2371, 136, 56, '0007-11-20', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2372, 136, 63, 'عضو مجلس الإدارة', '2020-12-15 12:11:48', '2020-12-15 12:11:48'),
(2373, 137, 35, '<ul>\r\n  <li>أمين سر مجلس الإدارة في شركة عطاء التعليمية منذ عام 2016م وحتى تاريخ هذه النشرة.</li>\r\n  <li>مدير مكتب الرئيس التنفيذي في شركة عطاء التعليمية منذ عام 2011م وحتى تاريخ هذه النشرة.</li>\r\n</ul>', '2020-12-15 12:14:34', '2020-12-15 12:14:34'),
(2374, 137, 36, '44', '2020-12-15 12:14:34', '2020-12-15 12:14:34'),
(2375, 137, 37, '<ul>\r\n <li>بكالوريوس تربية إنجليزي، جامعة طنطا، طنطا، جمهورية مصر العربية، عام 1996م.</li>\r\n</ul>', '2020-12-15 12:14:34', '2020-12-15 12:14:34'),
(2376, 137, 38, 'مصري', '2020-12-15 12:14:34', '2020-12-15 12:14:34'),
(2377, 137, 39, '<ul>\r\n  <li>معلم لغة إنجليزية في المعهد الثانوي الصناعي الملكي، معهد تابع للمؤسسة العامة للتدريب التقني والمهني ومقره بالرياض، منذ عام 2010م وحتى عام 2011م.</li>\r\n  <li>معلم لغة إنجليزية في معهد الفاروق الثانوي التجاري، شركة ذات مسؤولية محدودة مركزها الرئيس بالرياض وتعمل في مجال التعليم والتدريب، منذ عام 1998م وحتى عام 2010م.</li>\r\n  <li>معلم لغة إنجليزية في مدرسة القرشية الإعدادية، مدرسة تابعة لوزارة التربية والتعليم المصرية، القاهرة، جمهورية مصر العربية، منذ عام 1996م وحتى عام 1998م.</li>\r\n</ul>', '2020-12-15 12:14:34', '2020-12-15 12:14:34'),
